      "desc_de": "Dieser Hering dreht seine Runden in Hafenn\u00e4he, weshalb er auch so leicht gefangen werden kann. In Ufern\u00e4he der Hafenstadt Limsa Lominsa scheint es ihm am besten zu gefallen.",
