      "desc_en": "Legend states that once a normal fish, the flounder was stepped upon by the Wanderer during one of His journeys, and left for dead. Upon finding the fish, the Navigator succeeded in breathing life back into the denizen of the deep, but could not restore it from its new flattened form.",
      "desc_ja": "\u5c71\u795e\u30aa\u30b7\u30e5\u30aa\u30f3\u306b\u8e0f\u307e\u308c\u3066\u6b7b\u3093\u3060\u5ddd\u9b5a\u3092\u3001\u5973\u795e\u30ea\u30e0\u30ec\u30fc\u30f3\u304c\u54c0\u308c\u307f\u5e73\u3089\u306a\u6d77\u9b5a\u3068\u3057\u3066\u7526\u3089\u305b\u305f\u3068\u3044\u3046\u4f1d\u8aac\u304c\u3042\u308b",
      "desc_de": "Einer alten Sage zufolge wurde dieser Flussfisch von Oschon dem Wanderer platt getreten und starb. Llymlaen die Lotsin hatte jedoch Mitleid mit ihm und belebte ihn in seiner nun sehr flachen Form wieder.",
      "desc_fr": "Platichthys moribius\r\nLa l\u00e9gende raconte qu'Oschon le Vagabond aurait mal\u00aden\u00adcon\u00adtreu\u00adse\u00adment \u00e9cras\u00e9 ce poisson de rivi\u00e8re. La d\u00e9esse Llymlaen, prenant piti\u00e9 du malheureux animal, l'aurait ressuscit\u00e9 en tant que poisson de mer, en lui laissant son apparence aplatie.",
      "desc_ko": "\uc0b0\uc2e0 \uc624\uc26c\uc628\uc5d0\uac8c \ubc1f\ud600 \uc8fd\uc740 \ubbfc\ubb3c\uace0\uae30\ub97c \uc5ec\uc2e0 \ub9ac\ubbc8\ub80c\uc774 \uac00\uc5fe\uac8c \uc5ec\uaca8 \ub0a9\uc791\ud55c \ubc14\ub2f7\ubb3c\uace0\uae30\ub85c \ub418\uc0b4\ub824\uc8fc\uc5c8\ub2e4\uace0 \ud55c\ub2e4.",
