      "desc_en": "Large schools of these dark silver fish can be found in the White Maiden and her tributaries. Their tendency to gather in great numbers makes them quite easy to catch, and as such they have been a staple for those living in the Twelveswood since the time of the first settlers.",
      "desc_ja": "\u96d1\u98df\u6027\u3067\u826f\u578b\u306e\u500b\u4f53\u304c\u7c21\u5358\u306b\u91e3\u308c\u308b\u305f\u3081\u3001\u6f01\u5e2b\u306b\u4eba\u6c17\u304c\u3042\u308b\u3002\u5869\u3092\u304b\u3051\u3066\u7099\u3063\u305f\u3060\u3051\u3067\u7f8e\u5473\u3057\u3044\u70b9\u3082\u4eba\u6c17\u306e\u79d8\u5bc6",
      "desc_de": "Dieser S\u00fc\u00dfwasserfisch ist sehr leicht zu fangen, da er fast alles frisst. Angler lieben ihn des Weiteren auch deswegen, weil man ihn einfach nur salzen und r\u00f6sten muss, um seinen exquisiten Geschmack kennenzulernen. ",
      "desc_fr": "Opalus carpio\r\nCe poisson omnivore est tr\u00e8s facile \u00e0 p\u00eacher, ce qui le rend populaire chez les p\u00eacheurs d\u00e9butants. Il est de plus d\u00e9licieux une fois grill\u00e9 sur le feu et sal\u00e9.",
      "desc_ko": "\uc7a1\uc2dd\uc131\uc774\ub77c \ud07c\uc9c1\ud55c \uac83\ub3c4 \uc27d\uac8c \uc7a1\uc744 \uc218 \uc788\uc5b4 \uc5b4\ubd80\uc5d0\uac8c \uc778\uae30 \uc788\ub2e4. \uc18c\uae08\uc744 \ubfcc\ub824\uc11c \uad7d\uae30\ub9cc \ud574\ub3c4 \ub9db\uc788\ub2e4\ub294 \uc810\ub3c4 \uc778\uae30 \ube44\uacb0.",
