      "desc_fr": "Amblyopsis vylbrandicus\r\nL'obscurit\u00e9 dans laquelle vit ce poisson a entra\u00een\u00e9 la d\u00e9g\u00e9n\u00e9rescence de son syst\u00e8me oculaire. Par chance, il n'a aucun pr\u00e9dateur naturel. Il chasse en d\u00e9tectant les variations de courants.",
