      "desc_de": "Weil sie liebend gerne tote Fische und Algen verspeist, tr\u00e4gt diese Krabbe den Spitznamen \u201eFlussreiniger\u201c. Wenn sie irgendwann aussterben sollte, w\u00fcrde das ein ganzes \u00d6kosystem aus der Balance bringen.",
      "desc_fr": "Pseudosesarma moeshi\r\nCe d\u00e9capode est surnomm\u00e9 \u201cnettoyeur des rivi\u00e8res\u201d parce qu'il se nourrit de carcasses de poissons morts et d'algues. On raconte m\u00eame qu'il est in\u00addis\u00adpen\u00adsa\u00adble \u00e0 la survie des rivi\u00e8res.",
      "desc_ko": "\uc8fd\uc740 \ubb3c\uace0\uae30\ub098 \ud574\uc870\ub958\ub97c \uba39\uae30 \ub54c\ubb38\uc5d0 '\uac15\uc758 \uccad\uc18c\ubd80'\ub77c\uace0 \ubd88\ub9b0\ub2e4. \uc774 \uac8c\uac00 \uc0ac\ub77c\uc9c0\uba74 \uac15\uc774 \ud0c1\ud574\uc9c4\ub2e4\uace0 \ud55c\ub2e4.",
