      "desc_ja": "\u5ddd\u3067\u751f\u307e\u308c\u3001\u6d77\u3067\u80b2\u3061\u3001\u518d\u3073\u5ddd\u306b\u623b\u308a\u7523\u5375\u3057\u3066\u6b7b\u3092\u8fce\u3048\u308b\u3002\u305d\u308c\u3086\u3048\u547d\u306e\u5faa\u74b0\u3092\u8c61\u5fb4\u3059\u308b\u3068\u3082\u8003\u3048\u3089\u308c\u3066\u3044\u308b",
