      "desc_de": "Wenn diese Muschel \u00fcberrascht oder gereizt wird, springt sie geradezu aus ihrem Zufluchtsort heraus. Dieses vorhersehbare Verhalten haben sich Seev\u00f6gel zu Nutze gemacht. Sie lassen in der N\u00e4he kleine Steine fallen und schnappen sich die Muschel sofort, wenn diese sich zeigt.",
