      "desc_de": "Dieses Schalen-Weichtier speichert alle Verunreinigungen und Fremdk\u00f6rper, anstatt sie auszusto\u00dfen. Zur Genie\u00dfbarkeit dieser Muschel muss also nicht mehr viel gesagt werden. Auf der anderen Seite ist die Wasserqualit\u00e4t in Gew\u00e4ssern, in denen sie sich aufh\u00e4lt, meist hervorragend.",
