      "name_ko": "\ud574\ub9c8",
      "desc_en": "It is said that the naturalist who first discovered the wavekin wished to name it a \u201csea horse,\u201d after a creature he once claimed to have seen on his travels in Ilsabard. However, when his colleagues all chided him, the crestfallen naturalist begrudgingly settled on the more common \u201cchocobo.\u201d",
