      "desc_en": "A large whiskered fish that can be found in the calm marshes of the Black Shroud. It uses those whiskers to sense the movement of nearby fish, waiting patiently until one swims directly in front of it. Once close enough, the catfish will open its massive maw and swallow its prey whole.",
      "desc_ja": "\u6e56\u6cbc\u306e\u5e95\u306b\u6f5c\u3080\u5de8\u5927\u9b5a\u3002\u611f\u899a\u5668\u3067\u3042\u308b\u9577\u3044\u30d2\u30b2\u306b\u3088\u308a\u3001\u7372\u7269\u304c\u767a\u3059\u308b\u632f\u52d5\u3092\u611f\u77e5\u3002\u773c\u524d\u306e\u7372\u7269\u3092\u4e00\u6c17\u306b\u5451\u307f\u8fbc\u3080",
      "desc_de": "Versteckt sich trotz seiner stattlichen Gr\u00f6\u00dfe sehr geschickt auf dem Grund von stehenden Gew\u00e4ssern. Seine langen Barteln nehmen selbst die kleinsten Schwingungen wahr und sobald sich ein Beutefisch in seiner N\u00e4he befindet, wird er mit einem Happen verschluckt.",
      "desc_fr": "Silurus niger\r\nCe grand silure vit en eaux lacustres. Ces moustaches, qui lui servent d'organes de d\u00e9tection, lui permettent de rep\u00e9rer ses proies avant de les gober d'une traite.",
      "desc_ko": "\ud638\uc218 \ubc14\ub2e5\uc5d0 \uc228\uc5b4 \uc0ac\ub294 \uac70\ub300\uc5b4. \uac10\uac01\uae30\uad00\uc778 \uae34 \uc218\uc5fc\uc73c\ub85c \uba39\uc787\uac10\uc774 \uc77c\uc73c\ud0a4\ub294 \uc9c4\ub3d9\uc744 \uac10\uc9c0\ud558\uace0 \ub208\uc55e\uc758 \uba39\uc774\ub97c \ub2e8\ubc88\uc5d0 \uc9d1\uc5b4\uc0bc\ud0a8\ub2e4.",
