      "desc_en": "A cherry-colored saltwater fish found in abundance in all of Eorzea's five seas, though it is said those caught near Bianaq are the largest. The pinkish hue of its scales is thought to come from the finger shrimp upon which it preys.",
      "desc_ja": "\u7279\u5fb4\u7684\u306a\u685c\u8272\u306e\u4f53\u8868\u306f\u3001\u30d5\u30a3\u30f3\u30ac\u30fc\u30b7\u30e5\u30ea\u30f3\u30d7\u3092\u4e3b\u98df\u3068\u3059\u308b\u305f\u3081\u3089\u3057\u3044\u3002\u7279\u306b\u30d3\u30a2\u30ca\u30c3\u30af\u5cf6\u7523\u304c\u7f8e\u5473\u3067\u6709\u540d",
      "desc_de": "Sein kirschfarbenes \u00c4u\u00dferes zieht Fingerkrebse an, das Leibgericht dieses Salz\u00adwas\u00adser\u00adfisches. Er selbst gilt bei Fischern vor allem als Delikatesse, wenn er aus Bianaq stammt.",
      "desc_fr": "Abramis brama bianaquensis\r\nOn raconte que ce poisson de mer doit sa couleur ros\u00e9e aux crevettes basilic dont il se nourrit. Les sp\u00e9cimens p\u00each\u00e9s pr\u00e8s de l'\u00eele de Bianaq sont r\u00e9put\u00e9s pour leur chair exquise.",
      "desc_ko": "\ub3c5\ud2b9\ud55c \uc5f0\ubd84\ud64d\ube5b \ubab8 \uc0c9\uae54\uc740 \uc190\uac00\ub77d\uc0c8\uc6b0\ub97c \uc8fc\ub85c \uba39\uae30 \ub54c\ubb38\uc778 \uac83 \uac19\ub2e4. \ube44\uc544\ub098\ud06c \uc12c\uc5d0\uc11c \uc7a1\ud788\ub294 \uac83\uc774 \ud2b9\ud788 \ub9db\uc788\ub2e4.",
