      "desc_en": "Native to the rivers and lakes of the Black Shroud, this freshwater fish uses electric receptors on its body to stun its prey. In recent years, Gridanian naturalists have begun to investigate the therapeutic properties of black ghosts, claiming that a few bells soaking in a lukewarm pool filled with the wavekin can cure various ailments.",
      "desc_ja": "\u96f7\u6c17\u3092\u767a\u3057\u3066\u7372\u7269\u3092\u6c17\u7d76\u3055\u305b\u3066\u6355\u98df\u3059\u308b\u3001\u6050\u308d\u3057\u3044\u9b5a\u3002\u77e5\u3089\u305a\u306b\u8fd1\u3065\u304d\u3001\u96f7\u6483\u3092\u53d7\u3051\u308b\u4eba\u304c\u5e74\u306b\u6570\u4eba\u306f\u3044\u308b",
      "desc_de": "Dieser furchterregende S\u00fc\u00dfwasserfisch sendet Blitze aus, die seine Beute in Ohnmacht fallen lassen, bevor er sich \u00fcber sie hermacht. Auch vor Personen macht er keinen Halt und es gibt jedes Jahr neue Berichte \u00fcber Opfer, die ihm, meist unabsichtlich, zu nahe gekommen sind.",
      "desc_fr": "Apteronotus albifrons\r\nCe redoutable poisson a la facult\u00e9 d'\u00e9tourdir ses proies au moyen de d\u00e9charges \u00e9lectriques. Les humains qui ont l'imprudence de s'en approcher de trop pr\u00e8s en font parfois les frais.",
