      "desc_ko": "\uc2dd\uc7ac\ub8cc\ub85c \uc720\uba85\ud55c \ubb3c\uace0\uae30. \uc774 \ubb3c\uace0\uae30\ub294 \ud574\ub9c8\ub2e4 \uac15\uc744 \uac70\uc2ac\ub7ec \uc62c\ub77c\uac00\ub294\ub370, \ub9c8\ubb3c\uc774\ub098 \uc9d0\uc2b9\uc5d0\uac8c\ub3c4 \uadc0\ud55c \uba39\uc787\uac10\uc774\ub2e4.",
