      "desc_de": "Der K\u00f6rper dieses Salz\u00adwas\u00adser\u00adfisches ist sehr straff und es ist fast unm\u00f6glich, ihn zu zerkochen. Er ist daher als Zutat f\u00fcr Eint\u00f6pfe sehr gefragt. Wegen seines guten Geschmacks gilt er als K\u00f6nig des Nordmeeres.",
      "desc_fr": "Melanogrammus aeglefinus\r\nCe poisson est souvent cuisin\u00e9 en rago\u00fbt pour sa bonne tenue \u00e0 la cuisson. Il \u00e9tait connu comme \u00e9tant un mets appr\u00e9ci\u00e9 du Roi des mers du nord.",
      "desc_ko": "\uc0b4\uc774 \ucac4\uae43\ud574\uc11c \ud479 \uc0b6\uc544\ub3c4 \ubb3c\ub7ec\uc9c0\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \ucc1c \uc694\ub9ac\uc5d0 \uc790\uc8fc \uc4f0\uc778\ub2e4. \ubd81\ud574\uc5d0\uc11c \uc774\ub984\ub09c \uc784\uae08\uc774 \uc990\uaca8 \uba39\ub294 \uac83\uc73c\ub85c\ub3c4 \uc720\uba85\ud558\ub2e4.",
