      "desc_ja": "\u7d30\u304b\u304f\u30d2\u30ec\u3092\u9707\u52d5\u3055\u305b\u308b\u3053\u3068\u3067\u3001\u7802\u3092\u6db2\u72b6\u5316\u3055\u305b\u3066\u6cf3\u3050\u7802\u6d77\u9b5a\u3002\u30d6\u30ea\u30fc\u30e0\u306b\u4f3c\u3066\u3044\u308b\u304c\u3001\u5b9f\u306f\u8fd1\u7e01\u7a2e\u3067\u306f\u306a\u3044",
      "desc_de": "Dieser Fisch kann sich auch im Sand fortbewegen. Er sieht einer Brasse zwar \u00e4hnlich, ist aber in Wahrheit nicht mit ihr verwandt.",
