      "desc_ko": "\uc9c0\ub290\ub7ec\ubbf8\ub97c \uc0b4\uc0b4 \ud754\ub4e4\uc5b4\uc11c \ubaa8\ub798\ub97c \ubb3c\ucc98\ub7fc \ub9cc\ub4e4\uc5b4 \ud5e4\uc5c4\uce58\ub294 \ubaa8\ub7ab\uace0\uae30. \ub3c4\ubbf8\uc640 \ub2ee\uc558\uc9c0\ub9cc \uc0ac\uc2e4\uc740 \uadfc\uc5f0\uc885\uc774 \uc544\ub2c8\ub2e4.",
