      "desc_de": "Dieser Fisch zeichnet sich durch seine \u00dcberlebensf\u00e4higkeit in den Brackwassergebieten von Flussm\u00fcndungen aus. Sein gefleckter K\u00f6rper ist sehr ansehnlich, was ihn zu einem beliebten Objekt in Aquarien macht. Ihn zu z\u00fcchten ist allerdings \u00e4u\u00dferst schwierig.",
      "desc_fr": "Tetraodon virens\r\nCe poisson vit en eau douce, saum\u00e2tre ou sal\u00e9e. Ses jolis motifs le rendent populaires comme poisson d'agr\u00e9ment, mais l'\u00e9levage est tr\u00e8s d\u00e9licat.",
