      "desc_de": "Diese Spezies macht sich Aufwinde zunutze, um durch die Wolken zu fliegen, kann aber auch pfeilschnell nach unten durchbrechen, um ihre Beute zu erwischen. Der Wolkenspalter ist so schnell, dass er sogar L\u00f6cher in die Au\u00dfenhaut eines Luftschiffes rei\u00dfen kann. ",
      "desc_fr": "Cypselurus nimbus\r\nCe l\u00e9ger poisson plane sur les courants d'air ascendants pour s'\u00e9lever et attrape des insectes lors de sa descente brutale. Il chute si rapidement qu'on dit qu'il transperce parfois les toiles des a\u00e9ronefs.",
      "desc_ko": "\uc0c1\uc2b9 \uae30\ub958\ub97c \ud0c0\uace0 \ud558\ub298\ub85c \uc62c\ub77c\uac14\ub2e4\uac00 \uc3dc\uc0b4\uac19\uc774 \ub0b4\ub824\uc624\uba70 \ub0a0\ubc8c\ub808\ub97c \ub36e\uce5c\ub2e4. \uadf8 \uc18d\ub3c4\uac00 \ubb34\ucc99 \ube68\ub77c\uc11c \ube44\uacf5\uc815 \uacf5\uae30\uc8fc\uba38\ub2c8\uc5d0 \uad6c\uba4d\uc744 \ub6ab\uae30\ub3c4 \ud55c\ub2e4.",
