      "desc_en": "Lacking feet or wings to propel itself from the ground, only death awaits the saucerfish that is foolish enough to leave the Sea of Clouds. Ishgardian legend says that the saucerfish are the descendants(?) of a plate of fish tossed out a window and into the Sea of Clouds by a finicky king.",
      "desc_ja": "\u4e0d\u5473\u3044\u9b5a\u6599\u7406\u306b\u6fc0\u6012\u3057\u305f\u738b\u304c\u3001\u76bf\u3054\u3068\u96f2\u6d77\u306b\u6295\u3052\u6368\u3066\u305f\u3068\u3053\u308d\u3001\u305d\u308c\u304c\u3053\u306e\u9b5a\u306b\u751f\u307e\u308c\u5909\u308f\u3063\u305f\u3068\u3044\u3046\u6c11\u8a71\u304c\u3042\u308b",
      "desc_de": "Einem Volksm\u00e4rchen zufolge gab es einmal einen Herrscher, der aus Wut \u00fcber ein misslungenes Fischgericht alle Teller ins Wolkenmeer werfen lie\u00df. Die Teller wurden daraufhin zu Tellerfischen.",
      "desc_fr": "Aurelia scutella\r\nD'apr\u00e8s une l\u00e9gende folklorique, ce poisson serait n\u00e9 lorsqu'un client m\u00e9content d'un restaurant aurait jet\u00e9 par la fen\u00eatre son assiette de poisson.",
      "desc_ko": "\ub9db\uc5c6\ub294 \uc0dd\uc120\uc694\ub9ac\uc5d0 \ud654\uac00 \ub09c \uc5b4\ub290 \uc655\uc774 \uc811\uc2dc\uc9f8 \uad6c\ub984\ubc14\ub2e4\uc5d0 \ub0b4\ub358\uc84c\ub294\ub370, \uadf8\uac83\uc774 \ubb3c\uace0\uae30\ub85c \ub2e4\uc2dc \ud0dc\uc5b4\ub0ac\ub2e4\ub294 \ubbfc\ub2f4\uc774 \uc788\ub2e4.",
