      "name_ko": "\uc0b4\ub77c\uc624\uc2a4 \uac08\uce58",
      "desc_en": "Despite the modifier, the little Thalaos is anything but small; compared to the Thalaos of legend, even the largest of sea serpents would be deemed \u201clittle.\u201d As is the case with most deep-ocean fish, its body is composed of a thick wax-like fat and little else, making it an unpleasant addition to any dinner table.",
      "desc_ja": "\u4f1d\u8aac\u306e\u5927\u6d77\u86c7\u300c\u30b5\u30e9\u30aa\u30b9\u300d\u306e\u5b50\u306b\u55a9\u3048\u3089\u308c\u308b\u5b58\u5728\u3002\u6df1\u6d77\u9b5a\u3089\u3057\u304f\u874b\u306b\u8986\u308f\u308c\u305f\u8089\u306b\u306f\u3001\u53ef\u98df\u90e8\u304c\u307b\u3068\u3093\u3069\u306a\u3044",
      "desc_de": "Dieser Tiefseebewohner wird oft als \u201eKind der riesigen Seeschlange Thalaos\u201c umschrieben, ist aber alles andere als klein und eignet sich wie viele Tiefseefische nicht als Mahlzeit.",
      "desc_fr": "Thalaos minor\r\nOn appelle aussi ce poisson \u201cfils de Thalaos\u201d, en r\u00e9f\u00e9rence au mythique serpent de mer. Comme nombre de poissons des profondeurs, son corps est cireux et comporte tr\u00e8s peu de parties comestibles.",
      "desc_ko": "\uc804\uc124\uc758 \ub300\uc655\ubc14\ub2e4\ubc40 '\uc0b4\ub77c\uc624\uc2a4'\uc758 \uc790\uc2dd\uc774\ub77c\uace0 \ud55c\ub2e4. \uc2ec\ud574\uc5b4\ub2f5\uac8c \uc0b4\uc774 \ubc00\ub78d\uc73c\ub85c \ub36e\uc5ec \uc788\uae30 \ub54c\ubb38\uc5d0 \uba39\uc744 \uc218 \uc788\ub294 \ubd80\ubd84\uc740 \uac70\uc758 \uc5c6\ub2e4.",
