      "desc_de": "Einer m\u00fcndlichen \u00dcberlieferung zufolge ertrank einmal ein Seemann, dessen Fu\u00df in K\u00fcstenn\u00e4he in einer Wellenmuschel eingeklemmt war, in der heranbrausenden Flut. In Wahrheit dauert es allerdings relativ lange, bis sich diese Muschel geschlossen hat.",
      "desc_fr": "Tridacna crocea\r\nCe bivalve serait capable de fermer sa coquille si puissamment qu'on raconte qu'un marin ayant le pied coinc\u00e9 dans un cocoquillage serait mort \u00e0 la venue de la mar\u00e9e haute. En r\u00e9alit\u00e9, il est incapable de se refermer rapidement.",
