      "desc_en": "A large saltwater fish found in the warm waters south of the Sea of Ash and known for its remarkable swimming speed. Legend says that after stealing one of Llymlaen's scepters and using that speed to escape, the Navigator was so infuriated that She placed a curse on the wavekin, dooming it to death if it ever slowed.",
      "desc_ja": "\u8d85\u9ad8\u901f\u3067\u6cf3\u3050\u5927\u578b\u9b5a\u3002\u304b\u3064\u3066\u5973\u795e\u30ea\u30e0\u30ec\u30fc\u30f3\u306e\u5165\u6d74\u3092\u306e\u305e\u304d\u898b\u305f\u305f\u3081\u3001\u6b62\u307e\u308b\u3068\u6b7b\u306c\u546a\u3044\u3092\u304b\u3051\u3089\u308c\u305f\u3068\u3044\u3046",
      "desc_de": "Dieser Salz\u00adwas\u00adser\u00adfisch bewegt sich unaufhaltsam mit hoher Ge\u00adschwindig\u00adkeit fort. Man sagt, er habe vor langer Zeit einen verstohlenen Blick auf G\u00f6ttin Llymlaen geworfen, als diese gerade badete und wurde deshalb mit einem Fluch belegt, der ihn sofort t\u00f6tet, sobald er nicht mehr in Bewegung ist.",
      "desc_fr": "Tetrapturus mazlayanus\r\nCe grand poisson est tr\u00e8s rapide et toujours en mouvement. La l\u00e9gende raconte qu'il aurait autrefois surpris Llymlaen dans son bain. Furieuse, elle lui aurait jet\u00e9 un sort qui le ferait mourir s'il s'arr\u00eate.",
      "desc_ko": "\uc5c4\uccad\ub09c \uc18d\ub3c4\ub85c \ud5e4\uc5c4\uce58\ub294 \ub300\ud615\uc5b4. \uba3c \uc61b\ub0a0 \uc5ec\uc2e0 \ub9ac\ubbc8\ub80c\uc774 \ubaa9\uc695\ud558\ub294 \uac78 \ud6d4\uccd0\ubd24\uae30 \ub54c\ubb38\uc5d0 \uba48\ucd94\uba74 \uc8fd\ub294 \uc800\uc8fc\ub97c \ubc1b\uc558\ub2e4\uace0 \ud55c\ub2e4.",
