      "desc_de": "Dieser kapitale Meerengel zeichnet sich durch ungew\u00f6hnliches Wachstum aus. Er enth\u00e4lt au\u00dferdem eine extrem hohe Konzentration Ciguatoxine, was bedeutet, dass selbst der kleinste Bissen von seinem Fleisch t\u00f6dliche Folgen hat.",
