      "desc_ja": "\u71b1\u6c34\u3092\u597d\u3080\u30c8\u30e9\u30a6\u30c8\u3002\u3042\u308b\u8abf\u7406\u5e2b\u304c\u3001\u4e38\u8339\u3067\u306b\u3057\u3088\u3046\u3068\u3057\u305f\u304c\u716e\u3066\u3082\u307e\u3063\u305f\u304f\u6b7b\u306a\u306a\u304b\u3063\u305f\u305f\u3081\u3001\u653e\u6d41\u3057\u305f\u3068\u3044\u3046",
      "desc_de": "Die tapfere K\u00e4mpferin wurde im zarten Alter von 17 Jahren ge\u00adfangen\u00adge\u00adnommen, zu einem delikaten Tode verurteilt und den heiligen Flammen der R\u00f6stung \u00fcbergeben. Doch die Flammen verschm\u00e4hten sie. Sodann wurde sie in die reinigenden Wasser des Kochens gesto\u00dfen, doch das Wasser verschm\u00e4hte sie. Schlie\u00dflich entlie\u00df man sie wieder in ihren See.",
      "desc_fr": "Attrap\u00e9e, puis jet\u00e9e vivante dans une marmite d'eau bouillante o\u00f9 elle subit les tourments des flammes pendant des heures, cette truite h\u00e9ro\u00efque fut finalement rel\u00e2ch\u00e9e dans son lac par son cuisinier tortionnaire.",
