      "name_en": "Sylphsbane",
      "name_ja": "\u30b7\u30eb\u30d5\u30ba\u30d9\u30fc\u30f3",
      "name_de": "Sylphenschreck",
      "name_fr": "Fl\u00e9au des Sylphes",
      "name_ko": "\uc2e4\ud504\ud30c\uba78\uc5b4",
      "desc_en": "Instead of utilizing its inherent tendency to propel itself from the water and scale tiny waterfalls, this particular troublemaker will, for reasons unknown, leap forth only to strike at sylphs who have wandered too close to its home. To this date, however, the only injuries recorded as a result of the odd attacks have been to fragile egos.",
      "desc_ja": "\u5ddd\u306e\u4e0a\u3092\u98db\u3093\u3067\u6e21\u308d\u3046\u3068\u3059\u308b\u30b7\u30eb\u30d5\u65cf\u306b\u5bfe\u3057\u3001\u9a5a\u7570\u7684\u306a\u8df3\u8e8d\u529b\u3067\u4f53\u5f53\u305f\u308a\u3092\u304b\u307e\u3059\u5de8\u5927\u9b5a\u3002\u305d\u306e\u7406\u7531\u306f\u5b9a\u304b\u3067\u306f\u306a\u3044",
      "desc_de": "Der Sylphenschreck nutzt seine Sprungf\u00e4higkeit nur, wenn sich eine Sylphe zu nah an sein Revier wagt. Doch selten f\u00fchren diese Attacken zu einer ernsthaften Verletzung - es ist, als ob dieser Fallskipper sich lediglich einen Spa\u00df mit den flattrigen Waldbewohnern erlaubt.",
      "desc_fr": "Ce poisson semble prendre un malin plaisir \u00e0 utiliser sa capacit\u00e9 \u00e0 faire de grands bonds hors de l'eau pour attaquer les Sylphes qui passent par l\u00e0. Heu\u00adreu\u00adse\u00adment, aucune victime n'est encore \u00e0 d\u00e9plorer.",
      "desc_ko": "\uac15\uc744 \uac74\ub108\ub824 \ud558\ub294 \uc2e4\ud504\uc871\uc5d0\uac8c \uacbd\uc774\uc801\uc778 \ub3c4\uc57d\ub825\uc73c\ub85c \ubab8\ud1b5 \ubc15\uce58\uae30\ub97c \ud558\ub294 \uac70\ub300\ubb3c\uace0\uae30. \uc774\uc720\ub294 \uc544\ubb34\ub3c4 \ubaa8\ub978\ub2e4.",
