      "name_ko": "\ud65c\uc9dd\uc789\uc5b4",
      "desc_en": "This ancient carp has survived many a fisher's greedy grasp by violently twisting and turning to snap line from bait, leaving the wavekin with an unnatural grin begot by the countless hooks left buried in its maw.",
      "desc_ja": "\u5e7e\u5ea6\u3068\u306a\u304f\u91dd\u306b\u639b\u304b\u3063\u305f\u304c\u3001\u305d\u306e\u5ea6\u306b\u7cf8\u3092\u5207\u3063\u3066\u751f\u304d\u5ef6\u3073\u3066\u304d\u305f\u3002\u305d\u306e\u53e3\u543b\u306b\u306f\u3001\u52f2\u7ae0\u306e\u3088\u3046\u306b\u30eb\u30a2\u30fc\u3068\u91dd\u304c\u4e26\u3076",
      "desc_de": "Der kapitale Velodyna-Karpfen entgeht seinen zweibeinigen H\u00e4schern, indem er sich auf furiose Weise windet und so auch gut festgezurrte Haken von der Fangleine rei\u00dft. Die dabei unvermeidlich auf seine Maulwinkel wirkenden Kr\u00e4fte sind der Grund f\u00fcr sein charakteristisches Grinsen.",
      "desc_fr": "Bien des p\u00eacheurs peuvent se vanter d'avoir ferr\u00e9 cette carpe de la Velodyna, mais elle leur a \u00e9chapp\u00e9 \u00e0 chaque fois. Elle garde d'ailleurs tous ces hame\u00e7ons dans sa gueule comme autant de troph\u00e9es.",
      "desc_ko": "\uc218\uc5c6\uc774 \ubc14\ub298\uc5d0 \uac78\ub838\uc9c0\ub9cc, \uadf8\ub54c\ub9c8\ub2e4 \uc2e4\uc744 \ub04a\uace0 \uc0b4\uc544\ub0a8\uc558\ub2e4. \uadf8 \uc785\uc5d0\ub294 \ub8e8\uc5b4\uc640 \ubc14\ub298\uc774 \ud6c8\uc7a5\ucc98\ub7fc \ub298\uc5b4\uc838 \uc788\ub2e4.",
