      "name_en": "Worm of Nym",
      "name_ja": "\u30ef\u30fc\u30e0\u30fb\u30aa\u30d6\u30fb\u30cb\u30fc\u30e0",
      "name_de": "Wurm von Nym",
      "name_fr": "Ver de Nym",
      "name_ko": "\ub2c8\ubbc0\uad6c\ub801\uc774",
      "desc_en": "Carvings discovered on the walls of ruins dotting the outer La Noscean landscape suggest that a giant eel-like creature has been terrorizing the people of this land since the peak of the Nymian civilization. Whether this particular specimen is an offspring of said creature\u2500or in fact the creature itself\u2500alas cannot be determined.",
      "desc_ja": "\u7570\u69d8\u306b\u9bae\u3084\u304b\u306a\u7dd1\u8272\u3092\u3057\u305f\u5927\u578b\u30a4\u30fc\u30eb\u3002\u4f1d\u8aac\u306e\u9b54\u7269\u300c\u30c8\u30f3\u30d9\u30ea\u300d\u3092\u4e38\u5451\u307f\u306b\u3057\u305f\u305f\u3081\u3001\u7dd1\u8272\u306b\u306a\u3063\u305f\u3068\u3044\u3046\u5642\u304c\u3042\u308b",
      "desc_de": "Ritzzeichnungen, die in Ruinen des \u00e4u\u00dferen La Noscea gefunden wurden, zeigen, dass bereits die Bewohner des alten Nym von einer aalartigen Kreatur terrorisiert wurden. Ob es sich dabei um ein artgleiches Exemplar des Wurms von Nym oder gar um den gleichen Kapitalen handelt, lie\u00df sich bisher nicht ermitteln.",
      "desc_fr": "Certains pensent que cette immense anguille de jade aurait v\u00e9cu \u00e0 l'\u00e9poque de Nym et aurait pris cette teinte apr\u00e8s avoir d\u00e9vor\u00e9 un tomberry.",
      "desc_ko": "\ub179\uc0c9\uc774 \ubab9\uc2dc \uc120\uba85\ud55c \ub300\ud615\uc7a5\uc5b4. \uc804\uc124\uc758 \ub9c8\ubb3c '\ud1a4\ubca0\ub9ac'\ub97c \uc0bc\ud0a4\uace0 \uadf8\ub7f0 \uc0c9\uc774 \ub418\uc5c8\ub2e4\uace0 \ud55c\ub2e4.",
