      "desc_de": "Der Einsame Schnitter \u00fcberwindet seinen angeborenen Instinkt, im Schwarm zu jagen, und verschlingt seine Beute allein - was ihn zu seiner enormen Gr\u00f6\u00dfe heranwachsen l\u00e4sst. Am liebsten jagt er bei st\u00fcrmischem Wetter\r\nin aufgepeitschter See.",
      "desc_fr": "Pr\u00e9f\u00e9rant rester \u00e0 l'\u00e9cart de ses cong\u00e9n\u00e8res, ce requin-marteau poss\u00e8de une taille ex\u00adcep\u00adtion\u00adnelle. Il semble profiter de la d\u00e9sorientation que les temp\u00eates cr\u00e9ent chez les poissons pour capturer ses proies.",
