      "name_ko": "\uce74\ub860\uc758 \ub4f1\ubd88",
      "desc_en": "Uneducated smallfolk across the realm are vindicated upon learning that while normal lamp marimo have no relation to will-o'-the-wisps or other phantasmal apparitions, this particular ball of moss, after being accidentally devoured (and then subsequently excreted) by the souleater Rongeur, is now harboring several of the beast's stolen spirits.",
      "desc_ja": "\u5996\u3057\u304f\u8f1d\u304f\u30e9\u30f3\u30d7\u30de\u30ea\u30e2\u3002\u9b54\u7363\u300c\u30ed\u30f3\u30b8\u30e5\u30fc\u30eb\u300d\u306b\u55b0\u308f\u308c\u3001\u6b7b\u3057\u305f\u4eba\u3005\u306e\u4ea1\u970a\u304c\u5bbf\u3063\u305f\u7d50\u679c\u3001\u5de8\u5927\u5316\u3057\u305f\u3068\u5642\u3055\u308c\u308b",
      "desc_de": "Dem unwissenden Stadtvolk muss man immer wieder erkl\u00e4ren, dass normale Algenkugeln in keiner Verbindung zu Irrlichtern oder anderen phantasmagorischen Erscheinungen stehen, aber diese glitschige Kugel beherbergt in ihrem\r\nInneren mehrere\r\nGeisterseelen.",
      "desc_fr": "Les petites gens d'\u00c9orz\u00e9a sont persuad\u00e9es que cette marimo luisante doit sa taille ex\u00adtraor\u00addi\u00adnai\u00adre au fait d'avoir \u00e9t\u00e9 aval\u00e9e par la cr\u00e9ature Rongeur d'os et d'\u00eatre d\u00e9sormais le vaisseau d'\u00e2mes d\u00e9funtes.",
      "desc_ko": "\uc12c\ub729\ud558\uac8c \ube5b\ub098\ub294 \ub4f1\ubd88\ud574\uc870\uad6c. \ub9c8\uc218 '\ub871\uc950\ub974'\uc5d0\uac8c \uc7a1\uc544\uba39\ud78c \uc0ac\ub78c\ub4e4\uc758 \ub9dd\ub839\uc774 \uae43\ub4e4\uc5b4 \uac70\ub300\ud654\ud588\ub2e4\uace0 \ud55c\ub2e4.",
