      "name_ko": "\ud608\ubaa9\uc5b4",
      "desc_en": "In her attempt to stay the hands of time, Lady Amandine would not only bathe in the blood of maidens, but the blood of just about anything she believed had skin more smooth or supple than hers\u2500including forest fauna. As a result, especially plump monke onke were poached to near extinction at the behest of the vainglorious crone.",
      "desc_ja": "\u30cf\u30a6\u30b1\u30bf\u5fa1\u7528\u90b8\u306b\u6f5c\u3080\u5996\u7570\u304c\u3001\u622f\u308c\u306b\u8840\u3092\u6d74\u3073\u305b\u305f\u7d50\u679c\u3001\u5de8\u5927\u5316\u3057\u305f\u9b5a\u3002\u96f7\u9cf4\u306b\u53cd\u5fdc\u3057\u3066\u3001\u72c2\u3063\u305f\u3088\u3046\u306b\u66b4\u308c\u59cb\u3081\u308b",
      "desc_de": "Bekannterweise badete Lady Amandine auf ihrer verzweifelten Jagd nach ewiger Jugend im Blute unz\u00e4hliger Jungfrauen. Eigentlich badete sie in allem, was den Alterungsprozess zu stoppen im Rufe stand. Das galt auch f\u00fcr die\r\narmen Monke Onke.",
      "desc_fr": "Ce monke-onke aurait gagn\u00e9 des proportions ex\u00adtraor\u00addi\u00adnai\u00adres \u00e0 cause des jeux sadiques auxquels s'adonnaient les d\u00e9mons du Manoir des Haukke et qui consistaient \u00e0 l'asperger de sang humain.",
