      "name_ko": "\ubcbc\ub77d\ud669\uc790",
      "desc_en": "There is a song sung by the sylphs which tells of a magnificent wavekin caught in the Black Shroud and presented to their lord, Ramuh, as an offering. Taken by its beauty, the Lord of Levin judged that the fish was slain before its time, and granted it life anew. To see it go untouched for all eternity, he took it as his son.",
      "desc_ja": "\u96f7\u795e\u300c\u30e9\u30e0\u30a6\u300d\u306b\u5bfe\u3057\u3001\u30b7\u30eb\u30d5\u65cf\u304c\u6367\u3052\u305f\u4f9b\u7269\u3002\u30e9\u30e0\u30a6\u306f\u3001\u3053\u308c\u3092\u98df\u3059\u3053\u3068\u306a\u304f\u3001\u547d\u3092\u5439\u304d\u8fbc\u3093\u3067\u89e3\u304d\u653e\u3063\u305f\u3068\u3044\u3046",
      "desc_de": "Die Sylphen brachten diesen Fisch ihrem Gebieter Ramuh als Opfer dar. Der Herr der Blitze war von dessen Sch\u00f6nheit so beeindruckt, dass er ihm ein neues Leben schenkte und als seinen Sohn aufnahm.",
      "desc_fr": "Un chant sylphe raconte que cette anguille aurait \u00e9t\u00e9 donn\u00e9e en offrande au Primordial Ramuh, mais ce dernier, touch\u00e9 par la beaut\u00e9 de l'animal, lui aurait redonn\u00e9 vie d'un de ces \u00e9clairs.",
