      "name_fr": "Boyau du tonnerre",
      "name_ko": "\ucc9c\ub465\ud3ec\uc2dd\uc5b4",
      "desc_en": "Kobold legend tells of Thundergut\u2500a mighty sculpin whose gluttony knows no bounds. He swallows the thunder from the clouds before it can manifest, and it is because of this insatiable greed that La Noscean storms are silent save for the falling of the rain.",
      "desc_ja": "\u96f7\u3092\u55b0\u3046\u3068\u5642\u3055\u308c\u308b\u9b5a\u3002\u5916\u5730\u30e9\u30ce\u30b7\u30a2\u3067\u3001\u96e8\u306f\u964d\u308c\u3069\u3082\u3001\u307b\u3068\u3093\u3069\u96f7\u96e8\u306b\u306a\u3089\u306a\u3044\u306e\u306f\u3001\u3053\u306e\u9b5a\u306e\u305b\u3044\u3060\u3068\u3044\u3046",
      "desc_de": "Donnerhall, eine Groppe von legend\u00e4rem Appetit, verschlang einer Koboldlegende nach den aus den Wolken schallenden Donner, und dieser \u00fcberm\u00e4\u00dfigen Gier sei es zu verdanken, dass die St\u00fcrme La Nosceas ohne Ank\u00fcndigung hereinbrechen.",
      "desc_fr": "On raconte que ce grondin d\u00e9vorerait les \u00e9clairs, \u00e9tant la raison m\u00eame pour laquelle il n'y a jamais d'orages dans la Noscea ext\u00e9rieur, une r\u00e9gion o\u00f9 la pluie tombe pourtant souvent.",
      "desc_ko": "\ucc9c\ub465\uc744 \uba39\ub294\ub2e4\uace0 \uc804\ud574\uc9c0\ub294 \ubb3c\uace0\uae30. \uc678\uc9c0 \ub77c\ub178\uc2dc\uc544\uc5d0 \ube44\uac00 \ub0b4\ub824\ub3c4 \ub1cc\uc6b0\uac00 \ub418\uc9c0 \uc54a\ub294 \uac74 \uc774 \ubb3c\uace0\uae30 \ub54c\ubb38\uc774\ub77c\uace0 \ud55c\ub2e4.",
