      "desc_ja": "\u671d\u65e5\u3092\u53d7\u3051\u3066\u7f8e\u3057\u304f\u8f1d\u304f\u3053\u3068\u3067\u77e5\u3089\u308c\u308b\u9b5a\u3002\u65e9\u671d\u8a13\u7df4\u306b\u7cbe\u3092\u51fa\u3059\u3001\u3042\u308b\u9a0e\u58eb\u3044\u308f\u304f\u3001\u3068\u3066\u3082\u30a4\u30a4\u9b5a\u3068\u306e\u3053\u3068",
