      "name_ko": "\ub300\ubaa8\ube59\uc5b4",
      "desc_en": "The mother of a thousand spawn, this hot-blooded smelt swore revenge against mankind the very morning she woke to find her children being hauled away in a trawler's net. How she plans on exacting this revenge is yet to be determined. Please look forward to it!",
      "desc_ja": "\u5049\u5927\u306a\u308b\u30b9\u30e1\u30eb\u30c8\u306e\u6bcd\u30021000\u3092\u8d85\u3048\u308b\u6211\u304c\u5b50\u3092\u3001\u6f01\u5e2b\u306b\u91e3\u308a\u4e0a\u3052\u3089\u308c\u3001\u6c37\u3092\u6eb6\u304b\u3059\u307b\u3069\u6fc0\u3057\u304f\u5fa9\u8b90\u306b\u71c3\u3048\u3066\u3044\u308b",
      "desc_de": "Unbeschreiblich muss der Schmerz dieser stolzen Mutter eines 1000-k\u00f6pfigen Fischlaichs gewesen sein, als sie eines Morgens entdeckte, dass ein Schleppnetz ihre geliebte Brut fortgerissen hatte. Die Matriarchin schwor Rache, doch in welcher Form ist nicht bekannt. Man darf gespannt sein.",
      "desc_fr": "La Matriarche porte ce nom parce qu'elle a donn\u00e9 naissance \u00e0 un millier d'\u00e9perlans, mais les humains les ayant tous p\u00each\u00e9s et assassin\u00e9s, elle compte bien les venger... si elle n'est pas ferr\u00e9e avant !",
      "desc_ko": "\uc704\ub300\ud55c \ube59\uc5b4\uc758 \uc5b4\uba38\ub2c8. \ucc9c\ub9c8\ub9ac\uac00 \ub118\ub294 \uc790\uc2dd\uc744 \uc5b4\ubd80\uc5d0\uac8c \uc783\uc740 \ud6c4\ub85c \uc5bc\uc74c\uc744 \ub179\uc77c \ub9cc\ud07c \ub728\uac70\uc6b4 \ubcf5\uc218\uc2ec\uc5d0 \ubd88\ud0c0\uace0 \uc788\ub2e4.",
