      "name_ko": "\uadf8\ub9bc\uc790\uaf2c\uce58",
      "desc_en": "For generations, fishers would tell their sons and their grandsons tales of Shadowstreak, an elusive pike ten yalms long and half as wide, with a maw large enough to swallow a pregnant bison whole, and fins sharp enough to cut through rock plated in steel-covered iron\u2500with eyes that will snatch a man's soul from his bosom and a cry that will turn a babe's hair white.",
      "desc_ja": "\u5730\u5143\u6f01\u5e2b\u306e\u9593\u3067\u3001\u534a\u3070\u4f1d\u8aac\u3068\u306a\u3063\u3066\u3044\u308b\u9b5a\u3002\u8b66\u6212\u5fc3\u304c\u5f37\u304f\u59ff\u3092\u898b\u305b\u306a\u3044\u305f\u3081\u3001\u9b5a\u5f71\u3092\u898b\u305f\u3060\u3051\u3067\u5e78\u904b\u3068\u3055\u3048\u3044\u308f\u308c\u308b",
      "desc_de": "Seit Generationen erz\u00e4hlen Fischer ihren S\u00f6hnen und Enkeln Schauergeschichten von Schattenstr\u00e4hne, dem schrecklichen Hecht. Zehn Yalme lang und f\u00fcnf Yalme breit, mit einem Maul, das eine hochschwangere Bisonkuh quer verschluckt.",
      "desc_fr": "Depuis bien des g\u00e9n\u00e9rations, les p\u00eacheurs racontent \u00e0 leurs enfants qu'il existe un brochet monstrueux de dix yalms de long, si furtif qu'il semble n'\u00eatre qu'une ombre.",
      "desc_ko": "\uc9c0\ubc29 \uc5b4\ubd80\ub4e4 \uc0ac\uc774\uc5d0\uc11c\ub294 \uac70\uc758 \uc804\uc124\uc774\ub77c \ubd88\ub9ac\ub294 \ubb3c\uace0\uae30. \uacbd\uacc4\uc2ec\uc774 \uac15\ud574 \ubaa8\uc2b5\uc744 \ub4dc\ub7ec\ub0b4\uc9c0 \uc54a\uae30 \ub54c\ubb38\uc5d0 \uadf8\ub9bc\uc790\ub9cc \ubd10\ub3c4 \ud589\uc6b4\uc774 \ucc3e\uc544\uc628\ub2e4\uace0 \ud55c\ub2e4.",
