      "desc_ja": "\u60a0\u4e45\u306e\u6642\u3092\u751f\u304d\u629c\u304d\u3001\u5de8\u4f53\u3092\u7372\u5f97\u3057\u305f\u30ce\u30fc\u30c1\u30e9\u30b9\u3002\u305d\u306e\u6bbb\u3092\u9152\u676f\u306b\u3057\u3088\u3046\u3068\u3001\u5e7e\u591a\u306e\u6d77\u8cca\u305f\u3061\u304c\u6311\u307f\u3001\u65ad\u5ff5\u3057\u3066\u304d\u305f",
      "desc_de": "Um es zum echten Piraten zu schaffen, bedarf es mehr als dem g\u00e4ngigen PAH-Kost\u00fcm (Papagei, Augenklappe und Hakenarm): Nein, einen echten Seer\u00e4uber erkennt man an einem stilechten Beh\u00e4lter f\u00fcr seinen Rum, und was w\u00e4re da besser geeignet als die Schale eines riesigen Perlboots?",
