      "name_fr": "Anomalocaris",
      "name_ko": "\ud558\ub298\uc720\uc601\uc5b4",
      "desc_en": "At the apex of the Sea of Clouds food chain soars the anomalocaris, a breed of rift sailor that catches its prey by rising thermals high up into the heavens, and then plummeting headfirst into unsuspecting cloudkin before they have time to react. So beautiful is this predatory dance, that bards have written numerous ballads detailing its erotic intricacies.",
      "desc_ja": "\u96f2\u6d77\u306e\u98df\u7269\u9023\u9396\u306e\u9802\u70b9\u306b\u7acb\u3064\u5b58\u5728\u3002\u592a\u967d\u3092\u80cc\u306b\u3057\u3066\u6025\u964d\u4e0b\u3057\u3001\u7372\u7269\u306b\u8986\u3044\u88ab\u3055\u308b\u72e9\u308a\u306e\u6280\u306f\u3001\u7f8e\u3057\u304f\u3059\u3089\u3042\u308b",
      "desc_de": "W\u00e4hrend der Paarungszeit zieht dieser fliegende Fisch ein orange leuchtendes Gas hinter sich her, das als Lockmittel im nicht enden wollenden Wei\u00df des Wolkenmeers dient. Trotzdem k\u00f6nnen bis zu sechs Sommer verstreichen, bis der Anomalocaris einen geeigneten Partner findet, so weit und einsam ist das Meer der Wolken.",
      "desc_fr": "Ce timonier du ciel est devenu le plus grand pr\u00e9dateur de la Mer de nuages du Coerthas gr\u00e2ce \u00e0 sa technique de chasse, qui consiste \u00e0 plonger sur ses proies en faisant dos au soleil.",
