      "desc_de": "Dieser uralte Hai ist angeblich ein Abk\u00f6mmling des Gro\u00dfen Drachen, der den Himmel Hydaelyns im Zeitalter vor der Lotsin beherrschte. Die doppelreihige Ausrichtung seiner messerscharfen Z\u00e4hne ist so komplex, dass\r\nnichts jemals wieder\r\ndaraus frei kommt.",
