      "desc_en": "One might think that a body covered in glittering gold scales would make the imperial goldfish a prime target for larger predators such as the jungle catfish...and they would be absolutely correct. The reason this specimen has survived so long is due to its ability to remain completely motionless when danger lurks nearby.",
      "desc_ja": "\u9bae\u3084\u304b\u904e\u304e\u308b\u9c57\u3092\u6301\u3064\u3086\u3048\u306b\u3001\u751f\u304d\u6b8b\u308b\u305f\u3081\u306b\u614e\u91cd\u3055\u3092\u8eab\u306b\u7740\u3051\u305f\u91d1\u9b5a\u3002\u30aa\u30aa\u30e2\u30ea\u30ca\u30de\u30ba\u304c\u8fd1\u304f\u306b\u3044\u308b\u9650\u308a\u3001\u6c7a\u3057\u3066\u52d5\u304b\u306a\u3044",
