      "desc_en": "This giant marlin earned its name after a legendary struggle with one of the realm's most famous fishers. For three days and three nights the grizzled Sea Wolf battled the stubborn marlin, neither showing any sign of yielding, until the old man lost his footing and tumbled into the sea. There he remains to this day\u2500dragged by the marlin, hands still tight around his rod.",
      "desc_ja": "\u5927\u578b\u306e\u5e74\u8001\u3044\u305f\u30de\u30fc\u30ea\u30f3\u3002\u719f\u7df4\u306e\u4e00\u672c\u91e3\u308a\u6f01\u5e2b\u3068\u30013\u65e5\u9593\u306b\u6e21\u308b\u6b7b\u95d8\u3092\u6f14\u3058\u305f\u672b\u306b\u3001\u6d77\u306b\u5f15\u304d\u305a\u308a\u8fbc\u3093\u3067\u52dd\u5229\u3057\u305f\u3089\u3057\u3044",
      "desc_de": "Dieser riesige Marlin verdankt seinen Namen dem Kampf gegen einen verbissenen Fischer. Jahrelang setzte der Seewolf dem Marlin erfolglos nach - bis sein Haar grau und seine Arme kraftlos waren. Eines Tages zog der Fisch den geschw\u00e4chten Fischer in die See, wo er ihn noch heute an der Angelschnur hinter sich herzieht.",
      "desc_fr": "Ce marlin g\u00e9ant vaudrait son nom \u00e0 un combat qu'il a men\u00e9 contre un vieux p\u00eacheur pendant trois jours et trois nuits, et \u00e0 l'issue duquel son adversaire serait tomb\u00e9 dans l'eau et mort noy\u00e9.",
