      "name_ko": "\ub135\ud1a0\ub4dc\ub798\uace4",
      "desc_en": "Erratic flows of aether released after the Calamity not only resulted in a warping of the landscape, but of the creatures that dwell upon it as well. Such is the case of the Nepto Dragon\u2500a little Thalaos grown to epic proportions.",
      "desc_ja": "\u30ea\u30c8\u30eb\u30b5\u30e9\u30aa\u30b9\u306e\u7a81\u7136\u5909\u7570\u7a2e\u3068\u601d\u308f\u308c\u308b\u4f1d\u8aac\u306e\u602a\u9b5a\u3002\u7b2c\u4e03\u970a\u707d\u5f8c\u306e\u6f6e\u6d41\u5909\u52d5\u306b\u4f34\u3044\u3001\u30ed\u30fc\u30bf\u30ce\u6d77\u3078\u3068\u5357\u4e0b\u3057\u3066\u304d\u305f",
      "desc_de": "Unregelm\u00e4\u00dfige \u00c4therstr\u00f6me nach der Siebten Katastrophe ver\u00e4nderten nicht nur die Landschaft, sondern auch seine Bewohner. So wie beim Neptodrachen, einem kleinen Thalaos, der zu riesigen Ausma\u00dfen mutiert ist.",
      "desc_fr": "Ce poisson mythique, dont on a longtemps dout\u00e9 de l'existence, serait en r\u00e9alit\u00e9 un petit Thalaos mutant. Les changements de courants marins qui ont suivi le Fl\u00e9au l'auraient conduit vers la mer de Rhotano.",
      "desc_ko": "\uc0b4\ub77c\uc624\uc2a4 \uac08\uce58\uc758 \ub3cc\uc5f0\ubcc0\uc774\ub77c \ucd94\uc815\ub418\ub294 \uc804\uc124\uc758 \uad34\uc5b4. \uc81c7\uc7ac\ud574\ub85c \ubcc0\ud55c \uc870\ub958\ub97c \ub530\ub77c \ub85c\ud0c0\ub178 \ud574\uae4c\uc9c0 \ub0b4\ub824\uc654\ub2e4.",
