      "name_ko": "\ubc14\ub2e4\ucb48\uae00\uc774",
      "desc_en": "When Sahagin hatch, they are all inspected by the elders for signs of weakness. If the spawn is not deemed in proper health, it is cast into the deep as an offering to the seahag\u2500a massive fish the beast tribe believes to harbor the spirit of a legendary hero.",
      "desc_ja": "\u30b5\u30cf\u30ae\u30f3\u65cf\u306e\u624b\u9996\u3092\u565b\u307f\u5207\u308b\u307b\u3069\u7370\u731b\u306a\u602a\u9b5a\u3002\u5148\u7956\u306e\u751f\u307e\u308c\u5909\u308f\u308a\u3068\u3057\u3066\u3001\u30b5\u30cf\u30ae\u30f3\u65cf\u304c\u4f9b\u7269\u3092\u4e0e\u3048\u7d9a\u3051\u305f\u7d50\u679c\u3001\u5de8\u5927\u5316\u3057\u305f",
      "desc_de": "Wenn Sahagin schl\u00fcpfen, werden sie von den \u00c4ltesten genau in Augenschein genommen. Wer Schw\u00e4chen offenbart, wird in die Tiefe der See geworfen - als Opfer f\u00fcr die Seehexe. Die Sahagin glauben, dass diesem Fisch die Seele\r\neines legend\u00e4ren\r\nHelden innewohnt.",
      "desc_fr": "Ce poisson \u00e0 l'apparence pour le moins monstrueuse est assez f\u00e9roce pour s'en prendre aux Sahuagins. Malgr\u00e9 tout, ces derniers lui font des offrandes, pensant qu'il s'agit de la r\u00e9incarnation d'une anc\u00eatre.",
      "desc_ko": "\uc0ac\ud558\uae34\uc871\uc758 \uc190\ubaa9\uc744 \uae68\ubb3c\uc5b4 \uc808\ub2e8\ud560 \uc815\ub3c4\ub85c \uc0ac\ub098\uc6b4 \uad34\uc5b4. \uc120\uc870\uac00 \ud658\uc0dd\ud55c \uac83\uc774\ub77c \uc5ec\uae34 \uc0ac\ud558\uae34\uc871\uc774 \uacf5\ubb3c\uc744 \uacc4\uc18d \ubc14\uce5c \ud0d3\uc5d0 \uac70\ub300\ud574\uc84c\ub2e4.",
