      "name_fr": "Corne infernale",
      "name_ko": "\uc9c0\uc625\ubfd4",
      "desc_en": "A staple of the Amalj'aa diet, ignus snails rarely grow larger than a few ilms in length before being collected and thrown into a steaming pot of Trader vetch and scrubgrass. When allowed to thrive, however, they can achieve unthinkable sizes.",
      "desc_ja": "\u8d85\u5927\u632f\u308a\u306e\u30a4\u30f3\u30d5\u30a7\u30eb\u30ce\u30b9\u30cd\u30a4\u30eb\u3002\u30b6\u30ca\u30e9\u30fc\u30f3\u306b\u751f\u606f\u3059\u308b\u500b\u4f53\u306f\u3001\u30a2\u30de\u30eb\u30b8\u30e3\u65cf\u304c\u3059\u3050\u98df\u3079\u3066\u3057\u307e\u3046\u305f\u3081\u3001\u5927\u304d\u304f\u80b2\u305f\u306a\u3044",
      "desc_de": "Eine beliebte Zutat in der K\u00fcche der Amalj'aa. Dort werden Feuerschnecken meist nicht gr\u00f6\u00dfer als ein paar Ilme, bevor sie im Kochtopf einer der Echsen landen. Wenn man sie jedoch wachsen l\u00e4sst, k\u00f6nnen sie erstaunliche Gr\u00f6\u00dfen annehmen.",
      "desc_fr": "Ce gigantesque escargot infernal a r\u00e9ussi \u00e0 atteindre des dimensions ex\u00adtraor\u00addi\u00adnai\u00adres parce que contrairement \u00e0 ses cong\u00e9n\u00e8res, il a su \u00e9chapper \u00e0 l'app\u00e9tit vorace des Amalj'aa du Thanalan.",
      "desc_ko": "\uc5c4\uccad\ub098\uac8c \ud070 \uc9c0\uc625\ubd88\uc6b0\ub801\uc774. \ub2e4\ub0a0\ub780\uc5d0 \uc11c\uc2dd\ud558\ub294 \uac1c\uccb4\ub294 \uc544\ub9d0\uc7c8\uc871\uc5d0\uac8c \uc7a1\uc544\uba39\ud788\uae30 \ub54c\ubb38\uc5d0 \ud06c\uac8c \uc790\ub77c\uc9c0 \ubabb\ud55c\ub2e4.",
