      "desc_ja": "\u96e8\u304c\u964d\u308b\u3068\u6c34\u8fba\u306b\u9019\u3044\u51fa\u3057\u3001\u5c3e\u3092\u97ad\u4ee3\u308f\u308a\u306b\u6253\u3063\u3066\u7372\u7269\u3092\u660f\u5012\u3055\u305b\u3001\u8840\u3092\u98f2\u307f\u5e72\u3059\u3002\u305d\u3057\u3066\u3001\u96e8\u304c\u4e0a\u304c\u308b\u3068\u6cc9\u306b\u5e30\u308b\u3068\u3044\u3046",
      "desc_de": "Dieser blutsaugende Egel ist ber\u00fchmt f\u00fcr die peitschenhafte Bewegung mit seinem Schwanz, mit der er seine Beute l\u00e4hmt, um sich dann gen\u00fcsslich an ihren schutzlosen B\u00e4uchen festzusaugen.",
      "desc_fr": "Cette cr\u00e9ature profite souvent de la pluie pour sortir de l'eau pour ass\u00e9ner des coups de queue meurtriers \u00e0 ses proie et ainsi boire leur sang. Lorsque le temps revient au sec, elle retourne rapidement dans la source qui lui sert de repaire.",
      "desc_ko": "\ube44\uac00 \ub0b4\ub9ac\uba74 \ubb3c\uac00\ub85c \uae30\uc5b4 \uc62c\ub77c\uc640 \uaf2c\ub9ac\ub97c \ucc44\ucc0d\ucc98\ub7fc \ud718\ub458\ub7ec \uc0ac\ub0e5\uac10\uc744 \uae30\uc808\uc2dc\ud0a8 \ub4a4 \ud53c\ub97c \ube64\ub2e4. \uadf8\ub9ac\uace0 \ube44\uac00 \uadf8\uce58\uba74 \uc0d8\uc73c\ub85c \ub3cc\uc544\uac04\ub2e4\uace0 \ud55c\ub2e4.",
