      "name_fr": "Poisson couteau wootz z\u00e9nith",
      "name_ko": "\uc6b0\uce20\uce7c\ub0a0 \uc81c\ub2c8\uc2a4",
      "desc_en": "After the first several sightings of particularly opalescent wootz knifefish swimming in a ceruleum-tainted pool, rumors that an adventurer had dropped her bottle of Thavnairian mist into the water began to spread. Scholars, however, have been quick to refute these claims, stating that if this were possible, local markets would be filled with jerked beef zenith.",
      "desc_ja": "\u3042\u308b\u5192\u967a\u8005\u304c\u3001\u9752\u71d0\u6cc9\u306b\u30b5\u30d9\u30cd\u30a2\u306e\u970a\u85ac\u3092\u843d\u3068\u3057\u3066\u3057\u307e\u3063\u305f\u3002\u305d\u308c\u4ee5\u6765\u3001\u8f1d\u304d\u3092\u5e2f\u3073\u305f\u9b5a\u304c\u73fe\u308c\u308b\u3088\u3046\u306b\u306a\u3063\u305f\u3068\u3044\u3046",
      "desc_de": "Nach angeblichen Sichtungen von gigantischen Wootz-Messerfischen in einem bl\u00e4ulich gef\u00e4rbten T\u00fcmpel, glaubte man, ein Abenteurer h\u00e4tte seinen Thavnair-Nebel hineinfallen lassen. Forscher dementierten diese Theorie jedoch mit dem Verweis, dass die M\u00e4rkte dann l\u00e4ngst mit Zenit-Trockenfleisch \u00fcberschwemmt w\u00e4ren.",
      "desc_fr": "Ce poisson aux \u00e9clats surnaturels serait apparu apr\u00e8s qu'un aventurier ex\u00adtr\u00ea\u00adme\u00adment maladroit a laiss\u00e9 tomber une fiole de lymphe de Thavnair dans une source de c\u00e9ruleum.",
      "desc_ko": "\uc5b4\ub5a4 \ubaa8\ud5d8\uac00\uac00 \uccad\ub9b0 \uc6d0\ucc9c\uc9c0\uc5d0 \uc0ac\ubca0\ub124\uc5b4 \uc601\uc57d\uc744 \ub5a8\uc5b4\ub728\ub838\ub294\ub370, \uadf8 \ud6c4 \ub098\ud0c0\ub098\uac8c \ub41c \ube5b\uc744 \ubc1c\ud558\ub294 \ubb3c\uace0\uae30\ub77c \ud55c\ub2e4.",
