      "name_fr": "Sombr\u00e9toile",
      "name_ko": "\uc5b4\ub460\uc758 \ubcc4",
      "desc_en": "A life of dwelling in the pitch-black depths of the abyss have rendered this pike's eyes unusually sensitive to light, to the point where even a single lamp marimo will drive the wavekin into the darkest recesses of the sea.",
      "desc_ja": "\u614e\u91cd\u304b\u3064\u72e1\u733e\u306a\u30d1\u30a4\u30af\u3067\u3001\u5e38\u306b\u95c7\u306b\u7d1b\u308c\u308b\u3053\u3068\u3067\u751f\u304d\u5ef6\u3073\u3066\u304d\u305f\u3002\u30e9\u30f3\u30d7\u30de\u30ea\u30e2\u304c\u767a\u3059\u308b\u50c5\u304b\u306a\u706f\u308a\u3055\u3048\u3001\u5acc\u3046\u3068\u3044\u3046",
      "desc_de": "Ein Leben in der pechschwarzen Tiefsee hat die Augen dieses Hechts so lichtempfindlich gemacht, dass selbst eine einzige Algenkugel ausreicht, um ihn in die Dunkelheit zur\u00fcckzujagen.",
      "desc_fr": "Prudent jusqu'au bout des \u00e9cailles et rus\u00e9 comme pas deux, ce brochet de Halone a r\u00e9ussi \u00e0 battre les records de long\u00e9vit\u00e9 de son esp\u00e8ce en se cachant toujours dans l'ombre, ce qui lui vaut son nom. M\u00eame la faible lumi\u00e8re des marimos le g\u00eanerait, dit-on.",
      "desc_ko": "\uc2e0\uc911\ud558\uace0 \uad50\ud65c\ud55c \uaf2c\uce58\uc5b4\ub85c, \uc5b8\uc81c\ub098 \uc5b4\ub460 \uc18d\uc5d0 \uc228\uc5b4 \uc0b4\uc544\ub0a8\uc544 \uc654\ub2e4. \ub4f1\ubd88\ud574\uc870\uad6c\uac00 \ubc1c\ud558\ub294 \ud76c\ubbf8\ud55c \ubd88\ube5b\ub9c8\uc800 \uc2eb\uc5b4\ud55c\ub2e4\uace0 \ud55c\ub2e4.",
