      "name_ko": "\ud770\uad6c\ub984\uc0b0\ud638",
      "desc_en": "This bone white cliff-dwelling coral withstands the constant battering of the Sea of Clouds' winds by hiding within a lightweight, yet remarkably sturdy exoskeleton, emerging to feed only when the weather permits.",
      "desc_ja": "\u96f2\u6d77\u306b\u68f2\u606f\u3059\u308b\u73ca\u745a\u306b\u4f3c\u305f\u751f\u7269\u3002\u305d\u306e\u8272\u5408\u3044\u3068\u3001\u9a5a\u304f\u307b\u3069\u306e\u8efd\u3055\u304b\u3089\u3001\u5730\u5143\u6c11\u304b\u3089\u300c\u96f2\u306e\u9aa8\u300d\u3068\u3082\u547c\u3070\u308c\u3066\u3044\u308b",
      "desc_de": "Der \u00c4hnlichkeit zu Korallen und seiner knochenwei\u00dfen Farbe hat dieser Fisch seinen Namen zu verdanken. Da er mit nur einer Milli-Onze ein Leichtgewicht darstellt, wird er im Volksmund auch \u201eWolkenskelett\u201c genannt.",
      "desc_fr": "Savalia coerthense\r\nCe mollusque de la Mer de nuages ressemble \u00e0 s'y m\u00e9prendre \u00e0 un corail, mais n'en est pas un. Sa couleur blanche et sa l\u00e9g\u00e8ret\u00e9 ex\u00adcep\u00adtion\u00adnelle lui ont valu le surnom local d'os de nuage.",
      "desc_ko": "\uad6c\ub984\ubc14\ub2e4\uc5d0 \uc11c\uc2dd\ud558\ub294, \uc0b0\ud638\ub97c \ub2ee\uc740 \uc0dd\ubb3c. \ube5b\uae54\uc774 \ud76c\uace0 \ub180\ub78d\ub3c4\ub85d \uac00\ubcbc\uc6cc\uc11c \uc6d0\uc8fc\ubbfc\ub4e4\uc740 '\uad6c\ub984\uc758 \ubf08'\ub77c\uace0\ub3c4 \ubd80\ub978\ub2e4.",
