      "desc_fr": "Clione limacina\r\nCe gracieux gast\u00e9ropode est un clione vivant dans les eaux lacustres des r\u00e9gions froides. Sa mani\u00e8re de chasser est si f\u00e9roce et cruelle qu'elle lui vaut le surnom de \u201cHalione\u201d, d'apr\u00e8s la d\u00e9esse de la guerre.",
      "desc_ko": "\ud560\ub85c\ub124\uc870\uac1c\ub77c\uace0\ub3c4 \ubd80\ub974\ub294 \uc774 \uc0dd\ubb3c\uc740 \uc544\ub984\ub2e4\uc6b4 \uc0dd\uae40\uc0c8\uc640 \ub2ec\ub9ac \uc131\uc9c8\uc774 \uc0ac\ub0a9\ub2e4. \ud2b9\ud788 \uba39\uc774\ub97c \uc7a1\uc740 \ud6c4\uc5d0\ub294 \ub9c8\uce58 \uc804\uc7c1\uc774\ub098 \ud558\ub4ef \uc794\uc778\ud558\uac8c \ub72f\uc5b4\uba39\ub294 \uac83\uc73c\ub85c \uc54c\ub824\uc838 \uc788\ub2e4.",
