      "desc_fr": "Cancer coerthensis\r\nVivant jadis uniquement dans le nord des montagnes d'Abalathia, ce crustac\u00e9 d'eau douce a \u00e9largi son territoire apr\u00e8s la glaciation brutale du Coerthas, et se rencontre d\u00e9sormais dans les eaux lacustres des plaines de basse altitude. Sa chair est ferme et tr\u00e8s appr\u00e9ci\u00e9e des gourmets.",
