      "name_ko": "\ud638\uc218\uc131\uac8c",
      "desc_en": "Coerthan legend tells of a brave priest who would rush into battle headlong with his copy of the Enchiridion in one hand and a morningstar in the other. So frenzied was his slashing and whirling of the weapon, that often the spiked ball would fly from its chain and into nearby rivers and lakes. Lake urchins have nothing to do with this legend.",
      "desc_ja": "\u5168\u8eab\u306b\u92ed\u3044\u68d8\u3092\u6709\u3059\u308b\u4e0d\u6c17\u5473\u306a\u751f\u7269\u3002\u6c37\u4e0a\u306b\u653e\u7f6e\u3059\u308b\u3068\u3001\u68d8\u3092\u5de7\u307f\u306b\u52d5\u304b\u3057\u3066\u3001\u6c37\u306b\u7a74\u3092\u7a7a\u3051\u3066\u9003\u308c\u308b\u3068\u3044\u3046",
      "desc_de": "Der K\u00f6rper des Seeigels ist rundum mit spitzen Stacheln versehen. Seeigel sollte man nach dem Fang nicht auf dem Eis liegenlassen, da sie mit ihren Stacheln ein Loch ins Eis bohren und zur\u00fcck ins Wasser entfliehen k\u00f6nnen.",
      "desc_fr": "Arbacia lixula\r\nCet \u00e9chino\u00efde lacustre peu engageant est connu pour son corps sph\u00e9rique couvert de piquants. On raconte que lorsqu'on le laisse au-dessus de la glace, il est capable de percer un trou au moyen de ses piquants et ainsi rejoindre l'eau.",
