      "name_ko": "\uc9c0\ub09c\ub0a0\uba54\uae30",
      "desc_en": "This variety of warmwater catfish has scales of deep crimson which allow it to better conceal itself in the Whilom River's red clay bed. To hunt, it will sit unmoving until a smaller fish, unaware of the camouflaged wavekin's presence, comes along and impales itself upon one of the spines lining the catfish's dorsal fin.",
      "desc_ja": "\u8d64\u8910\u8272\u306e\u9b5a\u4f53\u3092\u6301\u3064\u30ca\u30de\u30ba\u306e\u4e00\u7a2e\u3002\u80f8\u3073\u308c\u3068\u80cc\u3073\u308c\u306b\u3001\u92ed\u3044\u68d8\u304c\u3042\u308b\u305f\u3081\u3001\u91e3\u308a\u4e0a\u3052\u308b\u969b\u306b\u306f\u6ce8\u610f\u304c\u5fc5\u8981\u3060",
      "desc_de": "Der Weiland Katfisch ist eine Unterart der Welse. Schwanz- und Brustflosse sind mit spitzen Stacheln versehen, weshalb es sich empfielt, beim Fischen Handschuhe zu tragen. ",
