      "desc_ja": "\u51b7\u6c17\u3092\u307e\u3068\u3046\u6838\u72b6\u751f\u7269\u3002\u30a2\u30a4\u30b9\u30b9\u30d7\u30e9\u30a4\u30c8\u306e\u5e7c\u4f53\u3068\u3059\u308b\u8aac\u3068\u3001\u751f\u7269\u3067\u306f\u306a\u3044\u30a8\u30fc\u30c6\u30eb\u7d50\u6676\u3068\u8003\u3048\u308b\u8aac\u304c\u5b58\u5728\u3059\u308b",
      "desc_de": "\u00dcber diese von Kaltluft ummantelten kugelf\u00f6rmigen Lebewesen ist erst Weniges bekannt. W\u00e4hrend einige Forscher glauben, Eis-Exergone w\u00fcrden aus ihnen schl\u00fcpfen, handelt es sich gem\u00e4\u00df einer anderen Theorie bei Gletscherkernen um kristallisierten \u00c4ther.",
      "desc_fr": "Crystallus frigoris\r\nDeux th\u00e9ories existent quant \u00e0 la nature de cette \u00e9nigmatique cr\u00e9ature d'air froid : certains pensent qu'il s'agit d'une larve d'\u00e9l\u00e9mentaire de glace, et d'autres y voit une simple formation spontan\u00e9e d'\u00e9ther cristallis\u00e9 n'appartenant pas au r\u00e8gne animal.",
