      "desc_ja": "\u9ad8\u71b1\u3092\u767a\u3059\u308b\u9aed\u3092\u6301\u3064\u30ca\u30de\u30ba\u306e\u4ef2\u9593\u3002\u4f4e\u6c34\u6e29\u306b\u306a\u308c\u305f\u9b5a\u306b\u71b1\u3057\u305f\u9aed\u3092\u63a5\u89e6\u3055\u305b\u3001\u71b1\u30b7\u30e7\u30c3\u30af\u3092\u4e0e\u3048\u3066\u304b\u3089\u6355\u98df\u3059\u308b",
