      "name_ko": "\ub9c8\uc774\ubcf4\uc774",
      "desc_en": "Meaning \u201cthin one\u201d in the Vanu tongue, maiboi are a symbol of weakness amongst the tribes of Abalathia, and to be called a maiboi by your kin is often considered the greatest of insults.",
      "desc_ja": "\u30d0\u30cc\u30d0\u30cc\u8a9e\u3067\u300c\u8ca7\u5f31\u300d\u3068\u547c\u3070\u308c\u308b\u6de1\u6c34\u9b5a\u3002\u4e38\u3005\u3068\u3057\u305f\u4f53\u578b\u304c\u597d\u307e\u308c\u308b\u30d0\u30cc\u30d0\u30cc\u65cf\u3067\u306f\u3001\u4fae\u8511\u8868\u73fe\u306b\u3082\u7528\u3044\u3089\u308c\u308b",
      "desc_de": "\u201eHungerhaken\u201c lautet die despektierliche Bezeichnung f\u00fcr diesen Fisch bei den Vanu, die bekanntlich runde K\u00f6rperformen mehr sch\u00e4tzen.",
      "desc_fr": "Microphis brachyurus brachyurus\r\nCe poisson filiforme doit son nom \u00e0 un mot vanu vanu signifiant \u201cmaigre\u201d. Pour ce peuple qui aime les formes arrondies et les silhouettes charnues, il est \u00e9galement synonyme d'insulte.",
