      "desc_de": "Verirrt sich ein Fisch zwischen die drei Wulstlippen des Dreilippen-Karpfens, presst er sie so lange zusammen, bis der Fisch erstickt. Der Dreilippen-Karpfen ern\u00e4hrt sich aus\u00adschlie\u00df\u00adlich von anderen Fischen und ist der einzige nat\u00fcrliche Feind des Pipira Pira.",
      "desc_fr": "Opsariichthys trilabia\r\nLa bouche de cette grosse carpe se replie en trois endroits si bien qu'elle ne laisse \u00e9chapper aucune proie. Piscivore, cette esp\u00e8ce est le seul pr\u00e9dateur du pipira pira.",
      "desc_ko": "\uc138 \ubc88 \uaebe\uc778 \uc785\uc73c\ub85c \ud55c\ubc88 \uc7a1\uc740 \ubb3c\uace0\uae30\ub294 \uc808\ub300 \ub193\uce58\uc9c0 \uc54a\ub294\ub2e4. \uc644\uc804\ud55c \uc5b4\uc2dd\uc131\uc73c\ub85c, \ud53c\ud53c\ub77c \ud53c\ub77c\uc758 \uc720\uc77c\ud55c \ucc9c\uc801\uc774\ub2e4.",
