      "desc_fr": "Pelophylax dravanica\r\nLe cri de cette grenouille ressemble \u00e0 s'y m\u00e9prendre au mugissement d'un bovid\u00e9. Bien que cet amphibien soit un excellent app\u00e2t pour la p\u00eache au vif, les Vanu Vanu le d\u00e9gustent aussi tel quel, comme amuse-gueule.",
