      "desc_ja": "\u30d0\u30cc\u30d0\u30cc\u65cf\u306e\u4f1d\u627f\u306b\u3066\u3001\u5343\u5207\u308c\u305f\u96f2\u304b\u3089\u7523\u307e\u308c\u305f\u3068\u3055\u308c\u308b\u6de1\u6c34\u9b5a\u3002\u751f\u304d\u3066\u3044\u308b\u6642\u306f\u534a\u900f\u660e\u3060\u304c\u3001\u6b7b\u306c\u3068\u5f90\u3005\u306b\u767d\u304f\u306a\u308b",
