      "desc_fr": "Leucopsarion dravanicus\r\nDans la tradition vanu vanu, on raconte que ce poisson d'eau douce proviendrait d'un nuage tranch\u00e9 en mille morceaux. Son corps est translucide de son vivant, mais blanchit progressivement apr\u00e8s sa mort. On le surnomme donc \u201cpoisson \u00e0 la mort blanche\u201d.",
