      "desc_en": "Mahu wai grow from the floating islands of Abalathia's Spine, releasing scores of thin transparent tendrils into the sky to catch their prey and haul it back to their giant maws. The word mahu wai means \u201cbottomless greed\u201d in the Vanu tongue.",
