      "desc_fr": "Megalodicopia hians\r\nCe tunicier s'accroche \u00e0 la partie inf\u00e9rieure des \u00eeles flottantes d'Abalathia, et avale toute proie qui a le malheur de flotter pr\u00e8s de sa bouche \u00e9norme. Son nom signifie \u201cavidit\u00e9\u201d en langue vanu vanu.",
