      "desc_fr": "Ovum caelestis\r\nUne cr\u00e9ature insolite en forme d'\u0153uf constitu\u00e9e prin\u00adci\u00adpa\u00adle\u00adment d'une poche de gaz lui permettant de voler. Beaucoup de choses restent \u00e0 d\u00e9couvrir sur son mode de vie et sa reproduction.",
