      "desc_ja": "\u7a7a\u98db\u3076\u30ad\u30ce\u30b3\u3068\u3044\u3063\u305f\u98a8\u4f53\u306e\u96f2\u6d77\u9b5a\u3002\u30cf\u30eb\u30da\u30a4\u30a2\u304c\u597d\u3093\u3067\u98df\u3059\u3068\u3055\u308c\u3001\u6570\u5341\u7fbd\u5358\u4f4d\u3067\u72e9\u308a\u3092\u3059\u308b\u59ff\u304c\u898b\u3089\u308c\u308b\u3053\u3068\u3082",
      "desc_de": "Dieser wei\u00df schimmernde pilz\u00e4hnliche Flugfisch ist die Lieblingsspeise der Harpeias und wird von ihnen zu Dutzenden verschlungen.",
