      "desc_ja": "\u96f2\u6d77\u306e\u9752\u7a7a\u3092\u601d\u308f\u305b\u308b\u3001\u9bae\u3084\u304b\u306a\u9752\u8272\u304c\u5370\u8c61\u7684\u306a\u73ca\u745a\u3002\u30d0\u30cc\u30d0\u30cc\u65cf\u306f\u3001\u53e4\u6765\u304b\u3089\u3053\u308c\u3092\u9854\u6599\u306e\u6750\u6599\u3068\u3057\u3066\u7528\u3044\u3066\u304d\u305f",
