      "name_de": "Patrizier-Seema",
      "name_fr": "Seema noble",
      "name_ko": "\uadc0\uc871\uc0b0\ucc9c\uc5b4",
      "desc_en": "Spending most of their lives in near-freezing waters have lined the bodies of seema patricians with a thick layer of fatty tissue which is highly sought after by Ishgardian nobles who believe the foul-smelling oil to soften skin.",
      "desc_ja": "\u5bd2\u51b7\u306a\u6c34\u57df\u3067\u80b2\u3064\u3053\u3068\u3067\u3001\u8eab\u304c\u7de0\u307e\u308a\u3001\u8102\u304c\u306e\u308b\u305f\u3081\u975e\u5e38\u306b\u7f8e\u5473\u3002\u30a4\u30b7\u30e5\u30ac\u30eb\u30c9\u306e\u8cb4\u65cf\u305f\u3061\u304c\u3001\u597d\u3093\u3067\u98df\u3059\u3068\u3044\u3046",
      "desc_de": "Der hohe Fettanteil erm\u00f6glicht dem Fisch das Leben in kalten Gew\u00e4ssern. Wegen seines fetten, k\u00f6stlichen Fischfleisches landet er h\u00e4ufig auf den Tellern des Ishgarder Adels.",
      "desc_fr": "Oncorhynchus nobilis\r\nLes seemas nobles passant l'essentiel de leur vie dans des eaux froides, leur corps d\u00e9veloppe une importante quantit\u00e9 de graisse, ce qui rend leur chair par\u00adti\u00adcu\u00adli\u00e8\u00adrement d\u00e9licieuse. Cette esp\u00e8ce est tr\u00e8s pris\u00e9e notamment chez les nobles ishgardais.",
      "desc_ko": "\ud55c\ub7ad\ud55c \uc218\uc5ed\uc5d0\uc11c \uc790\ub77c \uc0b4\uc774 \ucac4\uae43\ud558\uace0 \uae30\ub984\uae30\uac00 \ub9ce\uc544 \ub300\ub2e8\ud788 \ub9db\uc788\ub2e4. \uc774\uc288\uac00\ub974\ub4dc \uadc0\uc871\ub4e4\uc774 \uc990\uaca8 \uba39\ub294\ub2e4\uace0 \ud55c\ub2e4.",
