      "name_fr": "Ammonite",
      "name_ko": "\uc554\ubaa8\ub098\uc774\ud2b8",
      "desc_en": "An inland cousin of the nautilus, the ammonite has developed a two-layered shell which it fills with water heated by its own body. This insulates the creature from the cold, allowing it to survive in the cold northern climes.",
      "desc_ja": "\u9678\u5c01\u3055\u308c\u305f\u30ce\u30fc\u30c1\u30e9\u30b9\u306e\u8fd1\u7e01\u7a2e\u3068\u8003\u3048\u3089\u308c\u3066\u3044\u308b\u3002\u7532\u6bbb\u5185\u306e\u9694\u58c1\u306b\u9b54\u529b\u3092\u6e9c\u3081\u8fbc\u307f\u3001\u3053\u308c\u3092\u71b1\u6e90\u306b\u3057\u3066\u68f2\u606f\u3059\u308b",
      "desc_de": "Manche Forscher halten den in Binnengew\u00e4ssern vorkommenden Ammoniten f\u00fcr eine mit dem Perlboot verwandte Meerestierart, die sich durch r\u00e4umliche Trennung entwickelt hat. Die einzelnen Kammern sind mit Magie gef\u00fcllt und w\u00e4rmen den Kopff\u00fc\u00dfer.",
      "desc_fr": "Ammonitina\r\nCertains estiment que l'ammonite est une sous-esp\u00e8ce du nautile qui aurait suivi une \u00e9volution diff\u00e9rente \u00e0 l'int\u00e9rieur des terres. Elle emmagasine de l'\u00e9nergie magique dans les loges de sa coquille pour produire de la chaleur.",
      "desc_ko": "\ubbfc\ubb3c\uc5d0 \uc815\ucc29\ud574 \uc0b4\uc544\uac00\ub294 \uc575\ubb34\uc870\uac1c\uc758 \uadfc\uc5f0\uc885\uc73c\ub85c \ucd94\uc815\ub41c\ub2e4. \uac11\uac01 \ub0b4 \uaca9\ubcbd\uc5d0 \ucc44\uc6b4 \ub9c8\ub825\uc5d0\uc11c \uc5f4\uc744 \uc5bb\uc73c\uba70 \ud65c\ub3d9\ud55c\ub2e4.",
