      "name_ko": "\ud22d\ub208\uae08\ubd95\uc5b4",
      "desc_en": "By separating its eyes from its head, the bubble eye goldfish is able to see in far more directions than other wavekin\u2500a trait invaluable in waters where predators might approach from any direction.",
