      "desc_fr": "Carassius auratus telescopus\r\nCe cyprin aux \u00e9normes yeux globuleux poss\u00e8de un champ de vision bien sup\u00e9rieur \u00e0 celui de ses cousins. On suppose que ses globes oculaires ont \u00e9volu\u00e9 vers cette forme pour lui permettre de rep\u00e9rer les pr\u00e9dateurs qui tenteraient de fondre sur lui depuis le ciel.",
