      "name_ko": "\ucd08\uc5b4",
      "desc_en": "As the name implies, grass carp dine solely on water grasses, shunning the carnivorous eating habits of their cousins for a healthier diet. Unfortunately, this diet gives the fish a very bitter flavor, making it unsuitable for consumption.",
      "desc_ja": "\u30b3\u30a4\u306b\u4f3c\u3066\u3044\u308b\u304c\u3001\u80cc\u3073\u308c\u304c\u77ed\u304f\u3001\u4f53\u3082\u5927\u304d\u304f\u3066\u7d30\u9577\u3044\u3002\u3072\u305f\u3059\u3089\u306b\u6c34\u8349\u3092\u98df\u3059\u3053\u3068\u304b\u3089\u3001\u30bd\u30a6\u30ae\u30e7\u306e\u540d\u3067\u547c\u3070\u308c\u308b",
      "desc_de": "Er gleicht dem Koi-Karpfen, doch ist seine R\u00fcckenflosse k\u00fcrzer und sein K\u00f6rper l\u00e4nger. Er ern\u00e4hrt sich aus\u00adschlie\u00df\u00adlich von Algen und z\u00e4hlt daher zu den vegetarischen Fischen.",
      "desc_fr": "Ctenopharyngodon idella\r\nCe poisson, proche de la carpe ordinaire mais plus gros et \u00e9lanc\u00e9, se nourrit prin\u00adci\u00adpa\u00adle\u00adment des herbes qui peuplent les mar\u00e9cages. On l'appelle donc \u00e9galement \u201ccarpe herbivore\u201d.",
