      "desc_ja": "\u5f37\u529b\u306a\u7259\u3067\u6c34\u9762\u306b\u306f\u3063\u305f\u6c37\u3092\u5272\u308a\u7815\u304d\u3001\u6c37\u4e0a\u3092\u6e21\u308b\u52d5\u7269\u3092\u6355\u98df\u3059\u308b\u3002\u30dd\u30fc\u30e9\u30d9\u30a2\u30fc\u3068\u6b7b\u95d8\u3092\u6f14\u3058\u305f\u3068\u3044\u3046\u76ee\u6483\u8a3c\u8a00\u3082",
      "desc_de": "Mit seinen riesigen Fangz\u00e4hnen durchbricht dieser Fisch das Eis, um nach seiner Beute auf der Eisoberfl\u00e4che zu schnappen. Es existieren verst\u00f6rende Zeugenberichte von K\u00e4mpfen zwischen einem Riesenzackenbarsch und einem Eisb\u00e4ren.",
      "desc_fr": "Epinephelus lanceolatus\r\nCet \u00e9norme m\u00e9rou d'eau douce est si puissant et si pugnace qu'il est capable de briser la couche de glace d'un lac avec sa t\u00eate pour s'attaquer aux animaux en surface. Il lui arrive m\u00eame de s'en prendre aux ours polaires, d'apr\u00e8s certains t\u00e9moignages.",
      "desc_ko": "\uac15\ub825\ud55c \uc774\ube68\ub85c \uc218\uba74\uc5d0 \ub080 \uc5bc\uc74c\uc744 \uae68\uace0, \uc5bc\uc74c \uc704\ub97c \uac74\ub108\ub294 \ub3d9\ubb3c\uc744 \uc7a1\uc544\uba39\ub294\ub2e4. \ubd81\uadf9\uacf0\uacfc \uc0ac\ud22c\ub97c \ubc8c\uc600\ub2e4\ub294 \ubaa9\uaca9\ub2f4\ub3c4 \uc788\ub2e4.",
