      "desc_fr": "Protopterus abalathicus\r\nCe poisson d'eau douce a pour particularit\u00e9 d'\u00eatre muni d'un poumon fonctionnel, ce qui lui permet de ramper \u00e0 l'air, dans la boue. Il est en outre capable de s'enfermer dans un terrier de vase en cas d'ass\u00e9chement de son habitat, et peut survivre ainsi plusieurs ann\u00e9es dans un \u00e9tat proche de la mort.",
