      "desc_fr": "Carinotetraodon coerthensis\r\nCe t\u00e9trodon rare s'est adapt\u00e9 aux eaux froides du Coerthas. Il est consid\u00e9r\u00e9 comme un symbole de fortune chez les nobles ishgardais, qui en \u00e9l\u00e8vent souvent comme poisson d'ornement.",
