      "desc_de": "Dieser Fisch jagt aus\u00adschlie\u00df\u00adlich, wenn \u00fcber dem Wasser ein Schneesturm tobt. In den M\u00e4rchen, die ihm die F\u00e4higkeit zuschreiben, diese Schneest\u00fcrme selbst he\u00adrauf\u00adbe\u00adschw\u00f6\u00adren zu k\u00f6nnen, ist er auch als Schneemuse bekannt. Er wird als Verwandter des Stab des Urteils gehandelt, doch diese Annahme entbehrt bisher jeglichem Nachweis.",
