      "desc_fr": "Aurelia coerthense\r\nUne sorte de m\u00e9duse flottante qui se nourrit de noyaux de glacier. Dans le folklore local, on consid\u00e8re qu'elle chasse les temp\u00eates de neige, aussi les habitants du Coerthas la voient comme un animal porte-bonheur.",
