      "desc_ja": "\u967d\u5149\u306b\u8f1d\u304f\u83f1\u5f62\u306e\u9c57\u304c\u7279\u5fb4\u306e\u53e4\u4ee3\u9b5a\u3002\u6606\u866b\u3092\u6355\u98df\u3059\u308b\u305f\u3081\u304b\u3001\u30b0\u30ca\u30fc\u30b9\u65cf\u306f\u3053\u306e\u9b5a\u3092\u5fcc\u307f\u5acc\u3063\u3066\u3044\u308b\u3089\u3057\u3044",
