      "desc_fr": "Polypterus solarus\r\nUn poisson primitif connu pour ses \u00e9cailles en forme de losanges qui brillent \u00e0 la lumi\u00e8re du soleil. Les Gnathes abhorrent ce poisson, peut-\u00eatre parce qu'il se nourrit d'insectes et de parasites.",
