      "desc_en": "No more than a marble oscar lacking pigment, noontide oscars are rare finds simply for the fact that they are unable to blend in with their surroundings, making them more visible to predators. There are those, however, who claim the bone white wavekin possess special powers, making them highly sought after by witches and medicine men.",
      "desc_ja": "\u30a2\u30b9\u30c8\u30ed\u30ce\u30fc\u30bf\u30b9\u306e\u30a2\u30eb\u30d3\u30ce\u3002\u9577\u3044\u30d2\u30ec\u3068\u3001\u771f\u3063\u767d\u306a\u4f53\u304c\u7279\u5fb4\u3002\u81ea\u7136\u754c\u3067\u306f\u76ee\u7acb\u3064\u305f\u3081\u3001\u3059\u3050\u306b\u6355\u98df\u3055\u308c\u3066\u3057\u307e\u3044\u3001\u5e0c\u5c11\u7a2e\u3068\u306a\u3063\u3066\u3044\u308b\u3002",
      "desc_de": "Eigentlich handelt es sich bei diesem Fisch um keine eigene Fischart, sondern um den Albino eines Marmorbarsches. Da er durch die auffallende wei\u00dfe Farbe mit seiner Umgebung nicht verschmelzen kann, ist er ein leichtes Ziel f\u00fcr Raubfische. Folglich wurden bisher nur wenige Exemplare gesichtet.",
      "desc_fr": "Astronotus albus\r\nUn oscar albinos. Sa longue queue et son corps blancs comme la neige sont par\u00adti\u00adcu\u00adli\u00e8\u00adrement visibles dans l'eau, ce qui fait de lui une proie facile. C'est donc une esp\u00e8ce consid\u00e9r\u00e9e comme rare, avec un nombre d'individus assez r\u00e9duit.",
      "desc_ko": "\uc624\uc2a4\uce74\uc758 \ubc31\ubcc0\uc885. \uae34 \uc9c0\ub290\ub7ec\ubbf8\uc640 \uc0c8\ud558\uc580 \ubab8\uc774 \ud2b9\uc9d5\uc774\ub2e4. \uc790\uc5f0\uacc4\uc5d0\uc11c\ub294 \uc9c0\ub098\uce58\uac8c \ub208\uc5d0 \ub744\uc5b4 \uae08\uc138 \uc7a1\uc544\uba39\ud788\ub294 \ud0d3\uc5d0 \ucc3e\uc544\ubcf4\uae30 \ud798\ub4e4\ub2e4.",
