      "name_ko": "\uadf8\ub9bc\uc790\uc218\uc5fc",
      "desc_en": "One cannot visit a tavern in all of Coerthas without hearing tall tales of the great man-eating shadowhisker. In one village, the fish will be five yalms long, in another, five wide. In still another, it will have swallowed a Lalafell whole, in yet another, it will have swallowed a whole lot of Lalafells.",
      "desc_ja": "\u300c\u4eba\u55b0\u3044\u9b5a\u300d\u306e\u7570\u540d\u3092\u6301\u3064\u3001\u51f6\u66b4\u306a\u5de8\u5927\u30ca\u30de\u30ba\u3002\u5b9f\u969b\u306b\u4eba\u3092\u98df\u3079\u308b\u3053\u3068\u306f\u306a\u3044\u304c\u3001\u6c34\u5834\u306e\u9b5a\u3092\u5e73\u3089\u3052\u308b\u307b\u3069\u8caa\u6b32",
      "desc_de": "Dem Schattenbackenbart wird nachgesagt, er w\u00fcrde mit Vorliebe Elezen im Ganzen verschlingen. Gro\u00df, gefr\u00e4\u00dfig und wild genug daf\u00fcr ist er in der Tat, doch bisher kann man ihm nur den gierigen Verzehr anderer gro\u00dfer Fischarten nachweisen.",
      "desc_fr": "Zungaro zungaro\r\nCe grand poisson-chat \u00e9galement appel\u00e9 jahu a une r\u00e9putation de mangeur d'homme. S'il ne s'en prend pas r\u00e9ellement \u00e0 l'\u00eatre humain, il a en revanche une force et une voracit\u00e9 suffisantes pour avaler l'ensemble des prises d'un bateau.",
