      "desc_fr": "Gibbula dravanica\r\nUn mollusque lavique \u00e0 coquille spiral\u00e9e qui poss\u00e8de une ex\u00adcep\u00adtion\u00adnelle capacit\u00e9 \u00e0 r\u00e9sister \u00e0 la chaleur. Certains voient en cette gibbule une lointaine cousine de la conquedure.",
