      "desc_fr": "Odontamblyopus azysensis\r\nCe gobie allong\u00e9 a des yeux, mais ceux-ci ont d\u00e9g\u00e9n\u00e9r\u00e9 et ne d\u00e9tectent plus la lumi\u00e8re. Sa m\u00e2choire protub\u00e9rante et sa laideur g\u00e9n\u00e9rale \u00e9voquent les plus horribles entit\u00e9s du n\u00e9ant.",
