      "name_ko": "\uaf2c\ub9c8 \uc544\ud640\ub85c\ud2c0",
      "desc_en": "Naturalists who have had the opportunity to examine the rare samples brought back from Azys Lla have come to the tentative conclusion that despite being several times smaller, a completely different color, and bearing strange whisker-like fins, this amphibious creature is most likely a distant relative to the axolotls that reside in lower Eorzea.",
      "desc_ja": "\u3069\u3053\u3068\u306a\u304f\u611b\u5b0c\u306e\u3042\u308b\u9854\u3092\u3057\u305f\u4e21\u751f\u985e\u3002\u30b5\u30e9\u30de\u30f3\u30c0\u30fc\u306e\u4e00\u7a2e\u3067\u306f\u306a\u3044\u304b\u3068\u8003\u3048\u3089\u308c\u3066\u3044\u308b\u304c\u3001\u771f\u76f8\u306f\u5b9a\u304b\u3067\u306f\u306a\u3044",
      "desc_de": "Dieser Axolotl hat mit seinen entz\u00fcckenden Gesichtsz\u00fcgen und den winzigen F\u00fc\u00dfen noch das Herz des grummeligsten Forschers zum Schmelzen gebracht. Es wird vermutet, dass es sich hierbei um eine Salamander-Art handelt, doch bisher blieb es bei einer Theorie.",
      "desc_fr": "Ambystoma azysense\r\nLe faci\u00e8s ang\u00e9lique de cet adorable amphibien n\u00e9ot\u00e8ne lui vaut d'\u00eatre tr\u00e8s appr\u00e9ci\u00e9 dans sa forme juv\u00e9nile. On suppose qu'il s'agit d'un lointain cousin de la salamandre, mais cela reste une simple th\u00e9orie.",
