      "desc_fr": "Cancer azysensis\r\nD'apr\u00e8s des donn\u00e9es d\u00e9couvertes r\u00e9cemment par le d\u00e9cryptage de m\u00e9moquartz anciens, ce crabe casqu\u00e9 aurait \u00e9t\u00e9 modifi\u00e9 par les Allagois qui ont rendu sa carapace plus dure dans le but de l'utiliser comme mat\u00e9riau pour fabriquer des armures. Il serait \u00e9galement un lointain cousin de l'acarus.",
