      "name_ko": "\ubc31\uae08\ubd95\uc5b4",
      "desc_en": "Believed to be a cousin of the goldfish, the platinum fish has fully adapted to life in the corrupted waters of Azys Lla's aetherochemical pools and now requires the aetherially charged liquid to survive. The dazzling sheen of its scales does not appear to be hereditary, however, and rather a result of an aetherochemical reaction caused by the pools.",
      "desc_ja": "\u91d1\u9b5a\u3092\u8d85\u3048\u308b\u8f1d\u304d\u3092\u8a87\u308b\u9b54\u6cc9\u9b5a\u3002\u606f\u3092\u306e\u3080\u307b\u3069\u7f8e\u3057\u3044\u304c\u3001\u98fc\u80b2\u3059\u308b\u306b\u306f\u9b54\u6cc9\u306e\u6c34\u69fd\u304c\u5fc5\u8981\u3067\u3001\u6975\u3081\u3066\u96e3\u3057\u3044",
      "desc_de": "Die gl\u00e4nzenden Schuppen dieser mutierten Fischart \u00fcbertreffen die seines Verwandten, des Goldfisches, um ein Weites. Platinfische k\u00f6nnen allerdings nur in \u00e4therochemischem Wasser \u00fcberleben und sind daher nicht als Haustiere geeignet. ",
      "desc_fr": "Carassius aeratus platinus\r\nCe poisson mutant arbore des \u00e9cailles encore plus brillantes et gracieuses que son cousin dor\u00e9. Ne survivant que dans les eaux charg\u00e9es d'\u00e9ther des fuites magismologiques, cette vari\u00e9t\u00e9 semble difficile \u00e0 \u00e9lever comme poisson d'ornement.",
      "desc_ko": "\uae08\ubd95\uc5b4\ubcf4\ub2e4 \ud6e8\uc52c \ub208\ubd80\uc2dc\uac8c \ubc18\uc9dd\uc774\ub294 \ub9c8\ubc95\uc0d8\uace0\uae30. \uc228\uc774 \uba4e\uc744 \uc815\ub3c4\ub85c \uc544\ub984\ub2f5\uc9c0\ub9cc, \uc0ac\uc721\ud558\ub824\uba74 \ub9c8\ubc95\uc0d8 \uc218\uc870\uac00 \ud544\uc694\ud574\uc11c \ud0a4\uc6b0\uae30\uac00 \ub9e4\uc6b0 \uc5b4\ub835\ub2e4.",
