      "desc_ja": "\u5149\u306b\u53cd\u5fdc\u305b\u305a\u306b\u3001\u5de7\u307f\u306b\u72e9\u308a\u3092\u3059\u308b\u9b5a\u3002\u3069\u3046\u3084\u3089\u72ec\u7279\u306a\u5668\u5b98\u306b\u3088\u308a\u3001\u30a8\u30fc\u30c6\u30eb\u6fc3\u5ea6\u3092\u611f\u77e5\u3057\u3066\u3044\u308b\u3088\u3046\u3060",
      "desc_de": "Dieser karnivore Fisch ist vollkommen unempfindlich Licht gegen\u00fcber. Er orientiert sich mithilfe eines besonderen Organs, mit dem er \u00c4therkonzentrationen feststellen kann. ",
      "desc_fr": "Oculus aethereus\r\nCet habile poisson carnassier est insensible \u00e0 la lumi\u00e8re. Apparemment, il disposerait d'un organe interne lui permettant d'\u00e9valuer la densit\u00e9 de l'\u00e9ther environnant, ce qui lui permet de chasser efficacement.",
