      "name_ko": "\ud5a5\uc5b4",
      "desc_en": "Why the Sharlayan called the sweetfish by that name is unknown, as the fish is in no way sweet, whether eaten raw or cooked. They are, however, delicious\u2500a trait that has resulted in overfishing. Large fish introduced into Dravanian waters by goblins have also contributed to the dwindling population of sweetfish.",
      "desc_ja": "\u305d\u306e\u540d\u306e\u901a\u308a\u9999\u308a\u304c\u3088\u3044\u9b5a\u3002\u30b7\u30e3\u30fc\u30ec\u30a2\u30f3\u4eba\u304c\u597d\u3093\u3067\u98df\u3057\u3066\u3044\u305f\u304c\u3001\u30b4\u30d6\u30ea\u30f3\u65cf\u304c\u6301\u3061\u8fbc\u3093\u3060\u5916\u6765\u7a2e\u306b\u8105\u304b\u3055\u308c\u3066\u3044\u308b",
      "desc_de": "Ein Fisch, so k\u00f6stlich, dass er beinahe t\u00e4glich bei den Sharlayanern auf dem Speiseplan stand. Leider ist seine Population durch eine von den Goblins eingeschleppte Fischart stark bedroht.",
      "desc_fr": "Plecoglossus altivelis\r\nLa chair douce, l\u00e9g\u00e8rement sucr\u00e9e et parfum\u00e9e de ce petit poisson lui a valu son nom courant. Les Sharlayanais l'appr\u00e9cient depuis longtemps, h\u00e9las il est menac\u00e9 par des esp\u00e8ces \u00e9trang\u00e8res introduites par les Gobelins.",
      "desc_ko": "\uc774\ub984\ucc98\ub7fc \uc88b\uc740 \ud5a5\uae30\uac00 \ub098\ub294 \ubb3c\uace0\uae30. \uc0ec\ub808\uc774\uc548 \uc0ac\ub78c\ub4e4\uc774 \uc990\uaca8 \uba39\uc5c8\uc9c0\ub9cc, \uace0\ube14\ub9b0\uc871\uc774 \ub4e4\uc5ec\uc628 \uc678\ub798\uc885\uc5d0 \uc0dd\ud0dc\ub97c \uc704\ud611\ubc1b\uace0 \uc788\ub2e4.",
