      "desc_ja": "\u982d\u90e8\u306b\u30bf\u30c6\u30ac\u30df\u306e\u3088\u3046\u306a\u5668\u5b98\u3092\u6709\u3059\u308b\u53e4\u4ee3\u9b5a\u3002\u4e38\u3044\u30dd\u30f3\u30dd\u30f3\u3092\u611b\u3059\u308b\u30e2\u30fc\u30b0\u30ea\u65cf\u306b\u3068\u3063\u3066\u306f\u3001\u4e0d\u683c\u597d\u3053\u306e\u4e0a\u306a\u3044\u3089\u3057\u3044",
      "desc_de": "Eine Reihe von schlanken, l\u00e4nglichen Organen auf dem Kopf des Fisches, die keinerlei Funktion zu haben scheinen, erwecken den Eindruck einer pr\u00e4chtigen M\u00e4hne, weshalb die Hundertflosse im Volksmund auch als \u201eL\u00f6wenmaul\u201c bekannt ist. Vielleicht fehlen ihnen die Bommel am Ende der l\u00e4nglichen Extremit\u00e4ten, aber aus irgendeinem Grund verabscheuen Mogrys diese Fischart.",
      "desc_fr": "Pterois dravanicus\r\nCe poisson primitif poss\u00e8de des nageoires \u00e0 longs rayons ressemblant \u00e0 une crini\u00e8re, d'o\u00f9 son autre nom de \u201cpoisson lion\u201d. Les Mogs, amateurs de formes rondes et soyeuses, trouvent cette esp\u00e8ce ex\u00adtr\u00ea\u00adme\u00adment disgracieuse.",
