      "desc_ja": "\u9ad8\u71b1\u306b\u9069\u5fdc\u3057\u305f\u4e80\u3002\u706b\u5c71\u306e\u5674\u706b\u6642\u306b\u6253\u3061\u4e0a\u3052\u3089\u308c\u305f\u500b\u4f53\u304c\u3001\u9695\u77f3\u306e\u3088\u3046\u306b\u964d\u308a\u6ce8\u3044\u3067\u304d\u305f\u3068\u3044\u3046\u4f1d\u8aac\u3082\u3042\u308b",
