      "desc_fr": "Testudo azysense\r\nCette tortue s'est adapt\u00e9e aux temp\u00e9ratures ex\u00adtr\u00ea\u00adme\u00adment \u00e9lev\u00e9es des courants laviques. Une l\u00e9gende populaire raconte qu'elle est tomb\u00e9e du ciel, projet\u00e9e en hauteur apr\u00e8s l'\u00e9ruption d'un volcan, pareille \u00e0 une com\u00e8te.",
