      "name_en": "Aetherochemical Compound #123",
      "name_ja": "\u9b54\u79d1\u5b66\u7269\u8cea123",
      "name_de": "\u00c4therochemischer Verbund Nr. 123",
      "name_fr": "Produit exp\u00e9rimental n\u00b0123",
      "name_ko": "\ub9c8\uacfc\ud559\ubb3c\uc9c8 123\ubc88",
      "desc_en": "Unlike anything else on Eorzea, compound #123 is thought to be another of the Allagan Empire's failed chimerical creations. The creature seems to be harmless enough, feeding only on the tiny water lice which inhabit Azys Lla's aetherochemical pools. Its outer hide, however, has given many a naturalist pause as it bears a texture almost identical to that of a Lalafell's skin.",
      "desc_ja": "\u7121\u6570\u306e\u89e6\u624b\u3092\u4f38\u3070\u3057\u3066\u3001\u5468\u56f2\u306e\u866b\u3092\u88dc\u98df\u3059\u308b\u8b0e\u3081\u3044\u305f\u7269\u8cea\u3002\u305d\u306e\u8868\u9762\u306f\u5999\u306b\u306a\u307e\u3081\u304b\u3057\u304f\u3001\u4eba\u306e\u808c\u306b\u4f3c\u3066\u3044\u308b",
      "desc_de": "Ein seltsames Wesen mit unz\u00e4hlig vielen Tentakeln, das sich von den Insekten in seiner unmittelbaren Umgebung ern\u00e4hrt. Man geht davon aus, dass es sich beim Verbund Nr. 123 um ein weiteres fehlgeschlagenes Experiment der Allager handelt, was die Frage aufwirft, warum seine Oberfl\u00e4che so viel \u00c4hnlichkeit mit der Haut von Lalafell hat.",
      "desc_fr": "Scotoplanes globosa\r\nUn \u00e9trange organisme dot\u00e9 de nombreux tentacules qui vit en d\u00e9vorant des insectes. Sa surface rose et douce ressemble fortement \u00e0 une peau humaine, d'o\u00f9 son surnom de \u201ccochon d'\u00e9ther\u201d.",
      "desc_ko": "\ubb34\uc218\ud55c \ucd09\uc218\ub97c \ubed7\uc5b4 \uc8fc\uc704\uc758 \ubc8c\ub808\ub97c \uc7a1\uc544\uba39\ub294 \uc218\uc218\uaed8\ub07c\uc758 \ubb3c\uc9c8. \ubb18\ud558\uac8c \ub9e4\ub048\uac70\ub9ac\ub294 \ud45c\uba74\uc740 \uc0ac\ub78c\uc758 \ud53c\ubd80\ucc98\ub7fc \ubcf4\uc774\uae30\ub3c4 \ud55c\ub2e4.",
