      "desc_de": "Dieser S\u00fc\u00dfwasser-Oktopus ern\u00e4hrt sich \u00fcberwiegend von Krebsen auf dem Grund von Gletscherseen. Wenn dieser Vorrat zur Neige geht, verlassen sie das Wasser, um an den gefrorenen K\u00fcsten nach Muscheln zu graben. Dort sind sie jedoch eine leichte Beute f\u00fcr Yetis, die sie auf einem Stein erschlagen und in einem Happen verschlingen.",
