      "desc_fr": "Carcharodon ferrantii\r\nCe squale volant aurait \u00e9t\u00e9 propuls\u00e9 dans l'air par un myst\u00e9rieux ouragan de tornades d'\u00e9ther de vent. Mieux vaut le neutraliser avant qu'il ne s\u00e8me la panique dans une grande ville... Et l\u00e0, tout est dit.",
