      "name_fr": "Arowana fossile",
      "name_ko": "\ud654\uc11d\uc544\ub85c\uc640\ub098",
      "desc_en": "In order to survive the extreme temperatures that would render a normal fish to cinders, the fossiltongue has developed a thick layer of stone scales that cover the wavekin's entire body, including its eyes. To locate its prey, it swims with its fossil-like tongue jut out constantly before it, taking in anything it touches, regardless of whether it is edible or not.",
      "desc_ja": "\u9ad8\u6e29\u3092\u8010\u3048\u629c\u304f\u305f\u3081\u306b\u3001\u91d1\u5c5e\u8cea\u306e\u9c57\u3067\u8986\u308f\u308c\u305f\u6eb6\u5ca9\u9b5a\u3002\u305d\u306e\u59ff\u306f\u3001\u307e\u308b\u3067\u5ca9\u306e\u3088\u3046\u3067\u5316\u77f3\u3068\u9593\u9055\u3048\u3089\u308c\u308b\u3053\u3068\u3082\u591a\u3044",
      "desc_de": "Um die extremen Temperaturen seines Habitates zu \u00fcberleben, hat der Fossilienz\u00fcngler eine dicke Schicht von Steinschuppen entwickelt, die seinen gesamten K\u00f6rper inklusive der Augen bedecken. Um Beute zu finden, schwimmt er mit seiner ausgestreckten fossilienartigen Zunge umher und verschlingt alles, was er damit ber\u00fchrt.",
      "desc_fr": "Osteoglossum bicirrhosum metallicus\r\nCe poisson lavique est couvert d'\u00e9cailles m\u00e9talliques qui lui permettent de r\u00e9sister \u00e0 de tr\u00e8s hautes temp\u00e9ratures. Son apparence imite si bien la pierre qu'on le prend parfois pour un v\u00e9ritable fossile.",
