      "name_fr": "Protohropken",
      "name_ko": "\uc0ac\uc871\uc5b4",
      "desc_en": "A strange fish that bears an eerie resemblance to the sea-dwelling hropken. Judging from the extensive cloning experiments conducted by the Allagans during their Third Astral Era reign, it is entirely feasible that hropkens were an Allagan creation and that this fish represents one of the ungodly stages of hropken development.",
      "desc_ja": "\u30d2\u30ec\u3092\u624b\u8db3\u306e\u3088\u3046\u306b\u7528\u3044\u3066\u3046\u3054\u3081\u304f\u4e0d\u6c17\u5473\u306a\u9b5a\u3002\u305d\u306e\u59ff\u306f\u3001\u3069\u3053\u3068\u306a\u304f\u9b5a\u4eba\u7a2e\u65cf\u30ed\u30d7\u30b1\u30f3\u306b\u4f3c\u3066\u3044\u308b\u304c\u2026\u2026",
      "desc_de": "Ein seltsamer Fisch, der eine unheimliche \u00c4hnlichkeit mit einem Hropken aufweist. Angesichts der umfangreichen Klonexperimente, die die Allager in der Vierten \u00c4ra des Lichts durchf\u00fchrten, ist es durchaus denkbar, dass Hropkens eine Kreation der Allager waren und dieser Fisch eine Stufe in dessen Entwicklung darstellt.",
      "desc_fr": "Brachiopsilus dianthus\r\nCe tr\u00e8s rare poisson poss\u00e8de des nageoires avant qu'il utilise comme des mains et des pieds, d'o\u00f9 son surnom de \u201cpoisson-main\u201d. Il ressemble \u00e9trangement aux hommes-poissons hropkens, ce qui laisse penser qu'il pourrait s'agir d'un produit exp\u00e9rimental interm\u00e9diaire...",
      "desc_ko": "\uc9c0\ub290\ub7ec\ubbf8\ub97c \uc190\ubc1c\ucc98\ub7fc \uc774\uc6a9\ud574 \ub3cc\uc544\ub2e4\ub2c8\ub294 \uc9d5\uadf8\ub7ec\uc6b4 \ubb3c\uace0\uae30. \uadf8 \ubaa8\uc2b5\uc774 \uc5b4\uca50\uc9c0 \uc5b4\uc778 \uc885\uc871 \ub85c\ud504\ucf04\uacfc \ub9ce\uc774 \ub2ee\uc558\ub294\ub370\u2026\u2026.",
