      "name_fr": "Ca\u00efman",
      "name_ko": "\ub3cc\uc545\uc5b4",
      "desc_en": "This snap-jawed scalekin sits atop of the aquatic food chain, feeding on whatever (or whomever!?) crosses his path. The caiman fears no retribution, for there is none who might topple him from his lofty throne. None, that is, of course, except dragons, for even a king must learn to bow his head to the gods.",
      "desc_ja": "\u5ddd\u8fba\u306e\u751f\u614b\u7cfb\u306e\u6700\u4e0a\u4f4d\u306b\u541b\u81e8\u3059\u308b\u3001\u7370\u731b\u306a\u308b\u6355\u98df\u8005\u3002\u305f\u3060\u3057\u3001\u305d\u308c\u306f\u30c9\u30e9\u30b4\u30f3\u65cf\u3092\u9664\u3044\u305f\u5834\u5408\u306e\u8a71\u3067\u3042\u308b",
      "desc_de": "Der Kaiman sitzt in der Nahrungskette ganz oben und frisst alles, was ihm \u00fcber den Weg l\u00e4uft. Er kennt keine Furcht, da es niemanden gibt, der ihn von seinem Thron st\u00fcrzen k\u00f6nnte. Bis auf die Drachen nat\u00fcrlich. Selbst ein K\u00f6nig muss lernen, sich vor den G\u00f6ttern zu verneigen.",
      "desc_fr": "Caiman crocodilus\r\nCe redoutable pr\u00e9dateur se trouve au sommet de la cha\u00eene alimentaire des milieux rivulaires, et ne craint pour ainsi dire personne \u00e0 part peut-\u00eatre les dragons qui peuplent les r\u00e9gions dravaniennes.",
      "desc_ko": "\ud558\ucc9c \uc0dd\ud0dc\uacc4\uc758 \uc815\uc0c1\uc5d0 \uad70\ub9bc\ud558\ub294 \uc0ac\ub098\uc6b4 \ud3ec\uc2dd\uc790. \ubb3c\ub860 \ub4dc\ub798\uace4\uc871\uc744 \uc81c\uc678\ud588\uc744 \uacbd\uc6b0\uc758 \uc774\uc57c\uae30\uc774\ub2e4.",
