      "desc_en": "A variety of pirarucu specially bred by the Allagans for mass consumption. Characteristics include a natural tendency to remain near the water's surface (to allow for quick retrieval), heightened reproductivity, rapid maturation, nutrient-rich flesh, and an easily removable skeleton (for efficient deboning).",
      "desc_ja": "\u30c9\u30e9\u30b4\u30f3\u65cf\u306e\u30a8\u30b5\u3068\u3057\u3066\u3001\u9b54\u79d1\u5b66\u306b\u3088\u3063\u3066\u54c1\u7a2e\u6539\u826f\u3055\u308c\u305f\u9b5a\u3002\u7570\u5e38\u306b\u7e41\u6b96\u80fd\u529b\u304c\u8c4a\u5bcc\u3067\u3001\u6804\u990a\u4fa1\u3082\u9ad8\u3044\u3088\u3046\u3060",
      "desc_de": "Eine Pirarucu-Art, die von den Allagern zum Massenkonsum gez\u00fcchtet wurde. Die Fische schwimmen nah an der Oberfl\u00e4che, vermehren sich rasch, enthalten ein besonders n\u00e4hrreiches Fleisch und lassen sich besonders einfach zerlegen.",
      "desc_fr": "Arapaima dravanica\r\nCette vari\u00e9t\u00e9 de pirarucu a \u00e9t\u00e9 am\u00e9lior\u00e9e par le biais de la magismologie pour servir de nourriture aux dragons. Elle se reproduit facilement avec un cycle court, en plus de poss\u00e9der un grand potentiel nutritif.",
      "desc_ko": "\ub4dc\ub798\uace4\uc871\uc758 \uba39\uc774\ub85c \uc774\uc6a9\ud558\uae30 \uc704\ud574 \ub9c8\uacfc\ud559\uc73c\ub85c \ud488\uc885\uac1c\ub7c9\ud55c \ubb3c\uace0\uae30. \ubc88\uc2dd \ub2a5\ub825\uc774 \ud0c1\uc6d4\ud558\uace0 \uc601\uc591\uac00\ub3c4 \ub192\ub2e4\uace0 \ud55c\ub2e4.",
