      "desc_ja": "\u79d1\u5b66\u8005\u96c6\u56e3\u300c\u9752\u306e\u624b\u300d\u304c\u54c1\u7a2e\u6539\u826f\u3092\u52a0\u3048\u305f\u30b4\u30d6\u30ea\u30f3\u30d1\u30fc\u30c1\u3002\u975e\u5e38\u306b\u6ce5\u81ed\u304f\u3066\u4e0d\u5473\u3044\u304c\u3001\u30b4\u30d6\u30ea\u30f3\u65cf\u7684\u306b\u306f\u7f8e\u5473\u3089\u3057\u3044",
