      "desc_fr": "Macquaria gobelinia var. indigo\r\nLe groupe de Gobelins scien\u00adti\u00adfi\u00adques appel\u00e9 la \u201cMain indigo\u201d a r\u00e9ussi \u00e0 am\u00e9liorer cette esp\u00e8ce de perches gobelines par des croisements. Les Gobelins semblent les trouver d\u00e9licieuses, malgr\u00e9 leur go\u00fbt terreux et fade.",
