      "name_ko": "\ud558\ub298\ud0a4\uc7a1\uc774",
      "desc_en": "Blindingly fast and possessing almost inexhaustible stamina, the rudderfish is a favorite tool for mother dragons teaching their pups to hunt in the air.",
      "desc_ja": "\u76ee\u306b\u3082\u6b62\u307e\u3089\u306c\u7d20\u65e9\u3055\u3067\u98db\u884c\u3059\u308b\u96f2\u6d77\u9b5a\u3002\u30c9\u30e9\u30b4\u30f3\u65cf\u306e\u5e7c\u4f53\u306f\u3001\u3053\u306e\u96f2\u6d77\u9b5a\u3092\u76f8\u624b\u306b\u72e9\u308a\u306e\u8155\u3092\u78e8\u304f\u3088\u3046\u3060",
      "desc_de": "Ruderfische sind erstaunlich schnell und verf\u00fcgen \u00fcber eine schier un\u00ader\u00adsch\u00f6pf\u00adli\u00adche Ausdauer. Das macht sie zu einem idealen Ziel f\u00fcr Drachenm\u00fctter, die ihrem Nachwuchs das Jagen in der Luft beibringen m\u00f6chten.",
      "desc_fr": "Fulgur dravanicus\r\nCe poisson cousin du fulgure vole si rapidement qu'on a du mal \u00e0 l'apercevoir. Les jeunes dragons le poursuivent pour apprendre les rudiments de la chasse, \u00e0 ce qu'on raconte.",
