      "name_ko": "\uc6a9\uc554\uba54\uae30",
      "desc_en": "An ancient tome on culinary legend kept on display at the Bismarck tells the story of a man who climbed the highest peak in Abalathia's Spine to catch the mythical catfish which swim the red-hot blood of Hydaelyn Herself. Upon drawing the fish from the lake of lava, he found the fish was already cooked, and proceeded to devour it, for the journey into the heart of the mountain had left him famished.",
      "desc_ja": "\u30ca\u30de\u30ba\u306b\u4f3c\u305f\u6eb6\u5ca9\u9b5a\u3002\u706b\u5c71\u306e\u5674\u706b\u3092\u53f8\u308b\u5b58\u5728\u3068\u3057\u3066\u3001\u4e00\u90e8\u306e\u4f1d\u627f\u306b\u8a18\u3055\u308c\u3066\u3044\u308b\u304c\u3001\u5b9f\u7269\u3092\u898b\u305f\u8005\u306f\u5c11\u306a\u3044",
      "desc_de": "Ein uralter W\u00e4lzer, der im Bismarck ausliegt, erz\u00e4hlt die Geschichte eines Mannes, der den h\u00f6chsten Gipfel in Abalathias R\u00fcckgrat erklomm, um einen mythischen Katfisch zu fangen, der in der gl\u00fchend hei\u00dfen Lava schwimmt. Als er den Fisch aus der Lava zog, stellte er fest, dass dieser bereits gekocht war, und verschlang ihn an Ort und Stelle.",
      "desc_fr": "Silurus dravanicus\r\nUn poisson lavique qui ressemble au poisson-chat. Dans certaines traditions, on pense que ce poisson contr\u00f4le les \u00e9ruptions volcaniques et on le v\u00e9n\u00e8re en tant que tel, mais peu nombreux sont ceux \u00e0 l'avoir r\u00e9ellement vu.",
      "desc_ko": "\uba54\uae30\uc640 \ub2ee\uc740 \uc6a9\uc554\uace0\uae30. \uc77c\ubd80 \uc804\uc2b9\uc5d0\ub294 \ud654\uc0b0\uc758 \ubd84\ud654\ub97c \uad00\uc7a5\ud558\ub294 \uc874\uc7ac\ub85c \uae30\ub85d\ub418\uc5b4 \uc788\uc73c\ub098, \uc2e4\ubb3c\uc744 \ubaa9\uaca9\ud55c \uc0ac\ub78c\uc740 \uc801\ub2e4.",
