      "name_fr": "Pt\u00e9ranodon",
      "name_ko": "\ud504\ud14c\ub77c\ub178\ub3c8",
      "desc_en": "If sketches in ancient bestiaries are to be believed, this scalekin has changed very little over the past several millennia, leading some to believe that it is of the same blood as the dragons. This has, however, been disproven, the flying lizards possessing about as much intelligence as the average ninki nanka.",
      "desc_ja": "\u53e4\u4ee3\u304b\u3089\u59ff\u3092\u5909\u3048\u306a\u3044\u6709\u7ffc\u306e\u7532\u9c57\u7db1\u3002\u30c9\u30e9\u30b4\u30f3\u65cf\u3068\u898b\u8aa4\u308b\u8005\u3082\u5c11\u306a\u304f\u306a\u3044\u304c\u3001\u77e5\u6027\u306f\u306a\u3044\u7363\u540c\u7136\u306e\u5b58\u5728\u3067\u3042\u308b",
      "desc_de": "Wenn man uralten Bestiarien Glauben schenken darf, hat sich dieses schuppige Wesen im Laufe der letzten Jahrtausende kaum ver\u00e4ndert. Einige Leute vermuteten daher, dass in ihnen das Blut der Drachen flie\u00dfe. Dies wurde allerdings dadurch widerlegt, dass die fliegenden Echsen in etwa so intelligent sind wie Ninki Nankas.",
      "desc_fr": "Pteranodon\r\nCette esp\u00e8ce panchronique unique est un reptile ail\u00e9 de grande taille. Nombreux sont ceux qui le confondent avec un dragon, mais c'est un animal simple, \u00e0 l'intellect bien inf\u00e9rieur \u00e0 celui d'un dragon.",
      "desc_ko": "\uc61b \ubaa8\uc2b5\uc744 \uadf8\ub300\ub85c \uc720\uc9c0\ud558\uace0 \uc788\ub294 \ub0a0\uac1c \ub2ec\ub9b0 \uac11\ub9b0\uac15 \uc0dd\ubb3c. \ub4dc\ub798\uace4\uc871\uc73c\ub85c \ucc29\uac01\ud558\ub294 \uc0ac\ub78c\ub3c4 \ub9ce\uc73c\ub098, \uc9c0\ub2a5\uc774 \ub0ae\uc544\uc11c \uc9d0\uc2b9\uc774\ub098 \ub9c8\ucc2c\uac00\uc9c0\uc774\ub2e4.",
