      "desc_de": "Die Fl\u00fcgel dieses fliegenden Fisches bestehen fast vollst\u00e4ndig aus konzentriertem \u00c4ther. Dieser l\u00f6st sich auf, sobald der Fisch gefangen wird, sodass lediglich die skelettartigen Strukturen zur\u00fcckbleiben.",
      "desc_fr": "Chelidonichthys spinosus\r\nCe poisson insolite a r\u00e9ussi \u00e0 se cr\u00e9er des ailes d'\u00e9ther concentr\u00e9 gr\u00e2ce auxquelles il vole. Il utilise ses fines nageoires comme des pattes, ce qui lui permet de se cramponner aux parois des \u00eeles flottantes pour se reposer de temps \u00e0 autre.",
