      "name_ko": "\uc628\ucc9c\uc131\uac8c",
      "desc_en": "Though found solely in the hyperborean reaches of Eorzea, the spring urchin can only survive in the heated waters of geothermal springs. A good number of the shrill howls that fill the Coerthan nights are from yetis who mistakenly step on the urchins' spiked shells when wading through the natural baths.",
      "desc_ja": "\u6e67\u304d\u51fa\u3059\u71b1\u6c34\u306e\u5468\u56f2\u306b\u68f2\u606f\u3059\u308b\u30a6\u30cb\u306e\u4e00\u7a2e\u3002\u6e29\u6cc9\u306b\u6d78\u304b\u308a\u306b\u6765\u305f\u30a4\u30a8\u30c6\u30a3\u304c\u3001\u3053\u308c\u3092\u8e0f\u307f\u3064\u3051\u932f\u4e71\u72b6\u614b\u306b\u9665\u308b\u3053\u3068\u3082",
      "desc_de": "Obwohl dieser Seeigel aus\u00adschlie\u00df\u00adlich in den k\u00e4ltesten Regionen Eorzeas vorhanden ist, kann er dort nur im warmen Wasser von Thermal\u00adquellen \u00fcberleben. In Coerthas ist nachts h\u00e4ufig ein schrilles Heulen zu vernehmen, das nicht selten von Yetis stammt, die beim Waten durch die nat\u00fcrlichen B\u00e4der auf einen der Seeigel getreten sind. ",
      "desc_fr": "Arbacia thermophilum\r\nCet oursin vit dans les sources chaudes de Glaire-de-dragon. Les y\u00e9tis qui viennent s'y baigner marchent parfois dessus accidentellement, provoquant chez les malheureux un d\u00e9sarroi bien com\u00adpr\u00e9\u00adhen\u00adsi\u00adble.",
