      "name_fr": "Archelon a\u00e9rien",
      "name_ko": "\uc120\uc0ac\uac70\ubd81",
      "desc_en": "This rare tortoise's ability of flight is granted by its fabulous shell made up of solid wind crystal. As long as the shell remains undamaged, the cloudkin will remain aloft; however, the moment even the smallest of scratches are suffered, it will plummet back to Hydaelyn.",
      "desc_ja": "\u30a6\u30a3\u30f3\u30c9\u30af\u30ea\u30b9\u30bf\u30eb\u306e\u6210\u5206\u3092\u542b\u3080\u7532\u7f85\u306b\u3088\u3063\u3066\u3001\u7a7a\u3092\u98db\u3076\u73cd\u3057\u3044\u4e80\u3002\u305f\u3060\u3057\u3001\u7532\u7f85\u304c\u50b7\u3064\u304f\u3068\u3001\u77ac\u304f\u9593\u306b\u843d\u4e0b\u3059\u308b",
      "desc_de": "Ihr Panzer aus Windkristallen verleiht dieser seltenen Schildkr\u00f6te die F\u00e4higkeit zum Fliegen. Solange der Panzer intakt bleibt, schwebt sie immer weiter, aber sobald dieser auch nur den kleinsten Kratzer bekommt, f\u00e4llt sie zur\u00fcck zu Hydaelyn.",
      "desc_fr": "Archelon\r\nCette tortue a\u00e9rienne volerait gr\u00e2ce aux fragments de cristal de vent que contient sa carapace. Si celle-ci est endommag\u00e9e, elle tombe im\u00adm\u00e9\u00addia\u00adte\u00adment. On la conna\u00eet \u00e9galement sous le nom de stupendemys.",
