      "name_ko": "\ubcbc\ub77d\uc7a5\uc5b4",
      "desc_en": "While able to generate an electric charge with its body, this wavekin does not utilize that charge to subdue its prey, but rather locate it by detecting how the electric waves change after being released. Once the eel has determined where its prey is, it will wrap itself about the creature and strangle it.",
      "desc_ja": "\u96f7\u6c17\u3092\u767a\u3057\u3066\u5468\u56f2\u3092\u63a2\u308a\u3001\u6b21\u3005\u3068\u7372\u7269\u3092\u6349\u3048\u308b\u72e1\u733e\u306a\u6355\u98df\u8005\u3002\u59ff\u306f\u30a6\u30ca\u30ae\u306b\u4f3c\u3066\u3044\u308b\u304c\u3001\u5225\u7a2e\u306e\u5b58\u5728\u3067\u3042\u308b",
      "desc_de": "Die F\u00e4higkeit, eine elektrische Ladung in seinem K\u00f6rper zu erzeugen, benutzt dieser Aal nicht etwa dazu, seine Beute anzugreifen, sondern um zu sehen, wie sich die elektrischen Wellen nach ihrer Entladung ver\u00e4ndern. Sobald der Aal seine Beute ausfindig gemacht hat, wickelt er sich um sie und erdrosselt sie.",
      "desc_fr": "Electrophorus fulguralis\r\nUn poisson allong\u00e9 qui utilise des d\u00e9charges \u00e9lectriques pour foudroyer habilement ses proies. Sa ressemblance avec l'anguille noire n'est que fortuite, car ce sont deux esp\u00e8ces assez \u00e9loign\u00e9es.",
      "desc_ko": "\uc804\uae30\ub97c \ubc1c\uc0dd\uc2dc\ucf1c \uc8fc\uc704\uc5d0 \uc788\ub294 \uc0ac\ub0e5\uac10\uc744 \ucc3e\uc544 \uc7a1\uc544\uba39\ub294 \uad50\ud65c\ud55c \ud3ec\uc2dd\uc790. \uc0dd\uae40\uc0c8\ub294 \uc7a5\uc5b4\uc640 \ub2ee\uc558\uc9c0\ub9cc, \uc804\ud600 \ub2e4\ub978 \uc885\uc774\ub2e4.",
