      "name_fr": "Mange-ga\u00e9lichats",
      "name_ko": "\uac8c\uc77c\ub9ac\ud0ac\ub7ec",
      "desc_en": "The catkiller is a freshwater pike which uses its long, whip-like dorsal fin to impale gaelicats who fly too close to the water's surface. Formerly called a \u201cgaelicatkiller,\u201d the amalgamation of three different words into one was deemed by naturalist circles far too difficult to read and subsequently shortened to its current (albeit equally unceremonious) moniker.",
      "desc_ja": "\u30a2\u30d0\u30e9\u30b7\u30a2\u96f2\u6d77\u56fa\u6709\u306e\u30d1\u30a4\u30af\u3002\u30e0\u30c1\u306e\u3088\u3046\u306b\u8eab\u4f53\u3092\u3057\u306a\u3089\u305b\u98db\u3073\u4e0a\u304c\u308a\u3001\u7a7a\u4e2d\u3092\u98db\u3076\u30b2\u30a4\u30e9\u30ad\u30e3\u30c3\u30c8\u3092\u6355\u98df\u3059\u308b\u3053\u3068\u3082",
      "desc_de": "Der Geirakiller ist ein S\u00fc\u00dfwasserhecht, der seine lange, peitschenartige R\u00fcckenflosse dazu benutzt, Geira-Katzen aufzuspie\u00dfen, die sich zu sehr der Wasser\u00adober\u00adfl\u00e4che n\u00e4hern.",
      "desc_fr": "Esox abalathicus\r\nCe gros brochet end\u00e9mique de L'\u00c9cume des cieux d'Abalathia est connu pour son agilit\u00e9 ex\u00adcep\u00adtion\u00adnelle. Faisant claquer son corps comme un fouet, il se propulse hors de l'eau et attaque les ga\u00e9lichats qui volent \u00e0 proximit\u00e9.",
