      "name_de": "Bergkrake",
      "name_fr": "Kraken des montagnes",
      "name_ko": "\ub9f9\ub3c5 \ud06c\ub77c\ucf04",
      "desc_en": "For centuries, the legend of Saint Daniffen and the Kraken was thought to be only that\u2500a fantastical tale spun by the See to beatify the life of an otherwise kindly, yet ordinary, man. That is, until a giant cephalopod was found lurking in a mountain lake.",
