      "desc_de": "Man sollte meinen, zum Thema Tornadohaie w\u00e4re schon mehr als genug gesagt worden, doch in j\u00fcngster Zeit halten Sichtungen dieser gr\u00f6\u00dferen und gef\u00e4hrlicheren Laune der Natur die Rosenkavalleristen in Atem.",
      "desc_fr": "Ce squale a la r\u00e9putation d'\u00eatre un mangeur d'hommes, et bien qu'il ait disparu de L'\u00c9cume des cieux d'Abalathia pendant un certain temps, il semble \u00eatre revenu plus v\u00e9loce, violent et vorace que jamais. Attention donc !",
      "desc_ko": "\ud558\ub298\uc744 \ub098\ub294 \uc2dd\uc778 \uc0c1\uc5b4\uac00 \ud749\uc545\ud55c \ub3cc\ud48d\uc744 \uc774\ub04c\uace0 \ub3cc\uc544\uc654\ub2e4. \ucd5c\ub300\uc21c\uac04\ud48d\uc18d\uc740 \uc0ac\uc0c1 \ucd5c\uac15. \ub9d0\ub85c\ub294 \ub354 \uc124\uba85\ud560 \uc218 \uc5c6\ub2e4.",
