      "desc_de": "Anders als euphotische Pirarucu, die sich nahe der Oberfl\u00e4che aufhalten, f\u00fchlt sich diese Spezies nicht zum Licht hingezogen und h\u00e4lt sich stattdessen in den Sedimenten tiefer Gew\u00e4sser auf, wo sie ausreichend Nahrung findet. Die steinartigen Schuppen sind ein Resultat des hohen Mineralgehaltes dieser Sedimente.",
      "desc_fr": "Ce pirarucu allagois a connu une telle croissance qu'il est d\u00e9sormais suf\u00adfi\u00adsam\u00adment grand pour que m\u00eame les dragons ne puissent l'ingurgiter. Ils auraient de toute fa\u00e7on bien de la peine \u00e0 le dig\u00e9rer.",
