      "desc_ja": "\u5927\u632f\u308a\u306e\u6c37\u795e\u9b5a\u3002\u30c0\u30a4\u30a2\u30e2\u30f3\u30c9\u30c0\u30b9\u30c8\u304c\u714c\u3081\u304f\u5bd2\u7a7a\u306e\u4e0b\u3067\u512a\u96c5\u306b\u6cf3\u3050\u59ff\u304b\u3089\u3001\u3044\u3064\u3057\u304b\u300c\u6c37\u306e\u5deb\u5973\u300d\u3068\u547c\u3070\u308c\u308b\u3088\u3046\u306b\u306a\u3063\u305f",
      "desc_de": "Ein riesiger Fisch, der zur Familie der Schneeg\u00f6ttin geh\u00f6rt, verdankt seinen Namen seinem Schwimmstil. Wenn er unter dem klirrend kalten Himmel von Coerthas elegant seine Kreise im Wasser zieht, f\u00fchlt man sich an Eisherz erinnert.",
      "desc_fr": "Cet \u00e9norme sp\u00e9cimen de d\u00e9esse des neiges nage avec tant de gr\u00e2ce et d'\u00e9l\u00e9gance dans les eaux glaciales du Coerthas, qu'on croirait presque qu'il danse sous une pluie de poussi\u00e8re de diamant. C'est d'ailleurs pour cette raison que certains l'appellent \u201cC\u0153ur-de-glace\u201d.",
      "desc_ko": "\ud07c\uc9c1\ud55c \uc5bc\uc74c\uc2e0\uc5b4. \ub2e4\uc774\uc544\ubaac\ub4dc \ub354\uc2a4\ud2b8\uac00 \ube5b\ub098\ub294 \ucc28\uac00\uc6b4 \uaca8\uc6b8 \ud558\ub298 \uc544\ub798\uc11c \uc6b0\uc544\ud558\uac8c \ud5e4\uc5c4\uce58\ub294 \ubaa8\uc2b5 \ub54c\ubb38\uc5d0, \uc5b8\uc81c\ubd80\ud134\uac00 '\uc5bc\uc74c\uc758 \ubb34\ub140'\ub77c\uace0 \ubd88\ub9ac\uac8c \ub418\uc5c8\ub2e4.",
