      "desc_de": "Bei diesem Exemplar ist das m\u00e4hnenartige Organ auf dem Kopf total ausgefranst. Das Aussehen wirkt auf Mogrys absolut absto\u00dfend - perfekt geeignet als Geschenk beim Mogry-Wichteln.",
      "desc_fr": "Les rayons \u00e9pineux de ce sp\u00e9cimen fourchent en une multitude de pointes plus fines \u00e0 leur extr\u00e9mit\u00e9. On ne compte plus les Mogs qui ont tourn\u00e9 du pompon \u00e0 la simple vue de cette cr\u00e9ature.",
