      "desc_de": "Die Kinder Eorzeas nutzen diese Muscheln f\u00fcr ein beliebtes Spiel. Dabei teilen sie die Muscheln in zwei H\u00e4lften und verstauen sie in getrennten Beuteln. Die Jungen ziehen dann eine H\u00e4lfte aus dem einen und die M\u00e4dchen eine aus dem anderen Beutel. Sich so findende Paare sind angeblich f\u00fcreinander bestimmt.",
