      "desc_ja": "\u6de1\u6c34\u6027\u306e\u5c0f\u3055\u306a\u6d77\u8001\u3002\u8eab\u306f\u5c0f\u3055\u3044\u304c\u3001\u5b50\u3069\u3082\u305f\u3061\u306e\u5915\u98df\u3068\u3057\u3066\u4eba\u6c17\u304c\u9ad8\u3044\u3002\u7279\u306b\u30d5\u30e9\u30a4\u306b\u3057\u305f\u6642\u306b\u306f\u3001\u7f8e\u5473\u3060\u3068\u3044\u3046",
