      "name_ko": "\ud61c\uc131 \ud53c\ub77c\ubbf8",
      "desc_en": "Stargazers tell of a deity's long descent through the night sky to shine amid murky waters, and claim the fires of the heavens still burn upon its scales. Aquaculturists generally espouse cynicism toward such out-of-this-world origin stories.",
      "desc_ja": "\u6697\u3044\u9ec4\u8910\u8272\u306e\u9c57\u3092\u6301\u3064\u6de1\u6c34\u9b5a\u3002\u5929\u3092\u6d41\u308c\u308b\u5f57\u661f\u304c\u3001\u795e\u3068\u3057\u3066\u964d\u81e8\u3057\u305f\u4f1d\u8aac\u306e\u5730\u306b\u68f2\u307e\u3046\u3053\u3068\u304b\u3089\u3001\u5f57\u661f\u9b5a\u3068\u3082\u547c\u3070\u308c\u308b",
      "desc_de": "Sterndeuter erz\u00e4hlen sich von einer Gottheit, die vom Nachthimmel zu uns hinabstieg, um tr\u00fcbe Gew\u00e4sser mit dem Sternenglanz ihrer Schuppen zu erleuchten. Bodenst\u00e4ndige Fischer haben f\u00fcr solche Erkl\u00e4rungsversuche meist nichts als ein L\u00e4cheln \u00fcbrig.",
      "desc_fr": "Certains consid\u00e8rent ce poisson comme une divinit\u00e9 filant \u00e0 toute vitesse dans le ciel nocturne pour venir illuminer les eaux troubles. Ils affirment que les feux c\u00e9lestes br\u00fblent encore sur ses \u00e9cailles, ce qui amuse beaucoup les aquaculteurs beaucoup moins mystiques.",
      "desc_ko": "\uc9d9\uc740 \ud669\uac08\uc0c9 \ube44\ub298\uc744 \uc9c0\ub2cc \ubbfc\ubb3c\uace0\uae30. \ud558\ub298\uc744 \uac00\ub974\ub294 \ud61c\uc131\uc774 \uc2e0\uc73c\ub85c \uac15\ub9bc\ud55c \uc804\uc124\uc758 \ub545\uc5d0 \uc11c\uc2dd\ud574\uc11c, \ud61c\uc131\uc5b4\ub77c\uace0\ub3c4 \ubd88\ub9b0\ub2e4.",
