      "id": 20029,
      "name_en": "Golden Cichlid",
      "name_ja": "\u30b4\u30fc\u30eb\u30c7\u30f3\u30b7\u30af\u30ea\u30c3\u30c9",
      "name_de": "Goldener Buntbarsch",
      "name_fr": "Cichlid\u00e9 dor\u00e9",
      "name_ko": "\uae08\ud0dc\ub798\uc5b4",
      "desc_en": "Cichlids named for the glittering scales unique to adult males, which garner the attention of mates and predators alike. The survival of the species undoubtedly owes more to the subdued, aptly camouflaging blue hue featured by its widows and orphans.",
      "desc_ja": "\u9ec4\u91d1\u306b\u8f1d\u304f\u6de1\u6c34\u9b5a\u3002\u305f\u3060\u3057\u3001\u7f8e\u3057\u3044\u306e\u306f\u6210\u719f\u3057\u3066\u767a\u60c5\u671f\u3092\u8fce\u3048\u305f\u96c4\u306e\u307f\u3067\u3042\u308a\u3001\u5e7c\u9b5a\u306f\u3001\u96cc\u96c4\u3068\u3082\u306b\u9752\u8272\u3067\u3042\u308b",
      "desc_de": "Benannt nach den glitzernden Schuppen m\u00e4nnlicher Exemplare, die in der Paarungszeit Weibchen, aber leider auch Raubfische anlocken. Das \u00dcberleben der Art ist demnach eher den dezenten Blaut\u00f6nen des Schuppenkleides der vielen Witwen und Waisen zu verdanken.",
      "desc_fr": "Ce poisson a \u00e9t\u00e9 nomm\u00e9 ainsi en raison de ses \u00e9cailles scintillantes uniques aux m\u00e2les adultes, qui attirent l'attention des femelles, mais surtout des pr\u00e9dateurs. Si cette esp\u00e8ce perdure, c'est en grande partie gr\u00e2ce \u00e0 la l\u00e9g\u00e8re teinte bleut\u00e9e des veuves et des orphelins.",
      "desc_ko": "\ud669\uae08\uc0c9\uc73c\ub85c \ube5b\ub098\ub294 \ubbfc\ubb3c\uace0\uae30. \uc544\ub984\ub2f5\uac8c \ube5b\ub098\ub294 \uac83\uc740 \ub2e4 \uc790\ub77c\uc11c \ubc1c\uc815\uae30\ub97c \ub9de\uc774\ud55c \uc218\ucef7\ubfd0\uc774\uba70, \uce58\uc5b4\ub294 \uc554\uc218 \ubaa8\ub450 \ud478\ub978\uc0c9\uc774\ub2e4. ",
