      "name_fr": "Gobie fain\u00e9ant",
      "name_ko": "\uac8c\uc73c\ub984 \ub9dd\ub465\uc774",
      "desc_en": "One would have to wake up pretty early in the morning to out-slack this notoriously lackadaisical loiterer. Its primary hunting technique consists of lying stagnant in the Slow Wash and waiting for its prey to drift up to it.",
      "desc_ja": "\u6d41\u308c\u304c\u7de9\u3084\u304b\u306a\u30b9\u30ed\u30a6\u30a6\u30a9\u30c3\u30b7\u30e5\u306e\u6dc0\u307f\u3067\u3001\u307b\u3068\u3093\u3069\u52d5\u304f\u3053\u3068\u306a\u304f\u7372\u7269\u304c\u76ee\u306e\u524d\u3092\u901a\u308a\u904e\u304e\u308b\u306e\u3092\u5f85\u3063\u3066\u3044\u308b",
      "desc_de": "Selbst B\u00e4ren im Winterschlaf sind gegen diese beh\u00e4bige Fischart wahre Energieb\u00fcndel. Die Tr\u00e4ge Grundel jagt, indem sie sich faul in die Str\u00f6mung der Tr\u00e4gen Traufe legt und darauf wartet, dass ihr unvorsichtige Beute direkt ins Maul schwimmt.",
      "desc_fr": "Seuls ceux qui se l\u00e8vent tr\u00e8s t\u00f4t le matin ont la chance de voir ce grand paresseux se d\u00e9placer. Sa technique de chasse principale consiste \u00e0 rester immobile dans le Doux lavement et \u00e0 attendre que ses proies lui tombent toutes seules dans la bouche.",
      "desc_ko": "\ubb3c\uc0b4\uc774 \uc794\uc794\ud55c \ub290\ub9b0\ub108\uc6b8 \uac15\uc758 \uc6c5\ub369\uc774\uc5d0\uc11c \uac70\uc758 \uc6c0\uc9c1\uc774\uc9c0 \uc54a\uace0 \uc0ac\ub0e5\uac10\uc774 \ub208\uc55e\uc744 \uc9c0\ub098\uac00\uae30\ub97c \uae30\ub2e4\ub9ac\ub294 \ubb3c\uace0\uae30.",
