      "desc_de": "Dieser Fisch ern\u00e4hrt sich aus\u00adschlie\u00df\u00adlich von Algen, was ihm einen frischen und k\u00f6stlichen Geschmack verleiht, f\u00fcr den Fischh\u00e4ndler aus Gyr Abania hohe Preise zahlen. Auch als Tribut f\u00fcr die Padjal wird er gerne ausgew\u00e4hlt. Dies zeigt, dass eine gesunde Ern\u00e4hrung entgegen der allgemeinen Meinung nicht immer das Beste f\u00fcr eine Spezies ist.",
      "desc_fr": "Son r\u00e9gime d'algues maintient ce poisson en excellente sant\u00e9, lui donnant une saveur fra\u00eeche et d\u00e9licieuse qui fait les affaires des poissonniers de Gyr Abania tout en rendant hommage aux Padjals. Cela d\u00e9montre que contrairement aux id\u00e9es re\u00e7ues, une ali\u00admen\u00adta\u00adtion saine n'a pas que des avantages.",
