      "name_ko": "\uc904\ubb34\ub2ac\uc7a5\uc5b4",
      "desc_en": "For decades, the taxonomy of this species had been the subject of fierce tripartite debate, driving the aquatic nomenclature community to the brink of schism, until a compromise was reached whereby the creature would simply be known by all three names.",
      "desc_ja": "\u5186\u5f62\u306e\u9ed2\u8272\u6591\u3067\u8986\u308f\u308c\u305f\u5927\u578b\u306e\u30a6\u30df\u30d8\u30d3\u3002\u7d0b\u6bbb\u901a\u3068\u3044\u3046\u540d\u3067\u547c\u3070\u308c\u308b\u3088\u3046\u306b\u306a\u3063\u305f\u7406\u7531\u306f\u3001\u3088\u304f\u308f\u304b\u3063\u3066\u3044\u306a\u3044",
      "desc_de": "Jahrzehntelang war sich die Fachwelt uneins, wie diese Spezies zu benennen sei. Die drei Lager stritten lei\u00adden\u00adschaft\u00adlich und ein Ende der Diskussionen war nicht abzusehen, bis man sich schlie\u00dflich einigte, alle drei Namen in einem zu vereinen.",
