      "desc_ko": "\uc6d0\ud615\uc758 \uac80\uc740 \uc5bc\ub8e9\uc73c\ub85c \ub4a4\ub36e\uc778 \ub300\ud615 \ubc14\ub2e4\ubc40. \uc904\ubb34\ub2ac\uc7a5\uc5b4\ub77c\ub294 \uc774\ub984\uc73c\ub85c \ubd88\ub9ac\uac8c \ub41c \uc774\uc720\ub294 \uc798 \uc54c\ub824\uc9c0\uc9c0 \uc54a\uc558\ub2e4.",
