      "desc_de": "Ein Fisch, der sich von Insekten ern\u00e4hrt, die in der Gischt von Wasserf\u00e4llen ins Straucheln geraten und ins k\u00fchle Nass fallen. Zuletzt lachen jedoch jene, die ihn mit ordentlich Salz bestreut und gebraten am Stock \u00fcberm offenen Feuer genie\u00dfen.",
