      "name_ko": "\uc5d0\ub2c8\ub4dc\uc0c8\uc6b0",
      "desc_en": "Shrimp bearing the name of a woman who perished with her husband Grymm while fleeing the floods of the Sixth Umbral Calamity. It is said she died of drinking too much water while trying to slake an unquenchable thirst.",
      "desc_ja": "\u592b\u5a66\u6c60\u306e\u8a9e\u6e90\u3067\u3042\u308b\u30b0\u30ea\u30e0\u30fb\u30a8\u30cb\u30c3\u30c9\u592b\u59bb\u306e\u3046\u3061\u3001\u59bb\u306e\u540d\u3092\u51a0\u3057\u305f\u6d77\u8001\u3002\u5f7c\u3089\u306f\u6e07\u304d\u306e\u3042\u307e\u308a\u3001\u898b\u3064\u3051\u305f\u6c34\u5834\u3067\u6c34\u3092\u98f2\u307f\u904e\u304e\u3066\u6b7b\u3093\u3060",
      "desc_de": "Eine Garnele, die den Namen einer Frau tr\u00e4gt, die auf der Flucht mit ihrem Mann Grymm vor den Fluten der Sechsten Katastrophe ums Leben kam. Angeblich starb sie, weil sie bei dem Versuch, einen unfassbaren Durst zu stillen, zu viel Wasser trank.",
