      "name_fr": "Poisson-dragon",
      "name_ko": "\uc6a9\uc5b4",
      "desc_en": "Though oft found in the aquariums of well-to-do merchants who fancy themselves the living incarnations of imperious, fire-breathing serpents, any relationship between this fish and the mystical creature of legend is purely metaphorical.",
      "desc_ja": "\u4f1d\u8aac\u4e0a\u306e\u751f\u7269\u300c\u9f8d\u300d\u306b\u55a9\u3048\u3089\u308c\u308b\u9b5a\u3002\u9f8d\u304c\u5bcc\u3084\u6a29\u529b\u3092\u8c61\u5fb4\u3059\u308b\u305f\u3081\u3001\u7279\u306b\u5546\u4eba\u968e\u7d1a\u304b\u3089\u62db\u798f\u306e\u305f\u3081\u306e\u89b3\u8cde\u9b5a\u3068\u3057\u3066\u4eba\u6c17\u304c\u9ad8\u3044",
