      "name_ko": "\uac70\ub300\uc624\uc9d5\uc5b4",
      "desc_en": "Known to Hingans as the \u201cgreat king,\u201d this rare kraken maintains a shroud of mystery, only surfacing from deep-sea depths when it truly needs a release.",
      "desc_ja": "\u7a00\u306b\u73fe\u308c\u308b\u5de8\u5927\u306a\u30a4\u30ab\u3002\u666e\u6bb5\u306f\u6df1\u6d77\u3067\u66ae\u3089\u3057\u3066\u3044\u308b\u3068\u601d\u308f\u308c\u308b\u304c\u3001\u305d\u306e\u751f\u614b\u306b\u306f\u8b0e\u304c\u591a\u304f\u3001\u8a73\u7d30\u306f\u5224\u660e\u3057\u3066\u3044\u306a\u3044",
      "desc_de": "Unter den Hinganern als der \u201egro\u00dfe K\u00f6nig\u201c bekannt. Diesen seltenen Kraken umgibt ein geheimnisvoller Schleier, und er begibt sich nur selten aus seinem Tiefsee-Habitat an die Oberfl\u00e4che.",
