      "desc_fr": "Parfois, la nature fait mouche au premier essai, comme en t\u00e9moigne le r\u00e8gne sans partage de ce pr\u00e9dateur sur la faune aquatique. Parfaitement \u00e0 l'aise dans les eaux de la Mer de Rubis, il n'a pas \u00e9volu\u00e9 depuis l'antiquit\u00e9.",
