      "desc_de": "Wann immer ein Jungfrauenkarpfen in Not ist, galoppiert dieser galante Held zur Rettung herbei. Da die Art in einer harten Salzwasser-Umgebung aufw\u00e4chst, ist sie jeder Heraus\u00adforde\u00adrung gewachsen.",
      "desc_fr": "Ce champion de la galanterie accourt h\u00e9ro\u00efquement \u00e0 la rescousse de toutes les demoiselles poissons en d\u00e9tresse. Vivant dans les eaux les plus sal\u00e9es qui soient, c'est l\u00e0 un d\u00e9fi qu'il rel\u00e8ve avec grand plaisir.",
      "desc_ko": "\uc5fc\ud638 \ud658\uacbd\uc5d0 \uc801\uc751\ud55c \ud574\ub9c8. \uac00\ud639\ud55c \ud658\uacbd\uc5d0\uc11c \ubc88\uc2dd\ud558\uae30 \uc704\ud574, \uc218\ucef7\uc774 \uc721\uc544\uc8fc\uba38\ub2c8\ub85c \uc54c\uc744 \uc9c0\ud0a4\uba70 \ud0a4\uc6b0\uac8c \ub418\uc5c8\ub2e4.",
