      "name_ko": "\uc2e0\ud0c1\ubd88\uc751\uc5b4",
      "desc_en": "The Mol believe they are made to endure divine trials that they must overcome to prove their worth. Catching a blessed Tao bitterling was one of these trials. Seeing as they did not catch it, their god will now punish them.",
      "desc_ja": "\u795e\u8a17\u3092\u53d7\u3051\u305f\u30e2\u30eb\u65cf\u304c\u3001\u91e3\u308a\u4e0a\u3052\u3088\u3046\u3068\u6311\u307f\u7d9a\u3051\u3066\u3044\u308b\u7372\u7269\u3002\u5192\u967a\u8005\u304c\u91e3\u308a\u4e0a\u3052\u305f\u3053\u3068\u3067\u30e2\u30eb\u65cf\u306f\u795e\u7f70\u3092\u53d7\u3051\u308b\u3060\u308d\u3046",
