      "desc_de": "Nach der 7. Katastrophe befand sich dieser Meditierer f\u00fcnf Jahre im scheintoten Zustand und erwachte dann aus eigenem Antrieb urpl\u00f6tzlich wieder zum Leben. Seine Geisteskraft steht der der gr\u00f6\u00dften M\u00f6nche in nichts nach.",
      "desc_fr": "Ce sp\u00e9cimen l\u00e9gendaire de contemplateur aurait \u00e9t\u00e9 consid\u00e9r\u00e9 comme mort lors du septi\u00e8me fl\u00e9au, pour mieux revenir \u00e0 la vie cinq ans apr\u00e8s le d\u00e9sastre. Le p\u00eacheur consid\u00e8re d'ailleurs que sa conscience se serait \u00e9lev\u00e9e au-del\u00e0 de celle des simples poissons, pour faire de cette cr\u00e9ature une sorte de moine des lacs.",
