      "desc_fr": "Les \u0153ufs rouge clair de cette rare truite de Doma sont aussi pr\u00e9cieux qu'un tr\u00e9sor. Si pr\u00e9cieux qu'ils ont parfois provoqu\u00e9 des joutes entre p\u00eacheurs, colorant ainsi l'eau d'une couleur rouge sang...",
      "desc_ko": "\ub2e4\ud64d\uc0c9 \uc54c\uc740 \ubcf4\uc625\uacfc \ub9de\uba39\ub294 \uac00\uce58\uac00 \uc788\ub2e4. \ub54c\ubb38\uc5d0 \uc5b4\ubd80\ub4e4\ub07c\ub9ac \uc7c1\ud0c8\uc804\uc774 \ubc8c\uc5b4\uc838\uc11c \ub54c\ub54c\ub85c \ubb3c\uac00\uac00 \ud53c\ucc98\ub7fc \ubd89\uac8c \ubb3c\ub4e4\uae30\ub3c4 \ud55c\ub2e4\uace0 \ud55c\ub2e4.",
