      "name_ko": "\uc120\uc639\uc5b4",
      "desc_en": "Residents of the Doman mountain village of Namai claim this plump nogoi to be a hermit who, having grown weary of the monotony of his life, transformed himself into a fish, that he might pass his remaining years without care for the burdens of mankind.",
      "desc_ja": "\u30ca\u30de\u30a4\u6751\u306e\u4eba\u3005\u306b\u611b\u3055\u308c\u308b\u3001\u6e9c\u6c60\u306e\u30cc\u30b7\u3002\u751f\u304d\u98fd\u304d\u305f\u4ed9\u4eba\u304c\u9b5a\u306b\u5316\u3051\u305f\u59ff\u3068\u3082\u4f1d\u3048\u3089\u308c\u3066\u3044\u308b\u3002\u304a\u305d\u3089\u304f\u3042\u307e\u308a\u7f8e\u5473\u3057\u304f\u306a\u3044",
      "desc_de": "Einer Legende der domanischen Bergd\u00f6rfer nach hat sich einst ein Einsiedler, der der Einsamkeit \u00fcberdr\u00fcssig geworden war, in diesen plumpen Nogoi verwandelt, auf dass er endlich von der Dr\u00f6gheit seiner Existenz befreit sei.",
      "desc_fr": "Le ma\u00eetre des eaux de Namai, tr\u00e8s appr\u00e9ci\u00e9 par ses habitants. On raconte qu'il \u00e9tait jadis un ermite qui, lass\u00e9 de la vie humaine, s'est chang\u00e9 en poisson. Il n'a sans doute pas tr\u00e8s bon go\u00fbt...",
      "desc_ko": "\ub098\ub9c8\uc774 \ub9c8\uc744 \uc0ac\ub78c\ub4e4\uc5d0\uac8c \uc0ac\ub791\ubc1b\uc740 \uc800\uc218\uc9c0\uc758 \ud130\uc8fc. \uc0ac\ub294 \uac8c \uc9c8\ub9b0 \uc2e0\uc120\uc774 \ubb3c\uace0\uae30\ub85c \ubcc0\ud55c \uac83\uc774\ub77c\uace0 \uc804\ud574\uc9c4\ub2e4. \uc544\ub9c8\ub3c4 \ub9db\uc740 \ubcc4\ub85c \uc5c6\uc744 \uac83\uc774\ub2e4.",
