      "name_ko": "\ub098\uc544\ub9c8\uc758 \ucd1d\uc560",
      "desc_en": "Believed by many of the Azim Steppe's Xaela tribes to be a gift from the Dusk Mother herself, this large wavekin is oft presented as a reward in contests of mettle held during sacred festivals.",
      "desc_ja": "\u6708\u795e\u30ca\u30fc\u30de\u304c\u3001\u7279\u5225\u611b\u3057\u305f\u6c11\u306b\u9001\u3063\u305f\u3068\u3055\u308c\u308b\u9b5a\u3002\u30c9\u30bf\u30fc\u30eb\u65cf\u306e\u796d\u308a\u3067\u306f\u3001\u3053\u306e\u9b5a\u3092\u8ced\u3051\u305f\u795e\u524d\u5f13\u5c04\u8a66\u5408\u304c\u50ac\u3055\u308c\u308b",
      "desc_de": "Es ist Brauch bei den Xaela-St\u00e4mmen der Azim-Steppe, dem Sieger der heiligen Feste ein Exemplar dieses Fisches als Geschenk zu \u00fcberreichen. Besagt die Legende doch, dass dieser Fisch einst ein Geschenk der Mondg\u00f6ttin h\u00f6chstselbst an die St\u00e4mme der Azim-Steppe war.",
      "desc_fr": "Selon la l\u00e9gende, Nhaama, D\u00e9esse de la lune, aimait beaucoup ce poisson et d\u00e9cida d'en faire cadeau aux hommes. Lors de f\u00eates dotharl, ce poisson pouvait \u00eatre remport\u00e9 comme prix d'un concours de tir \u00e0 l'arc traditionnel.",
      "desc_ko": "\ub2ec\uc758 \uc2e0 \ub098\uc544\ub9c8\uac00 \ud2b9\ubcc4\ud788 \uc0ac\ub791\ud55c \uc790\uc5d0\uac8c \ubcf4\ub0c8\ub2e4\uace0 \ud558\ub294 \ubb3c\uace0\uae30. \ub3c4\ud0c8\uc871\uc758 \uc794\uce58\uc5d0\uc11c\ub294 \uc774 \ubb3c\uace0\uae30\ub97c \uac78\uace0 \uc2e0\uc804 \ud65c\uc3d8\uae30 \ub300\ud68c\uac00 \uac1c\ucd5c\ub41c\ub2e4.",
