      "desc_fr": "\u00c0 cause de ses nageoires ressemblant \u00e0 des feuilles, ce poisson est vu comme un symbole de reconversion agricole ou de grands changements dans la vie pour les tribus nomades. Les p\u00eacheurs des steppes attach\u00e9s \u00e0 la vie d'errance pr\u00e9f\u00e8rent donc \u00e9viter de l'attraper.",
