      "desc_en": "Ishgardians are known to treasure this cold-water shellfish, despite the extreme difficulty both harvesting the wavekin and opening their vice-like shells to retrieve the succulent flesh hidden within. A method of preparation popular amongst the See's nobles involves boiling the oysters to create a thin broth, and then tossing the meat to their hounds.",
