      "desc_fr": "Ce bivalve a d\u00e9velopp\u00e9 une coquille tr\u00e8s \u00e9paisse pour se prot\u00e9ger du froid. Dans la cuisine ishgardaise, on mange sa chair mais on utilise aussi son jus.",
