      "name_fr": "Poisson chatkra",
      "name_ko": "\ucc28\ud06c\ub77c \uba54\uae30",
      "desc_en": "Bemoaning her inability to open even a single chakra, a monk set off into the hills to meditate. For ten days and ten nights did she fast, until on the eleventh day, overcome with hunger, she spied a lone fish in a shallow pond. Unable to control herself, the monk lunged atop the fry and sank her teeth into its sweet, cold flesh...at which time she opened all seven chakra, achieving enlightenment everlasting.",
      "desc_ja": "\u9a5a\u304f\u307b\u3069\u5de8\u4f53\u306b\u6210\u9577\u3057\u305f\u500b\u4f53\u3002\u305d\u306e\u8089\u539a\u3001\u304b\u3064\u6fc3\u539a\u306a\u5473\u306e\u8eab\u3092\u98df\u305b\u3070\u3001\u4fee\u884c\u306b\u884c\u304d\u8a70\u307e\u3063\u305f\u50e7\u4fb6\u3055\u3048\u3001\u30c1\u30e3\u30af\u30e9\u3092\u958b\u304f\u3068\u3044\u3046",
      "desc_de": "Ein M\u00f6nch, der nicht ein einziges Chakra \u00f6ffnen konnte, ging zum Meditieren in die Berge. Zehn Tage lang fastete er, bis ihn der Hunger \u00fcbermannte, als er einen Fisch in einem Fluss in der N\u00e4he sah. Der M\u00f6nch st\u00fcrzte sich auf ihn und versenkte seine Z\u00e4hne in dem s\u00fc\u00dfen, kalten Fleisch ... wobei er alle sieben Chakren \u00f6ffnete und ewige Erleuchtung erlangte.",
      "desc_fr": "Ce poisson-chat a grandi jusqu'\u00e0 atteindre une taille im\u00adpres\u00adsion\u00adnante. Sa chair est si go\u00fbtue qu'on raconte qu'elle arrive m\u00eame \u00e0 ouvrir les chakra d'un apprenti moine ayant \u00e9chou\u00e9 dans sa formation.",
      "desc_ko": "\ub180\ub77c\uc6b8 \uc815\ub3c4\ub85c \uac70\ub300\ud558\uac8c \uc131\uc7a5\ud55c \uac1c\uccb4. \ub450\ud23c\ud558\uace0 \uc9c4\ud55c \ub9db\uc774 \ub098\ub294 \uc0b4\uc744 \uba39\uc73c\uba74, \uc218\ud589\uc758 \ubcbd\uc5d0 \ubd80\ub52a\ud78c \uc2b9\ub824\uc870\ucc28 \ucc28\ud06c\ub77c\uac00 \uc5f4\ub9b0\ub2e4\uace0 \ud55c\ub2e4.",
