      "desc_en": "The light and flaky flesh of the Othardian salmon pairs well with the aromatic rice wines of Hingashi, making the fish a highly sought-after commodity throughout the realm.",
      "desc_ja": "\u7de0\u307e\u3063\u305f\u8eab\u3068\u8102\u8eab\u304c\u30d0\u30e9\u30f3\u30b9\u3088\u304f\u3001\u30e4\u30f3\u30b5\u3067\u306f\u69d8\u3005\u306a\u6599\u7406\u306b\u7528\u3044\u3089\u308c\u3001\u7279\u306b\u9152\u306e\u4f9b\u3068\u3057\u3066\u611b\u3055\u308c\u308b\u3002\u9152\u306e\u305f\u3081\u306e\u80b4\u304b\u3001\u80b4\u306e\u305f\u3081\u306e\u9152\u304b",
      "desc_de": "Das leichte und flockige Fleisch des Othard-Lachses passt gut zu den aromatischen Reisweinen von Hingashi, weshalb der Fisch sich im Fernen Osten gro\u00dfer Beliebtheit erfreut.",
      "desc_fr": "La chair \u00e0 la fois ferme et riche de ce saumon en fait un ingr\u00e9dient pris\u00e9 de la cuisine de Yanxia, en particulier pour accompagner l'alcool. \u00c0 moins que \u00e7a ne soit l'alcool qui soit une boisson pris\u00e9e pour accompagner le saumon...",
      "desc_ko": "\ucac4\uae43\ud55c \ubd80\ubd84\uacfc \uae30\ub984\uae30 \ub3c4\ub294 \ubd80\ubd84\uc774 \uace8\uace0\ub8e8 \ubd84\ud3ec\ub418\uc5b4 \uc788\uc5b4, \uc580\uc0e4\uc5d0\uc11c\ub294 \ub2e4\uc591\ud55c \uc694\ub9ac\uc5d0 \uc0ac\uc6a9\ub418\uba70 \ud2b9\ud788 \uc220\uc548\uc8fc\ub85c \uc0ac\ub791\ubc1b\ub294\ub2e4. \uc220\uc744 \uc704\ud55c \uc548\uc8fc\uc778\uac00, \uc548\uc8fc\ub97c \uc704\ud55c \uc220\uc778\uac00.",
