      "name_ko": "\uce60\ucc44\ucc9c\uc8fc",
      "desc_en": "Supposedly spawned white as bone, local legend attributes this uncanny carp's now brilliantly colored scales to extended exposure to the waters of Prism Lake.",
      "desc_ja": "\u4e03\u8272\u306b\u8f1d\u304f\u3053\u3068\u304b\u3089\u5929\u4e3b\u3068\u547c\u3070\u308c\u308b\u30b3\u30a4\u3002\u7d14\u767d\u306e\u59ff\u3067\u751f\u307e\u308c\u305f\u5f8c\u3001\u9577\u3044\u6642\u3092\u304b\u3051\u3066\u4e03\u5f69\u6e9d\u306b\u6e80\u3061\u308b\u8679\u306e\u5149\u3092\u5bbf\u3057\u305f\u3089\u3057\u3044",
      "desc_de": "Seine in allen Farben des Regenbogens schillernden Schuppen lassen keinen Zweifel: Er ist der K\u00f6nig der Prismenfische. Bei Geburt sind diese majest\u00e4tischen Kreaturen g\u00e4nzlich wei\u00df. Die enigmatische F\u00e4rbung entsteht durch das langsame Absorbieren von Licht, das sich auf der Wasser\u00adober\u00adfl\u00e4che bricht.",
      "desc_fr": "Blanc comme neige lors de son \u00e9closion, ce poisson prendrait sa couleur iris\u00e9e apr\u00e8s avoir pass\u00e9 de longues ann\u00e9es \u00e0 nager dans les eaux du lac aux Prismes. ",
      "desc_ko": "\uc77c\uacf1 \ube5b\uae54\ub85c \ube5b\ub098\ub294, \ucc9c\uc8fc\ub77c\uace0 \ubd88\ub9ac\ub294 \uc789\uc5b4. \uc21c\ubc31\uc0c9\uc73c\ub85c \ud0dc\uc5b4\ub0ac\uc9c0\ub9cc \uc624\ub79c \uc138\uc6d4\uc5d0 \uac78\uccd0 \ubb34\uc9c0\uac1c \ub3c4\ub791\uc5d0 \ub118\uccd0\ub098\ub294 \ubb34\uc9c0\uac2f\ube5b\uc5d0 \ubb3c\ub4e0 \ub4ef\ud558\ub2e4.",
