      "name_ko": "\ud770\uc811\uc2dc\uc5b4",
      "desc_en": "A flat white fish that resembles the spotless crockery of a tea drinker indisposed to spillage. Its underside is a vivid purple\u2500hang around in taverns long enough, and you're bound to hear the tale of how the clean saucer got its bruised bottom sooner or later.",
      "desc_ja": "\u767d\u304f\u5e73\u305f\u3044\u9b5a\u4f53\u306f\u3001\u4f0f\u305b\u305f\u767d\u3044\u76bf\u306b\u55a9\u3048\u3089\u308c\u308b\u3002\u8179\u9762\u306f\u30ec\u30a4\u30af\u30e9\u30f3\u30c9\u3089\u3057\u3044\u304a\u3057\u3083\u308c\u306a\u771f\u7d2b",
      "desc_de": "Der flache K\u00f6rper dieser Rochenart wird von einer harten Schale gesch\u00fctzt, die an eine flache, umgedrehte Sch\u00fcssel erinnert. Dreht man das Tier, um einen Blick auf seinen weichen Bauch zu erhaschen, wird man von dem charakteristischen Purpur des Seenlands begr\u00fc\u00dft.",
      "desc_fr": "Le corps aplati et blanch\u00e2tre de ce poisson peut faire penser \u00e0 un dessous de tasse, ce qui lui vaut son nom. La teinte violette de ses \u00e9l\u00e9gants motifs ventraux est typique de Grand-Lac.",
      "desc_ko": "\ud558\uc597\uace0 \ub0a9\uc791\ud55c \ubab8\uccb4\ub294 \uc5ce\uc5b4 \ub193\uc740 \ud558\uc580 \uc811\uc2dc\uc5d0 \ube44\uc720\ub41c\ub2e4. \ubc30 \ucabd\uc740 \ub808\uc774\ud06c\ub79c\ub4dc \ubb3c\uace0\uae30\ub2f5\uac8c \uba4b\uc9c4 \uc790\uc8fc\uc0c9\uc774\ub2e4.",
