      "desc_de": "Mit seinen roten Augen, dem wei\u00dfen K\u00f6rper und der ungew\u00f6hnlichen R\u00fcckenflosse wirkt dieser Fisch ohnehin schon wie ein H\u00e4schen. Seine vergn\u00fcgten H\u00fcpfer \u00fcber die Wasser\u00adober\u00adfl\u00e4che tragen nur noch mehr zu diesem possierlichen Vergleich bei.",
      "desc_fr": "Avec ses \u00e9cailles blanch\u00e2tres, ses yeux rouges et ses nageoires dorsales allong\u00e9es, ce gobie peut faire penser \u00e0 un petit lapin. L'illusion est d'ailleurs renforc\u00e9e par son habitude de faire des petits sauts r\u00e9p\u00e9t\u00e9s \u00e0 la surface de l'eau.",
