      "desc_en": "These scavengers of the deep have a habit of breaking open the heads of drowned sailors with their oversized pincers, before feasting on the grey goodness within and taking up residence in the cleaned-out crania. This earns them few friends in sailing circles.",
      "desc_ja": "\u5927\u3076\u308a\u306e\u80f4\u3068\u92cf\u3092\u6301\u3064\u767d\u3044\u7532\u6bbb\u985e\u3002\u8150\u8089\u6f01\u308a\u3092\u3059\u308b\u305f\u3081\u3001\u52d5\u7269\u306e\u982d\u84cb\u9aa8\u3092\u68f2\u51e6\u306b\u3059\u308b\u3053\u3068\u304c\u3042\u308a\u3001\u4e0d\u6c17\u5473\u306a\u540d\u304c\u4ed8\u3051\u3089\u308c\u305f",
      "desc_de": "Scharfe Scheren prangen an dem schier \u00fcber\u00addimen\u00adsionierten K\u00f6rper dieser Krebsart. Einst nutzte man ihre ausgeh\u00f6hlten Schalen selbst f\u00fcr den Fischfang. Die kleineren Fische, die sich in die diversen L\u00f6cher des Panzers verirrten, gaben dem Sch\u00e4delfresserchen seinen Namen.",
