      "name_fr": "Escargot toffee",
      "name_ko": "\uc870\ub9bc\uc0ac\ud0d5 \ub2ec\ud33d\uc774",
      "desc_en": "The sweet, chewy flesh of these mollusks, flavored with aromatic herbs, is a staple of Kholusian cuisine. The culinary tome \u201cOf Ye Kholusian Kytchenne\u201d also lists recipes for the waffle wasp and the mousse louse\u2500the only known reference to either creature. This has led some scholars to doubt the book's authenticity. ",
      "desc_ja": "\u30b3\u30eb\u30b7\u30a2\u5cf6\u306e\u4f4f\u6c11\u304c\u4f5c\u308b\u7d20\u6734\u306a\u83d3\u5b50\u304b\u3089\u540d\u304c\u4ed8\u3051\u3089\u308c\u305f\u3002\u8eab\u306f\u98df\u7528\u306b\u306a\u308a\u3001\u91ce\u8349\u306e\u30cf\u30fc\u30d6\u3068\u5408\u308f\u305b\u3066\u4f9b\u3055\u308c\u308b",
      "desc_de": "Seit jeher gilt die kleine Schnecke als \u201eDelikatesse der Armen\u201c. Wer sich keine richtige S\u00fc\u00dfigkeit leisten konnte, griff eben zur Toffeeschnecke! Tats\u00e4chlich schmeckt dieser Meeresbewohner mit frischen Kr\u00e4utern ganz vorz\u00fcglich - egal, welchen Standes man ist.",
      "desc_fr": "Cet escargot a \u00e9t\u00e9 nomm\u00e9 ainsi en raison de sa ressemblance avec une petite sucrerie simple pr\u00e9par\u00e9e par les habitants de Kholusia. Sa chair est parfois consomm\u00e9e relev\u00e9e avec des herbes.",
      "desc_ko": "\ucf5c\ub8e8\uc2dc\uc544 \uc12c\uc758 \uc8fc\ubbfc\uc774 \ub9cc\ub4dc\ub294 \uc18c\ubc15\ud55c \uacfc\uc790\uc5d0\uc11c \uc774\ub984\uc744 \ub530\uc654\ub2e4. \uc0b4\uc740 \uc2dd\uc6a9\uc73c\ub85c \uc4f0\uc774\uba70, \ub4e4\uc5d0\uc11c \uc790\ub77c\ub294 \ud5c8\ube0c\ub97c \uacc1\ub4e4\uc5ec \uba39\ub294\ub2e4.",
