      "id": 27440,
      "name_en": "Watts Trout",
      "name_ja": "\u30ef\u30c3\u30c4\u30c8\u30e9\u30a6\u30c8",
      "name_de": "Watts-Forelle",
      "name_fr": "Truite de la Watts",
      "name_ko": "\uc640\uce20 \uc1a1\uc5b4",
      "desc_en": "A familiar face to all those living along Watts River, this fish has long been an important source of protein for the dwarves who dwell there. When a fisher catches a Watts trout, it is customary to call out its name\u2500the traditional reply being \u201cYou should know, you've just caught one.\u201d",
      "desc_ja": "\u5730\u5143\u306e\u540d\u7269\u9b5a\u3068\u3057\u3066\u30ef\u30c3\u30c4\u30ea\u30d0\u30fc\u6d41\u57df\u306e\u4f4f\u6c11\u306b\u89aa\u3057\u307e\u308c\u3066\u3044\u308b\u3002\u30c9\u30ef\u30fc\u30d5\u65cf\u306b\u3068\u3063\u3066\u306f\u3001\u8cb4\u91cd\u306a\u30bf\u30f3\u30d1\u30af\u6e90\u3068\u3057\u3066\u73cd\u91cd\u3055\u308c\u3066\u304d\u305f",
      "desc_de": "Eine Splitter\u00adwelt-Forellenart, die die schnellen Wasser des Watts ihr Zuhause nennt. Unter den hiesigen Zwergen gelten die schlanken Fische nicht nur als k\u00f6stliche Delikatesse, sie sind auch ihre wichtigste Proteinquelle.",
      "desc_fr": "Ce poisson est tr\u00e8s populaire chez les habitants des r\u00e9gions jouxtant la rivi\u00e8re Watts. Les Nains l'appr\u00e9cient tout par\u00adti\u00adcu\u00adli\u00e8\u00adrement car il repr\u00e9sente une pr\u00e9cieuse source de prot\u00e9ines.",
      "desc_ko": "\uc9c0\uc5ed\uc758 \uba85\ubb3c\ub85c\uc11c \uc640\uce20 \uac15 \uc720\uc5ed\uc5d0 \uc0ac\ub294 \uc8fc\ubbfc\ub4e4\uc5d0\uac8c \uce5c\uc219\ud558\ub2e4. \ub4dc\uc6cc\ud504\uc871\uc5d0\uac8c\ub294 \uadc0\uc911\ud55c \ub2e8\ubc31\uc9c8 \uacf5\uae09\uc6d0\uc774\uae30\ub3c4 \ud558\ub2e4.",
