      "name_fr": "\u0152uf de sable",
      "name_ko": "\ubaa8\ub798\uc54c",
      "desc_en": "Though it looks every ilm an egg, it is in fact a creature in its own right, capable of independent ambulation and feeding on the nutrients in the desert dew. Those that have spent many moons beneath the sands develop a curiously smoky aroma.",
      "desc_ja": "\u7802\u7363\u306e\u5375\u306b\u3082\u601d\u3048\u308b\u304c\u3001\u81ea\u5f8b\u7684\u306b\u79fb\u52d5\u3059\u308b\u59ff\u304c\u78ba\u8a8d\u3055\u308c\u3066\u3044\u308b\u3002\u71b1\u7802\u3067\u6e29\u3081\u3089\u308c\u305f\u5375\u306e\u3088\u3046\u306a\u3001\u71fb\u88fd\u306b\u4f3c\u305f\u5302\u3044\u304c\u3059\u308b",
      "desc_de": "Viele halten die Sandeier f\u00fcr buchst\u00e4bliche Eier irgendeiner W\u00fcstenkreatur. Umso gr\u00f6\u00dfer ist der Schreck, wenn die kleinen Kugeln dann pl\u00f6tzlich von selbst zu kullern beginnen und sich ihren Weg zielstrebig durch Amh Araengs D\u00fcnen bahnen.",
      "desc_fr": "Cette \u00e9trange cr\u00e9ature n'est pas un v\u00e9ritable \u0153uf, mais appartient bien \u00e0 la famille des poissons des sables. Elle a un d\u00e9licieux go\u00fbt fum\u00e9 et est l'ingr\u00e9dient parfait pour un sandwich \u00e0 l'omelette.",
      "desc_ko": "\ubaa8\ub798 \uc9d0\uc2b9\uc758 \uc54c\ucc98\ub7fc \ubcf4\uc774\uae30\ub3c4 \ud558\uc9c0\ub9cc \uc2a4\uc2a4\ub85c \uc774\ub3d9\ud558\ub294 \ubaa8\uc2b5\uc774 \ud655\uc778\ub418\uc5c8\ub2e4. \ub728\uac70\uc6b4 \ubaa8\ub798\ub85c \ub370\uc6cc\uc9c4 \ub2ec\uac40 \uac19\uc740, \ud6c8\uc81c\ud5a5 \ube44\uc2b7\ud55c \ub0c4\uc0c8\uac00 \ub09c\ub2e4.",
