      "name_fr": "Fleur d'amoureux",
      "name_ko": "\uc5f0\uc778\ud654",
      "desc_en": "A species of sea hare with pretty pink fins like the petals of a flower. However, present the apple of your eye with a posy of these creatures, and your love will surely be nipped in the bud\u2500despite all appearances, they are vicious, flesh-eating fiends.",
      "desc_ja": "\u30d2\u30ec\u72b6\u306b\u767a\u9054\u3057\u305f\u6de1\u3044\u6843\u8272\u306e\u819c\u3067\u6c34\u4e2d\u3092\u6d6e\u904a\u3059\u308b\u30a6\u30df\u30a6\u30b7\u306e\u4e00\u7a2e\u3002\u604b\u4eba\u305f\u3061\u304c\u8d08\u308a\u5408\u3046\u82b1\u306b\u55a9\u3048\u3089\u308c\u308b\u304c\u3001\u5b9f\u306f\u8089\u98df\u304b\u3064\u7370\u731b\u3067\u3042\u308b",
      "desc_de": "Wenn diese Schnecken regungslos auf Steinen hocken, sehen sie farbenfrohen Wasserlilien zum Verwechseln \u00e4hnlich. Besonders ber\u00fchmt ist der Fall eines Liebesp\u00e4rchens, das bei einem abendlichen Spaziergang ins Wasser griff, um ihre Liebe vor einer solchen Bl\u00fcte zu verk\u00fcnden. Scharfe Z\u00e4hnchen und wildes Gebaren seitens der Schnecke setzte der Romantik ein schnelles Ende.",
      "desc_fr": "Une limace aquatique \u00e9voluant gracieusement dans l'eau \u00e0 l'aide de ses membranes rose clair, semblables \u00e0 des ailerons. On la compare \u00e0 une fleur que pourraient s'offrir des amoureux, alors qu'elle est contre toute attente carnivore et plut\u00f4t agressive.",
      "desc_ko": "\uc9c0\ub290\ub7ec\ubbf8 \ud615\ud0dc\ub85c \ubc1c\ub2ec\ud55c \uc5f7\uc740 \ubd84\ud64d\ube5b \ub9c9\uc73c\ub85c \ubb3c\uc18d\uc744 \ub5a0\ub2e4\ub2c8\ub294 \uac2f\ubbfc\uc22d\ub2ec\ud33d\uc774\uc758 \uc77c\uc885. \uc5f0\uc778\ub4e4\uc774 \uc8fc\uace0 \ubc1b\ub294 \uaf43\uc5d0 \ube44\uc720\ub418\uc9c0\ub9cc, \uc2e4\uc740 \uc0ac\ub098\uc6b4 \uc721\uc2dd\ub3d9\ubb3c\uc774\ub2e4.",
