      "desc_en": "A fish with lustrous blue scales, like the light that dapples the streets of the Crystarium. None know for sure whether this is a deliberate form of camouflage, or if the unfortunate fish have been displaced into the one location where their mating displays blend into their surroundings.",
      "desc_ja": "\u9752\u304f\u6f84\u3093\u3060\u8f1d\u304d\u3092\u653e\u3064\u7f8e\u3057\u3044\u9b5a\u3002\u305d\u306e\u9c57\u306e\u8272\u5408\u3044\u306f\u3001\u30af\u30ea\u30b9\u30bf\u30ea\u30a6\u30e0\u306e\u8857\u4e26\u307f\u304c\u843d\u3068\u3059\u9752\u3044\u5149\u306b\u64ec\u614b\u3059\u308b\u305f\u3081\u306e\u3082\u306e\u3089\u3057\u3044",
      "desc_de": "Die irisierenden Schuppen dieser Fischart kommen besonders zur Geltung, wenn sie in direktem Licht schillern d\u00fcrfen. Dann scheint das ganze Tier ein blaues Glimmen von sich zu geben, das schwer an das Glitzern des Kristallturms erinnert.",
      "desc_fr": "Un poisson de toute beaut\u00e9 reconnaissable \u00e0 ses \u00e9cailles brillant d'un bleu \u00e9clatant. Il en tire d'ailleurs son nom, car certains y distinguent une ressemblance avec certaines vues de Cristarium.",
