      "desc_de": "Bei dieser Muschelart ist der Name Programm - ihre kleine Gr\u00f6\u00dfe und dunkle, gr\u00e4uliche Farbe tarnt sie perfekt als stinknormaler Kiesel, sie vor Fressfeinden wie hungrigen Kholusiern sch\u00fctzend. Zwar sind sie zu winzig, um sie nur f\u00fcr ihr Fleisch aufzuknacken, aber sie machen sich ausgezeichnet in Suppen und Eint\u00f6pfen.",
      "desc_fr": "Ces petits coquillages noirs sont tr\u00e8s souvent confondus avec des petits caillous. Malgr\u00e9 sa petite taille, ce coquillage est d\u00e9licieux en bouillon, m\u00eame si peu de gens se donnent la peine de les d\u00e9cortiquer par centaines.",
