      "desc_ja": "\u30a8\u30e1\u30e9\u30eb\u30c9\u30b0\u30ea\u30fc\u30f3\u306e\u4f53\u76ae\u3092\u6301\u3064\u9b5a\u3002\u30e6\u30fc\u30eb\u30e2\u30a2\u306e\u8cb4\u5a66\u4eba\u304c\u6301\u3064\u6247\u304c\u610f\u601d\u3092\u6301\u3063\u3066\u98db\u3073\u51fa\u3057\u305f\u59ff\u3068\u4f1d\u3048\u3089\u308c\u308b",
