      "name_ko": "\ubc14\ub79c\ubc11\ucc3d",
      "desc_en": "The name of this wavekin calls to mind the underside of a shoe, whose once-polished leather has turned dull and grey from overuse. Some would use the same simile to describe both the appearance and taste of its cured and dried flesh\u2500a delicacy in Kholusia.",
      "desc_ja": "\u9b5a\u540d\u306f\u5c65\u304d\u3064\u3076\u3057\u3066\u8272\u3042\u305b\u305f\u9774\u5e95\u306b\u55a9\u3048\u3066\u547c\u3070\u308c\u308b\u3002\u5e72\u7269\u306b\u3057\u3066\u3055\u3089\u306b\u786c\u304f\u8584\u304f\u3055\u305b\u308b\u3068\u3001\u30d3\u30b9\u30b1\u30c3\u30c8\u72b6\u306b\u306a\u308a\u7f8e\u5473",
      "desc_de": "Sowohl Form als auch Haut des Fischs erinnern an die breite Zunge gro\u00dfer S\u00e4ugetiere. Gekocht oder gegrillt l\u00e4uft man diesem Speisefisch eher selten \u00fcber den Weg, aber als gepresste, getrocknete Mahlzeit f\u00fcr zwischendurch erfreut er sich gr\u00f6\u00dfter Beliebtheit.",
      "desc_fr": "Ce poisson a la m\u00eame couleur et consistance qu'une vieille semelle de chaussure. Fait \u00e9tonnant, on peut en faire de d\u00e9licieux biscuits une fois s\u00e9ch\u00e9.",
      "desc_ko": "\uc2e0\uace0 \uc2e0\uc5b4 \ube5b\ubc14\ub79c \uc2e0\ubc1c \ubc11\ucc3d\uc5d0 \ube44\uc720\ud574 \ubd99\uc5ec\uc9c4 \uc774\ub984\uc774\ub2e4. \ub9d0\ub824\uc11c \ub354 \ub531\ub531\ud558\uace0 \uc587\uc544\uc9c0\uba74 \ubc14\uc0ad\ud55c \uacfc\uc790 \uac19\uc774 \ub9db\uc788\ub2e4.",
