      "name_ko": "\ub099\uc5fd\ud574\ub8e1",
      "desc_en": "A frond-finned creature named for its resemblance to the sunny-hued leaves of the shellfracture kelp, not for its puniness. Although, in a fight between a weedy seadragon and a strip of seaweed, a wise man might bet on the latter.",
      "desc_ja": "\u67af\u8449\u306b\u4f3c\u305f\u30d2\u30ec\u3068\u30aa\u30ec\u30f3\u30b8\u8272\u306e\u9b5a\u4f53\u3092\u6301\u3064\u3002\u4ed8\u8fd1\u306b\u5206\u5e03\u3059\u308b\u30af\u30e9\u30c3\u30af\u30b7\u30a7\u30eb\u30b1\u30eb\u30d7\u306b\u64ec\u614b\u3059\u308b\u305f\u3081\u306b\u9032\u5316\u3057\u305f\u3082\u306e\u306e\u3088\u3046\u3060",
      "desc_de": "Zahlreiche d\u00fcnne, flache Ausw\u00fcchse lassen diesen Seedrachen wie ein treibendes Tangb\u00fcschel erscheinen. Das satte Orange seines K\u00f6rpers l\u00e4sst vermuten, dass er sich an die Splitterschalen-Algen angepasst hat, um bei drohender Gefahr blitzschnell zwischen ihnen zu verschwinden.",
      "desc_fr": "Ce poisson poss\u00e8de des nageoires orange que l'on pourrait facilement confondre avec des feuilles mortes. Les scien\u00adti\u00adfi\u00adques pensent qu'il aurait gagn\u00e9 la capacit\u00e9 de se camoufler en varech au cours de son \u00e9volution.",
      "desc_ko": "\ub099\uc5fd\ucc98\ub7fc \uc0dd\uae34 \uc9c0\ub290\ub7ec\ubbf8\uc640 \uc8fc\ud669\uc0c9 \ubab8\ud1b5\uc744 \uc9c0\ub154\ub2e4. \uadfc\ucc98\uc5d0 \ubd84\ud3ec\ud558\ub294 \uae68\uc9c4 \uc870\uac1c \ubbf8\uc5ed\uc744 \ud749\ub0b4\ub0b4\uae30 \uc704\ud574 \uc9c4\ud654\ud55c \ub4ef\ud558\ub2e4.",
