      "name_fr": "Crabe Biran",
      "name_ko": "\ube44\ub780\uac8c",
      "desc_en": "These creatures normally lurk beneath the surface of the sand with only their eyes protruding, but when prey approach they burst forth, bludgeoning their victims with bulky claws before slinking back to the shadows.",
      "desc_ja": "\u666e\u6bb5\u306f\u773c\u3060\u3051\u3092\u51fa\u3057\u305f\u72b6\u614b\u3067\u7802\u306b\u6f5c\u307f\u3001\u7372\u7269\u304c\u8fd1\u3065\u3044\u3066\u304f\u308b\u3068\u592a\u3044\u92cf\u3067\u8972\u3044\u304b\u304b\u308b\u3002\u305d\u306e\u540d\u306f\u53e4\u306e\u30ed\u30f3\u30be\u65cf\u306e\u5049\u4eba\u306b\u7531\u6765",
      "desc_de": "Diese Krebstiere sind Meister ihrer harschen Umgebung. Nur wer genau hinsieht, erkennt das dunkle Augenpaar, das aus dem Sand herausragt und nach Beute Ausschau h\u00e4lt. Wagt sich ein Tierchen zu nahe, schl\u00e4gt die Biran-Krabbe blitzschnell mit ihren kr\u00e4ftigen Scheren zu und macht ein Entkommen unm\u00f6glich. Benannt ist dieser f\u00e4hige J\u00e4ger nach einem legend\u00e4ren Helden der Ronso.",
      "desc_fr": "Ce crabe a pour habitude de s'enfouir com\u00adpl\u00e8\u00adte\u00adment dans le sable en laissant d\u00e9passer uniquement ses yeux et d'attaquer les proies \u00e9ventuelles avec ses puissantes pinces. Cet excellent chasseur tire son nom d'un h\u00e9ros ronso l\u00e9gendaire.",
      "desc_ko": "\ud3c9\uc18c\uc5d0\ub294 \ub208\ub9cc \ub0b4\ub193\uc740 \ucc44\ub85c \ubaa8\ub798 \uc18d\uc5d0 \uc228\uc5b4 \uc788\ub2e4\uac00 \uc0ac\ub0e5\uac10\uc774 \ub2e4\uac00\uc624\uba74 \ucee4\ub2e4\ub780 \uc9d1\uac8c\ub85c \ub36e\uce5c\ub2e4. \uc61b \ub860\uc870\uc871 \uc704\uc778\uc5d0\uac8c\uc11c \uc720\ub798\ud55c \uc774\ub984\uc774\ub2e4.",
