      "desc_ja": "\u5f77\u5fa8\u3046\u968e\u6bb5\u4ead\u4ed8\u8fd1\u3067\u3001\u524d\u5f8c\u4e0d\u899a\u306b\u306a\u308b\u9154\u5ba2\u3068\u5171\u306b\u3086\u3063\u305f\u308a\u3068\u6cf3\u304e\u56de\u308b\u3002\u5f7c\u3089\u304b\u3089\u4e0e\u3048\u3089\u308c\u308b\u990c\u3092\u5927\u304d\u306a\u53e3\u3067\u4f59\u3055\u305a\u98df\u3079\u308b",
      "desc_de": "Der Nimmersatt bewohnt die Wasser unter dem Sternenhagel und wartet mit gierig ge\u00f6ffnetem M\u00e4ulchen darauf, dass die Stammg\u00e4ste den ein oder anderen Leckerbissen f\u00fcr ihn springen lassen. Selbst vor Fingern macht er nicht Halt, auch wenn ein Biss eher kitzelt als schmerzt.",
      "desc_fr": "Ce poisson aime nager tran\u00adquil\u00adle\u00adment \u00e0 proximit\u00e9 des Marches n\u00e9buleuses, en compagnie des ivrognes du coin. Probablement parce que ceux-ci ont pour habitude de lui donner les restes de leur panier-repas.",
      "desc_ko": "\ud5e4\ub9e4\ub294 \uacc4\ub2e8 \uc2dd\ub2f9 \uadfc\ucc98\uc5d0\uc11c \uace0\uc8fc\ub9dd\ud0dc\uac00 \ub41c \ucde8\uac1d\uacfc \ud568\uaed8 \ub290\uae0b\ud558\uac8c \uc720\uc601\ud558\ub294 \ubb3c\uace0\uae30. \uadf8\ub4e4\uc774 \uc8fc\ub294 \uba39\uc774\ub97c \ucee4\ub2e4\ub780 \uc785\uc73c\ub85c \ub0a8\uae40 \uc5c6\uc774 \ubc1b\uc544\uba39\ub294\ub2e4.",
