      "desc_de": "Der Rei\u00dfbei\u00dfer ist ein uralter Panzerfisch, der die Meere schon seit Jahrtausenden dominiert. Sein Name r\u00fchrt von dem \u00fcberaus kr\u00e4ftigen Kiefer, der Beute und Angreifer gleicherma\u00dfen in St\u00fccke bei\u00dft. Harte Schuppen sch\u00fctzen ihn dabei vor zahlreichen Gefahren und sichern ihm den Platz an der Spitze der Nahrungskette.",
      "desc_fr": "Le dunkleosteus est un ancien poisson cuirass\u00e9 qui domine les oc\u00e9ans depuis des mill\u00e9naires. Sa puissante m\u00e2choire et ses \u00e9cailles rigides le prot\u00e8gent de nombreux dangers et lui assurent une place au sommet de la cha\u00eene alimentaire.",
