      "desc_de": "Dank des stolzen Horns, das am Hinterteil dieses W\u00fcstenbewohners prangt, navigiert er die rauen Sande Amh Araengs mit erstaunlicher Leichtigkeit. Diese St\u00e4rke beeindruckte selbst die fr\u00fcheren Maliks, die ihre Kronen aus den H\u00f6rnern dieser Sandteufel fertigen lie\u00dfen.",
