      "name_fr": "Gobie argent\u00e9",
      "name_ko": "\uc7bf\ube5b\uc9f1\ub6b1\uc5b4",
      "desc_en": "The grey skipper provides a rare drop of shade in the Kingdom of Rainbows. It has its origins in the Kingdom of Voeburt and remains staunchly loyal to its former masters, refusing to engage in any way with the pixies' magicks.",
      "desc_ja": "\u5996\u7cbe\u90f7\u3067\u306f\u73cd\u3057\u3044\u5730\u5473\u306a\u4f53\u8272\u3092\u6301\u3064\u3002\u30d5\u30c3\u30d6\u30fc\u30c8\u539f\u7523\u306e\u7a2e\u3067\u3001\u4ea1\u304d\u56fd\u738b\u3078\u306e\u5fe0\u8aa0\u306e\u305f\u3081\u3001\u5996\u7cbe\u306e\u307e\u3058\u306a\u3044\u3092\u62d2\u3093\u3060\u3068\u3044\u3046",
      "desc_de": "Der Aschenskipper nimmt mit seiner fahlen Farbe eine wahre Au\u00dfenseiterrolle im ansonsten so schillernden Il Mheg ein. Zwischen bunten Pflanzen und absonderlichen Wesen vermag er es vielleicht sogar, so manchen Bet\u00f6rten aus den Illusionen der Feen zu rei\u00dfen und sie an die weitaus tristere Realit\u00e4t zu erinnern.",
      "desc_fr": "La couleur sobre de ce gobie est chose rare en Il Mheg. Cette esp\u00e8ce originaire du royaume de Voeburt resterait fid\u00e8le \u00e0 leur ancien souverain et aurait toujours refus\u00e9 tout enchantement des Pixies pour changer de couleur.",
      "desc_ko": "\uc694\uc815\uc758 \ud130\uc804\uc5d0\uc11c\ub294 \ub4dc\ubb3c\uac8c \uc218\uc218\ud55c \ube5b\uae54\uc774\ub2e4. \ud440\ubd80\ud2b8 \uc6d0\uc0b0\uc73c\ub85c, \uc8fd\uc740 \uad6d\uc655\uc5d0\uac8c \ucda9\uc131\uc744 \ub2e4\ud558\uae30 \uc704\ud574 \uc694\uc815\uc758 \ub9c8\ubc95\uc744 \uac70\ubd80\ud588\ub2e4\uace0 \ud55c\ub2e4.",
