      "desc_de": "Laut Legenden hatte der Himmel einst das strahlende Blau dieses Fisches, ehe das glei\u00dfende Licht es \u00fcberstrahlte. Die sternf\u00f6rmigen Muster, die seine Augen zieren, stellen ebenfalls eine schmerzliche Erinnerung an das verlorene Firmament dar.",
