      "desc_ja": "\u3068\u3042\u308b\u30f3\u30fb\u30e2\u30a5\u65cf\u304c\u8a9e\u308b\u3068\u3053\u308d\u306b\u3088\u308c\u3070\u3001\u3053\u306e\u9b5a\u306f\u5143\u30d4\u30af\u30b7\u30fc\u3068\u306e\u3053\u3068\u3002\u6e56\u3067\u6cf3\u3050\u305f\u3081\u9b5a\u306b\u5316\u3051\u305f\u3082\u306e\u306e\u3001\u5143\u306b\u623b\u308c\u306a\u304f\u306a\u3063\u305f\u3089\u3057\u3044",
      "desc_de": "Die Nu Mou erz\u00e4hlen sich, dass diese Fische einst Pixies waren, die sich ins Wasser wagten und nicht wieder herausfanden. Ihre Fl\u00fcgel verwandelten sich zu Flossen, ihre K\u00f6rper wurden schuppig. Doch auch wenn man sie an Land zieht, ist eine R\u00fcckverwandlung ausgeschlossen und ihr Dasein als Pixies f\u00fcr immer verloren.",
      "desc_fr": "Selon les l\u00e9gendes nu mou, ce poisson serait en fait une Pixie qui aurait finie par se transformer en poisson \u00e0 force de barboter dans l'eau. Il semblerait que certains aient essay\u00e9 de le faire se muer de nouveau en le faisant sortir de l'eau, mais sans succ\u00e8s.",
