      "desc_en": "There was once a blacksmith who forged for the high houses of Eulmore. Unlike his steel, the man was quick to temper. None know for certain what drove him to murder his masters, but he and his bloody hammer were thrown into the ocean, to be reborn as this very wavekin.",
      "desc_ja": "\u71b1\u305b\u3089\u308c\u305f\u91d1\u69cc\u306e\u3088\u3046\u306a\u982d\u3068\u4f53\u8272\u304c\u7279\u5fb4\u306e\u9bab\u3002\u30e6\u30fc\u30eb\u30e2\u30a2\u4e0a\u5c64\u304b\u3089\u843d\u3068\u3055\u308c\u305f\u935b\u51b6\u5e2b\u304c\u3001\u6012\u308a\u306e\u3042\u307e\u308a\u59ff\u3092\u5909\u3048\u305f\u3068\u4e91\u308f\u308c\u308b",
      "desc_de": "Die glutrote Farbe der rauen Haut l\u00e4sst diesen Hai wie einen im Schmiedefeuer erhitzten Hammer erscheinen. In Wrackstadt munkelt man, dass das erste Exemplar dieser Art geboren wurde, als ein erz\u00fcrnter Schmied sein Werkzeug von Eulmores Balkons hinab ins Meer geworfen hat.",
      "desc_fr": "Ce requin est connu pour sa t\u00eate qui rappelle une masse chauff\u00e9e \u00e0 blanc et sa couleur rouge\u00e2tre. On raconte que c'\u00e9tait autrefois un forgeron tomb\u00e9 des hauteurs d'Eulmore que la col\u00e8re a transform\u00e9.",
