      "desc_en": "These frogs are fawned over by the Fuath, who think of them as adorable infants. Some are even known to craft miniature top hats for their unwitting charges.",
      "desc_ja": "\u9bae\u3084\u304b\u306a\u30b0\u30ea\u30fc\u30f3\u306e\u8eab\u4f53\u306b\u3001\u8840\u306e\u3088\u3046\u306b\u8d64\u3044\u77b3\u304c\u6620\u3048\u308b\u3002\u30d5\u30fc\u30a2\u65cf\u304b\u3089\u306f\u3001\u5f1f\u5206\u3068\u3057\u3066\u611b\u3055\u308c\u3066\u3084\u307e\u306a\u3044\u5b58\u5728\u3089\u3057\u3044",
      "desc_de": "Aus dem saftigen Gr\u00fcn seiner Haut strahlen zwei rote Augen heraus - wie Blutstropfen auf frischem Laub. Den Fuath sagt man eine besondere, beinahe br\u00fcderliche Verbindung zu diesem Frosch nach. So grausam ihre Streiche auch sein k\u00f6nnen, diesen Gesch\u00f6pfen sieht man sie niemals Leid antun.",
      "desc_fr": "Ce batracien poss\u00e8de un corps d'un vert \u00e9clatant qui contraste avec ses yeux d'un rouge tr\u00e8s vif. Les Fuath la consid\u00e8rent comme une pr\u00e9sence famili\u00e8re.",
      "desc_ko": "\uc120\uba85\ud55c \ub179\uc0c9 \ubab8\uc5d0 \ud53c\ucc98\ub7fc \ubd89\uc740 \ub208\ub3d9\uc790\uac00 \uc120\uba85\ud558\uac8c \ube5b\ub09c\ub2e4. \ud478\uc544\uc871\ub4e4\uc5d0\uac8c\ub294 \ud615\uc81c\ub85c\uc11c \uc0ac\ub791\ubc1b\uc544 \ub9c8\ub545\ud55c \uc874\uc7ac\uc778 \ub4ef\ud558\ub2e4.",
