      "name_fr": "Pipira jaune",
      "name_ko": "\ub178\ub780 \ud53c\ud53c\ub77c",
      "desc_en": "The yellow pipira appears a docile creature, drifting leisurely in warm waters. However, its teeth are coated with a paralyzing toxin, with which it immobilizes its prey before eating them alive. Appearances can be deceptive.",
      "desc_ja": "\u30d4\u30d4\u30e9\u3067\u306f\u5927\u4eba\u3057\u3044\u7a2e\u3060\u304c\u3001\u5c0f\u3076\u308a\u306e\u6b6f\u306b\u9ebb\u75fa\u6027\u306e\u6bd2\u3092\u6301\u3064\u3002\u7372\u7269\u306e\u52d5\u304d\u304c\u920d\u304f\u306a\u3063\u305f\u3068\u3053\u308d\u3092\u6355\u98df\u3059\u308b\u982d\u8133\u6d3e\u306e\u30cf\u30f3\u30bf\u30fc",
      "desc_de": "Im Grunde sind die Pipira keine aggressiven Fische, aber auf der Hut sollte man vor ihnen dennoch sein. In ihren kleinen, messerscharfen Z\u00e4hnen schlummert ein derart potentes Gift, dass ein einziger Biss bereits das ganze Nervensystem lahmzulegen vermag. Ist ihre Beute erst einmal so bet\u00e4ubt, steht dem gierigen Fressen nichts mehr im Weg.",
      "desc_fr": "M\u00eame si ce pipira est relativement peu agressif par rapport \u00e0 ses cong\u00e9n\u00e8res, ses dents renferment un venin paralysant. C'est donc un chasseur rus\u00e9 qui engourdit ses proies avant de les d\u00e9vorer.",
      "desc_ko": "\ud53c\ud53c\ub77c\uce58\uace0\ub294 \uc58c\uc804\ud55c \uc885\uc774\uc9c0\ub9cc, \uc791\uc740 \uc774\ube68\uc5d0 \ub9c8\ube44\uc131 \ub3c5\uc774 \uc788\ub2e4. \uc0ac\ub0e5\uac10\uc758 \uc6c0\uc9c1\uc784\uc774 \ub454\ud574\uc9c0\uae38 \uae30\ub2e4\ub838\ub2e4 \uc7a1\uc544\uba39\ub294 \ub450\ub1cc\ud30c \uc0ac\ub0e5\uafbc.",
