      "name_fr": "Carpe de Solide Serment",
      "name_ko": "\uc11c\uc57d\uc5b4",
      "desc_en": "This wavekin resides in the waters of Woven Oath, and would be utterly unremarkable were it not for the role it plays in the rites of the Children of the Everlasting Dark, who burn it black over a bonfire before consuming the ashen remains.",
      "desc_ja": "\u5b9f\u306b\u5e73\u51e1\u306a\u9b5a\u3002\u30a6\u30a9\u30fc\u30f4\u30f3\u30aa\u30a6\u30b9\u4ed8\u8fd1\u306b\u68f2\u606f\u3057\u3066\u3044\u305f\u3070\u304b\u308a\u306b\u3001\u300c\u5e38\u95c7\u306e\u611b\u3057\u5b50\u300d\u306e\u5100\u5f0f\u3067\u70ad\u306b\u306a\u308b\u307e\u3067\u713c\u304b\u308c\u3066\u98df\u3079\u3089\u308c\u308b\u3068\u3044\u3046",
      "desc_de": "An sich ist der Eidkarpfen ein recht gew\u00f6hnlicher Fisch. Erst die Kinder der Ewigen Dunkelheit in Eidbund machen ihn mit ungew\u00f6hnlichen Kochmethoden zu einer Kuriosit\u00e4t. Sie grillen das arme Tier, bis es g\u00e4nzlich zu schwarzem Staub verkohlt ist, den sie schlie\u00dflich in einer bizarren Zeremonie zu sich nehmen. Mit etwas Salz und Butter w\u00e4re der Karpfen sicherlich bek\u00f6mmlicher.",
      "desc_fr": "Comme ce poisson plat vit \u00e0 Solide Serment, il est souvent p\u00each\u00e9 par les enfants des T\u00e9n\u00e8bres \u00e9ternelles, qui le font griller jusqu'\u00e0 ce qu'il soit carbonis\u00e9 pour le manger lors de leurs rites.",
      "desc_ko": "\uc2e4\ub85c \ud3c9\ubc94\ud55c \ubb3c\uace0\uae30. \ub9fa\uc5b4\uc9c4 \uc11c\uc57d \ubd80\uadfc\uc5d0\uc11c \uc11c\uc2dd\ud558\ub294 \ud0d3\uc5d0 '\ub298\uc5b4\ub460\uc758 \ucd1d\uc544'\ub4e4\uc740 \uc758\uc2dd\uc5d0\uc11c \uc774 \ubb3c\uace0\uae30\ub97c \uac70\uc758 \uc22f\uc774 \ub420 \ub54c\uae4c\uc9c0 \uad6c\uc6cc\uc11c \uba39\ub294\ub2e4\uace0 \ud55c\ub2e4.",
