      "name_ko": "\ub300\uc655\uac70\uc6b8\uc870\uac1c",
      "desc_en": "These clams, whose inner nacre can be polished to a mirror sheen, were common throughout the Kingdom of Voeburt. Looking glasses crafted from their shells were fashionable with the ladies of the Voeburtite court before its fall.",
      "desc_ja": "\u53e4\u304f\u3088\u308a\u30d5\u30c3\u30d6\u30fc\u30c8\u738b\u56fd\u9818\u306b\u5206\u5e03\u3059\u308b\u8c9d\u3002\u8eab\u306f\u5f37\u58ee\u52b9\u679c\u304c\u9ad8\u304f\u3001\u305d\u306e\u5802\u3005\u3068\u3057\u305f\u5927\u304d\u3055\u3068\u7dd1\u8272\u306e\u5916\u6bbb\u304b\u3089\u738b\u3068\u8b83\u3048\u3089\u308c\u547c\u3070\u308c\u308b",
      "desc_de": "Schon im alten K\u00f6nigreich von Voeburt sch\u00e4tzte man diese Muschel f\u00fcr ihre h\u00fcbsche Schale, die sogar das K\u00f6nigshaus mit ihrem schillernden Gr\u00fcn regelrecht verzauberte. Des Weiteren sagte man ihr kraftspendende Wirkungen nach und oft servierte man ihr schmackhaftes Fleisch an Krankenbetten, um den Genesungsprozess zu unterst\u00fctzen.",
      "desc_fr": "Ce bivalve \u00e0 la chair robuste se rencontre dans les eaux de Voeburt depuis des temps anciens. Sa taille imposante et sa coquille de couleur verte lui ont valu le surnom de \u201croi\u201d.",
