      "desc_de": "Die kleinen, braunen Punkte auf den Schuppen dieser Fische erinnern an den Pelz von Gro\u00dfkatzen. Daher \u00fcberrascht es nicht, dass die meisten Bewohner der ersten Splitter\u00adwelt diese Tiere schlicht und einfach als \u201eRonsofische\u201c kennen.",
