      "desc_de": "Der Nachtbarsch ist keine einheimische Spezies des Gro\u00dfen Walds. Er wurde von den Untertanen der Nacht eingef\u00fchrt, f\u00fcr die der Fisch ein wichtiger Aspekt ihrer K\u00fcche ist. Jetzt vermehrt er sich leider schier ungebremst und bedroht damit zahlreiche andere Tierarten, die Rak'tika ihr Zuhause nennen. Eifriges Fangen ist ausdr\u00fccklich erw\u00fcnscht!",
      "desc_fr": "Cette esp\u00e8ce a \u00e9t\u00e9 introduite par le peuple de la Nuit \u00e0 des fins alimentaires. Comme il se reproduit tr\u00e8s rapidement, certains craignent qu'il trouble l'\u00e9quilibre naturel de la faune foresti\u00e8re.",
