      "name_ko": "\uc5d0\ub9ac\uc635\uc2a4",
      "desc_en": "In ancient Ronka, the eryops was revered as a sacred animal, believing it to be the bringer of prosperity to one's children. Those whose offspring have been bitten by these beasts for the crime of swimming in their waters may beg to differ.",
