      "desc_de": "Spreizt der Nabaath-Manta die Flossen an seinen Seiten, vermag er es, mit faszinierender Eleganz durch die Bernsteinh\u00fcgel zu gleiten. Unter den Adelsfamilien von Nabaath Areng war die Jagd auf diese kuriosen Segler ein beliebter Zeitvertreib.",
      "desc_fr": "Cette raie a d\u00e9velopp\u00e9 ses nageoires pectorales qui lui servent d'ailes, lui permettant de planer au-dessus des collines d'Ambre. Elle \u00e9tait autrefois chass\u00e9e par les nobles de Nabaath Areng.",
