      "name_ko": "\uc740\ubb18\uc5b4",
      "desc_en": "A small, silvery fish with feline whiskers that is oft seen basking on the riverbed like a cat resting in the sun. It is possessed of catlike reflexes too, pouncing on passing prey.",
      "desc_ja": "\u9280\u8272\u306e\u9b5a\u4f53\u3068\u53e3\u5143\u306e\u30d2\u30b2\u3092\u6301\u3061\u3001\u5ddd\u5e95\u3067\u3058\u3063\u3068\u52d5\u304b\u305a\u306b\u3044\u308b\u3055\u307e\u306f\u9280\u6bdb\u306e\u30cd\u30b3\u306e\u3088\u3046\u3002\u990c\u306e\u9b5a\u3092\u72d9\u3046\u3068\u304d\u306f\u4fca\u654f\u306b\u52d5\u304f",
      "desc_de": "Die Barteln dieses Welses sind so zahlreich und fein, dass sie den Schnurrhaaren einer echten Katze zum Verwechseln \u00e4hnlich sind. Oft verharren sie reglos auf dem Grund eines Flusses und warten auf Beute, was den Vergleich noch deutlicher hervorhebt.",
      "desc_fr": "Avec ses \u00e9cailles gris argent\u00e9 et ses moustaches blanches, ce poisson ressemble tout \u00e0 fait \u00e0 un chat guettant sa proie lorsqu'il se niche au fond de la rivi\u00e8re pour chasser. Il est cependant tr\u00e8s vif lorsqu'il traque une cible.",
