      "name_fr": "Thazard de La Temp\u00eate",
      "name_ko": "\ud751\ud48d\uc5b4",
      "desc_en": "The flesh of this migratory wavekin is a staple food of the Ondo. Stormfish travel in schools many thousands strong, and when they swarm in circles, they can create great whirlpools upon the surface of the sea. Superstitious sailors refuse to sup upon their meat.",
      "desc_ja": "\u9ed2\u98a8\u6d77\u3092\u56de\u904a\u3059\u308b\u9b5a\u3067\u3001\u30aa\u30f3\u30c9\u65cf\u305f\u3061\u306e\u4e3b\u98df\u306e\u3072\u3068\u3064\u3002\u3068\u304d\u306b\u7fa4\u308c\u3067\u6d77\u9762\u8fd1\u304f\u306b\u6e26\u3092\u4f5c\u308b\u305f\u3081\u3001\u8239\u4e57\u308a\u306b\u306f\u4e0d\u5409\u306e\u8c61\u5fb4\u3068\u3055\u308c\u308b",
      "desc_de": "Wie ihr Name schon verr\u00e4t, ist diese Makrele im Meer der Schwarzen Winde zuhause. W\u00e4hrend die Ondo sie als k\u00f6stliche Zutat sch\u00e4tzen, die in ihrer K\u00fcche eine zentrale Rolle spielt, betrachten Seeleute sie als ein schlechtes Omen. Dieser Aberglauben l\u00e4sst sich auf die kleinen Strudel zur\u00fcckf\u00fchren, die Makrelenschw\u00e4rme an die Meeresoberfl\u00e4che zu zaubern verm\u00f6gen.",
      "desc_fr": "Ce poisson qui migre \u00e0 travers la mer des Vents noirs est l'un des aliments principaux des Ondos. Comme il cr\u00e9\u00e9 parfois des tourbillons en s'approchant des c\u00f4tes en banc, les marins le voient comme un signe de malchance.",
