      "desc_ja": "\u5927\u304d\u304f\u81a8\u3089\u3093\u3060\u8179\u90e8\u3092\u6301\u3061\u3001\u305d\u306e\u9b5a\u4f53\u304b\u3089\u624b\u65a7\u306b\u55a9\u3048\u3089\u308c\u308b\u3002\u30c9\u30ef\u30fc\u30d5\u305f\u3061\u304b\u3089\u306f\u935b\u51b6\u4ed5\u4e8b\u306b\u52a0\u8b77\u306e\u3042\u308b\u9b5a\u3068\u3057\u3066\u89aa\u3057\u307e\u308c\u3066\u3044\u308b",
