      "desc_de": "Dank ihres warmen Gelbtons verschmilzt diese Anglerart f\u00f6rmlich mit den bernsteinfarbenen Sanden, die sie ihr Zuhause nennen. Um in dieser harschen, trockenen Umgebung zu \u00fcberleben, k\u00f6nnen sie gro\u00dfe Mengen an Fl\u00fcssigkeit, Fetten und N\u00e4hrstoffen in ihrer Leber speichern und so sehr lange ohne Nahrung auskommen.",
      "desc_fr": "Gr\u00e2ce \u00e0 sa couleur jaune tr\u00e8s vive, cette baudroie se fond dans les sables pour \u00e9chapper \u00e0 ses pr\u00e9dateurs, et survit \u00e0 l'aide des r\u00e9serves de nourriture dans son foie.",
