      "desc_en": "The fang-like serrations along its shell lend this mollusk a menacing appearance, but it is in fact a filter feeder whose jaws close but sluggishly. Not to say that a man-eater clam could not do the deed, just that said man would have to be deep in his cups at the time.",
      "desc_ja": "\u7259\u306b\u4f3c\u305f\u6bbb\u3092\u6301\u3061\u3001\u305d\u306e\u6050\u308d\u3057\u3052\u306a\u5916\u898b\u3086\u3048\u306b\u4eba\u98df\u8c9d\u3068\u547c\u3070\u308c\u308b\u3002\u3060\u304c\u3001\u8c9d\u306e\u9589\u3058\u65b9\u306f\u7de9\u6162\u3067\u3001\u4eba\u3092\u8972\u3046\u3053\u3068\u306f\u7686\u7121",
      "desc_de": "Ihre gezackte, angsteinfl\u00f6\u00dfende Schale ist der Grund f\u00fcr ihren schaurigen Namen. Tats\u00e4chlich macht sie den Eindruck, als k\u00f6nnte sie einem Flossenlosen m\u00fchelos die Hand abbei\u00dfen, sollte er ihr zu nahe kommen. Letztlich ist dies aber nichts weiter als Seemannsgarn und m\u00f6glicherweise ein kleiner Scherz der Ondo.",
      "desc_fr": "La rumeur voudrait que cette palourde raffolle de la chair fra\u00eeche, et que ses dents pointues lui permettent de d\u00e9vorer les pauvres nageurs qui croisent son chemin. En r\u00e9alit\u00e9, elle est ex\u00adtr\u00ea\u00adme\u00adment lente et n'attaque jamais les humains.",
