      "desc_en": "Though physically similar to the spiders who walk on land, this creature is of an entirely unrelated order. The majority of its internal organs, including its heart and gills, are situated in its spindly legs, the body serving primarily as a nexus through which the vital fluids flow.",
      "desc_ja": "\u9678\u751f\u306e\u30af\u30e2\u306b\u4f3c\u308b\u304c\u3001\u8fd1\u7e01\u985e\u3067\u306f\u306a\u3044\u3002\u4f53\u5185\u6d3b\u52d5\u306e\u591a\u304f\u3092\u811a\u306e\u4e2d\u3067\u884c\u3044\u3001\u547c\u5438\u5668\u5b98\u3084\u5fc3\u81d3\u3059\u3089\u811a\u306e\u4e00\u90e8\u306b\u3042\u308b\u3068\u3044\u3046",
