      "desc_ja": "\u6df1\u6d77\u306b\u68f2\u606f\u3059\u308b\u6697\u7d2b\u8272\u306e\u73ca\u745a\u3002\u5730\u4e0a\u3067\u306f\u4f1d\u8aac\u306e\u73ca\u745a\u3068\u4e91\u308f\u308c\u3001\u7a00\u306b\u6253\u3061\u4e0a\u304c\u308b\u3082\u306e\u304c\u738b\u4faf\u306b\u732e\u4e0a\u3055\u308c\u3066\u304d\u305f",
      "desc_de": "Eine in der Tiefsee vorkommende Korallenart, die durch ihren dunkelvioletten Farbton besticht. F\u00fcr die Flossenlosen ist sie die Grundlage diverser Sagen und Legenden und so kostbar, dass jeder Fund als Geschenk an das ein oder andere K\u00f6nigshaus endete.",
