      "desc_de": "Mit ihren langen Scheren erklimmt diese uralte Garnelenart auch die steilsten Felsen, um dort auf Beute zu lauern. Sie sind zwar eng mit den Hummern verwandt, aber ihre schlanken K\u00f6rper sind auf den enormen Druck der Tiefsee ausgelegt. Feinschmecker sch\u00e4tzen ihr zartes Fleisch als seltenen Genuss.",
