      "desc_de": "Dieser massive Oktopus ist der Schrecken aller Seeleute, die sich nach Tempest wagen. Sein Ruf ist aber g\u00e4nzlich zu Unrecht - tats\u00e4chlich ist dieses tiefblaue Weichtier \u00fcber alle Ma\u00dfen gutm\u00fctig und begegnet Zweibeinern mit harmloser Neugier. Tats\u00e4chlich ist das Absondern seines tinten\u00e4hnlichen Sekrets wohl eine Form des Gru\u00dfes.",
      "desc_fr": "La simple \u00e9vocation de ce poulpe \u00e0 l'apparence diabolique donne des frissons aux navigateurs, alors que lui les aime tellement qu'il agite ses tentacules \u00e0 chacun de leurs passages pour les saluer.",
