      "name_ko": "\ud5e4\ub178\ub450\uc2a4",
      "desc_en": "A type of primordial turtle with a wide, flat shell. Its name means \u201cone tooth\u201d in an ancient tongue, in reference to the single molar in each corner of its mouth. That, along with its wrinkled skin, has led some to nickname it the \u201cOld Man of the Sea.\u201d",
      "desc_ja": "\u6a2a\u306b\u5e83\u304c\u3063\u305f\u6241\u5e73\u306a\u8eab\u4f53\u3092\u6301\u3064\u4e80\u306b\u4f3c\u305f\u53e4\u4ee3\u7363\u3002\u540d\u524d\u306f\u300c\u5358\u4e00\u306e\u6b6f\u300d\u306e\u610f\u5473\u3067\u3001\u4e0a\u4e0b\u4e21\u5074\u306b\u4e00\u672c\u305a\u3064\u306e\u6b6f\u3092\u6301\u3064",
      "desc_de": "Man sieht dieser Kreatur an, dass sie schon unz\u00e4hlige Jahrhunderte alt ist. Ihr K\u00f6rper erinnert an eine Schildkr\u00f6te mit flachen, f\u00e4cherartigen Ausw\u00fcchsen an ihrem Panzer. Der Name Hedonus bedeutet \u201eEinzahn\u201c und tats\u00e4chlich hat das Tier lediglich einen einzigen Zahn auf jeder Seite ihres Kiefers.",
