      "desc_en": "Some scholars say that the large, bubble-like bags under its eyes are this shortsighted wavekin's way to make predators believe it sees more than it does. Others insist that it is merely sleep-deprived.",
      "desc_ja": "\u76ee\u5143\u306e\u6ce1\u306e\u3088\u3046\u306a\u767d\u3044\u888b\u306f\u3001\u4e00\u898b\u3057\u3066\u5927\u304d\u306a\u773c\u7403\u306e\u3088\u3046\u3002\u672c\u7269\u306e\u773c\u306f\u305d\u306e\u4e0a\u306b\u4ed8\u3044\u3066\u3044\u308b\u304c\u3001\u5f8c\u65b9\u3078\u306e\u8996\u754c\u306f\u72ed\u3044",
      "desc_de": "Von Weitem k\u00f6nnte man die riesigen S\u00e4cke an den Kiemen dieses kuriosen Fisches durchaus f\u00fcr seine Augen halten. In Wahrheit sieht dieser Wasserbewohner aber ver\u00adgleichs\u00adwe\u00adise schlecht, denn seine eigentlichen Augen sind klein und sitzen auf besagten S\u00e4cken, sein Sichtfeld somit enorm beschr\u00e4nkend.",
      "desc_fr": "On pourrait croire que les deux grosses boules blanches situ\u00e9es sur les c\u00f4t\u00e9s de la t\u00eate de ce poisson sont ses yeux, mais ceux-ci sont en r\u00e9alit\u00e9 plac\u00e9s au-dessus, ce qui lui procure un champ de vision assez restreint.",
