      "desc_fr": "Ce poisson vit uniquement dans les cours d'eau des grottes obscures, et ses yeux sont enti\u00e8rement couverts d'\u00e9cailles qui plongent sa vision dans le noir en permanence. Pour cette raison, il est v\u00e9n\u00e9r\u00e9 par les enfants des T\u00e9n\u00e8bres \u00e9ternelles.",
