      "desc_de": "Dieser Fisch ist so friedfertig, man kann ohne Weiteres neben ihm her schwimmen und es k\u00fcmmert ihn nicht im Geringsten. In seltensten F\u00e4llen erregt eine zu rasche Bewegung allerdings sein Gem\u00fct und er nutzt seine harte, breite Schwanzflosse, um dem \u00dcbelt\u00e4ter einen schmerzhaften Schlag zu verpassen. Das mag auch der Grund f\u00fcr seinen Namen sein.",
