      "name_fr": "Fl\u00e9au des Ondos",
      "name_ko": "\uc628\ub3c4\uc758 \uc219\uc801",
      "desc_en": "Easily identified by its bright blue skin, these sharks have long brought terror to the seabed settlements of the Ondo. Only those who have bested the blue bane in single combat are allowed to call themselves true warriors.",
      "desc_ja": "\u9bae\u3084\u304b\u306a\u9752\u3044\u4f53\u76ae\u304c\u7279\u5fb4\u306e\u9bab\u3002\u30aa\u30f3\u30c9\u65cf\u306e\u9593\u3067\u306f\u3001\u3053\u306e\u9bab\u306b\u6226\u3044\u3092\u6311\u3080\u3053\u3068\u304c\u6226\u58eb\u306e\u8a66\u7df4\u3068\u3055\u308c\u3066\u3044\u308b",
      "desc_de": "Seine leuchtend blaue Haut macht diesen Hai so sch\u00f6n, wie er schrecklich ist. Messerscharfe Z\u00e4hne rei\u00dfen seine Beute in einem einzigen Wimpernschlag auseinander. Unter den Ondo ist es \u00fcblich, seinen Mut und sein Geschick als Krieger im Kampf gegen dieses Unget\u00fcm zu beweisen.",
      "desc_fr": "Se perdre dans la contemplation de ce requin au bleu resplendissant est tr\u00e8s dangereux, car c'est un pr\u00e9dateur sanguinaire. En tuer un est une \u00e9preuve obligatoire pour tout chasseur ondo qui se respecte.",
      "desc_ko": "\uc120\uba85\ud55c \ud30c\ub780\uc0c9 \ubab8\uc774 \ud2b9\uc9d5\uc778 \uc0c1\uc5b4. \uc628\ub3c4\uc871 \uc0ac\uc774\uc5d0\uc11c\ub294 \uc774 \uc0c1\uc5b4\uc5d0\uac8c \uc2f8\uc6c0\uc744 \uac70\ub294 \uac83\uc774 \uc804\uc0ac\uc758 \uc2dc\ub828\uc774\ub77c\uace0 \ud55c\ub2e4.",
