      "name_ko": "\uc6b0\ubb34\ubb38\uc5b4",
      "desc_en": "This deep-sea octopus is well-known, and well loved, for its plump and adorable form. However, when lifted from the water, it is unable to maintain its shape against the force of gravity and falls as flat as a pancake.",
      "desc_ja": "\u6df1\u6d77\u306b\u68f2\u606f\u3059\u308b\u5c0f\u3055\u306a\u30bf\u30b3\u3002\u3068\u3066\u3082\u611b\u3089\u3057\u3044\u59ff\u3092\u3057\u3066\u3044\u308b\u304c\u3001\u6c34\u304b\u3089\u63da\u3052\u308b\u3068\u81ea\u91cd\u3092\u652f\u3048\u304d\u308c\u305a\u3001\u6f70\u308c\u3066\u3057\u307e\u3046",
      "desc_de": "In den dunklen Wassern der Tiefsee lebt ein kleiner Oktopus, der so possierlich anzusehen ist, dass er Ondo und Flossenlosen gleicherma\u00dfen das Herz zu rauben vermag. Fehlt ihm der Druck der Tiefe, f\u00e4llt der K\u00f6rper dieses kleinen Kerls allerdings in sich zusammen und gibt ein \u00e4u\u00dferst be\u00admit\u00adleidens\u00adwertes Bild ab.",
      "desc_fr": "Ce petit poulpe vivant dans les profondeurs marines ressemble tellement \u00e0 une cr\u00eape que certains cuisiniers se sont demand\u00e9s s'ils ne jetaient pas ce d\u00e9licieux mets \u00e0 la mer pendant leur sommeil.",
