      "name_ko": "\uc628\ub3c4\uc758 \uc791\uc0b4",
      "desc_en": "Named for its resemblance to the fish people's hunting implements. It is unknown whether the similarity is merely incidental, or if the original Ondo took inspiration from the shark's unusual shape when crafting their weapons.",
      "desc_ja": "\u92ed\u304f\u9577\u3044\u9b5a\u4f53\u3092\u30aa\u30f3\u30c9\u65cf\u306e\u929b\u306b\u55a9\u3048\u3089\u308c\u308b\u3002\u5b9f\u969b\u306b\u30aa\u30f3\u30c9\u65cf\u306f\u3053\u306e\u9bab\u304b\u3089\u30d2\u30f3\u30c8\u3092\u5f97\u3066\u3001\u53e4\u3044\u6642\u4ee3\u306b\u929b\u3092\u4f5c\u3063\u305f\u306e\u3060\u3068\u3044\u3046",
      "desc_de": "Der Name dieses schlanken, wendigen Fischs kommt nicht von irgendwoher. Vor langer Zeit inspirierte seine schmale Form und seine Schnelligkeit die ersten Harpunen, mit denen die Ondo auch heute noch der Tradition gem\u00e4\u00df auf Jagd gehen.",
      "desc_fr": "Le nom de ce requin provient de l'\u00e9pieu qui forme son nez, souvent confondu avec un harpon d'Ondo. Certains pr\u00e9tendent m\u00eame que le premier aurait inspir\u00e9 la fabrication du second dans les temps anciens.",
      "desc_ko": "\uc608\ub9ac\ud558\uace0 \uae34 \ubab8 \ub54c\ubb38\uc5d0 \uc628\ub3c4\uc871\uc758 \uc791\uc0b4\uc5d0 \ube57\ub300\uc5b4\uc9c4\ub2e4. \uc2e4\uc81c\ub85c \uc628\ub3c4\uc871\uc740 \uc61b\ub0a0\uc5d0 \uc774 \uc0c1\uc5b4\uc5d0\uc11c \ucc29\uc548\ud558\uc5ec \uc791\uc0b4\uc744 \ub9cc\ub4e4\uc5c8\ub2e4\uace0 \ud55c\ub2e4.",
