      "name_fr": "Aapoak",
      "name_ko": "\uc544\ud3ec\uc544\ud06c",
      "desc_en": "A rare, iridescent cousin of the nautilus. Fisherfolk consider it an omen of future fortune to find one in their nets\u2014and not only because goldsmiths pay a high price for their scooped-out shells.",
      "desc_ja": "\u8679\u306e\u3088\u3046\u306a\u591a\u8272\u306e\u5b9d\u77f3\u5316\u3057\u305f\u5916\u6bbb\u3092\u6301\u3064\u3002\u3053\u306e\u7a2e\u304c\u7db2\u306b\u639b\u304b\u3063\u305f\u6f01\u5e2b\u306b\u306f\u6c38\u9060\u306e\u5bcc\u304c\u7d04\u675f\u3055\u308c\u308b\u3068\u3044\u3046",
      "desc_de": "Die regenbogenfarbene, schillernde Schale dieses Kopff\u00fc\u00dfers ist nicht nur f\u00fcr ihre atemberaubende Sch\u00f6nheit bekannt, sondern auch f\u00fcr ihre notorische Seltenheit. Laut altem Aberglauben werden Fischer, die einen Nautilus-Ammonit in ihren Netzen finden, mit ewigw\u00e4hrendem Reichtum gesegnet.",
      "desc_fr": "Ce mollusque \u00e0 la coquille tr\u00e8s color\u00e9e brille tellement qu'il ressemble \u00e0 une pierre pr\u00e9cieuse. Les p\u00eacheurs qui en trouvent un dans leurs filets le consid\u00e8rent comme un pr\u00e9sage de prosp\u00e9rit\u00e9 financi\u00e8re.",
      "desc_ko": "\ubcf4\uc11d\ud654\ud55c \uaecd\ub370\uae30\ub294 \ubb34\uc9c0\uac1c\ucc98\ub7fc \uc5ec\ub7ec \uc0c9\uc73c\ub85c \ube5b\ub09c\ub2e4. \uc774\uac83\uc744 \ub09a\uc544\uc62c\ub9b0 \uc5b4\ubd80\uc5d0\uac8c\ub294 \uc601\uc6d0\ud55c \ubd80\uac00 \uc57d\uc18d\ub41c\ub2e4\uace0 \ud55c\ub2e4.",
