      "name_ko": "\ud64d\ud569",
      "desc_en": "Kholusians have feasted on the juicy innards of these pitch-black mollusks since time immemorial. The ale sauce in which they are often served gives the dish its distinct flavor, while the mussels themselves are noticeably more succulent than most other varieties.",
      "desc_ja": "\u9ed2\u304f\u7d30\u9577\u3044\u4e8c\u679a\u8c9d\u3002\u30b3\u30eb\u30b7\u30a2\u5cf6\u3067\u306f\u53e4\u304f\u304b\u3089\u98df\u7528\u8c9d\u3068\u3057\u3066\u89aa\u3057\u307e\u308c\u3066\u304a\u308a\u3001\u30a8\u30fc\u30eb\u3067\u716e\u8fbc\u3093\u3060\u6599\u7406\u306a\u3069\u304c\u6709\u540d\u3060",
      "desc_de": "Die gemeine Miesmuschel mit ihrer unverkennbar schwarzen Schale war schon immer fester Bestandteil des Speiseplans der Bewohner Kholusias. Traditionell werden die Weichtiere fangfrisch in einem zwergischen Biersud gekocht, bis sie so zart sind, dass sie auf der Zunge zergehen. Das kr\u00e4ftige Seetangaroma bildet dann mit der Biersauce ein einzigartiges, kulinarisches Erlebnis.",
      "desc_fr": "Ce mollusque marin bivalve est un mets de choix de la r\u00e9gion de Kholusia depuis les temps anciens. Traditonellement, les moules sont mijot\u00e9es \u00e0 la vapeur dans un bouillon \u00e0 base de bi\u00e8re blonde.",
      "desc_ko": "\uae38\ucb49\ud55c \uac80\uc740\uc0c9 \uc870\uac1c. \uc608\ubd80\ud130 \ucf5c\ub8e8\uc2dc\uc544 \uc12c\uc5d0\uc11c\ub294 \uc2dd\uc6a9 \uc870\uac1c\ub85c \uce5c\uc219\ud558\uba70, \ub9e5\uc8fc\ub97c \ub123\uace0 \ud479 \ub053\uc778 \uc694\ub9ac\uac00 \uc720\uba85\ud558\ub2e4.",
