      "id": 28070,
      "name_en": "The Sound of Fury",
      "name_ja": "\u30d5\u30e5\u30fc\u30ea\u30a3\u30d9\u30bf",
      "name_de": "Roter D\u00e4mon",
      "name_fr": "Betta enrag\u00e9",
      "name_ko": "\uc9c0\uc625\ubd88\ud22c\uc5b4",
      "desc_en": "While wild red bettas are known for their limitless aggression, this particular specimen lives only to viciously torment its fellow wavekin. The manner in which it unrelentingly attacks foes much larger than itself is enough to give even the Fuath reason to avoid this flame-red horror.",
      "desc_ja": "\u51f6\u66b4\u306a\u6c17\u6027\u305d\u306e\u307e\u307e\u306e\u3001\u61a4\u6012\u306b\u71c3\u3048\u308b\u304c\u5982\u304d\u8d64\u3044\u9c57\u3092\u6301\u3064\u3002\u540c\u65cf\u3092\u5f15\u304d\u9023\u308c\u3066\u56de\u904a\u3059\u308b\u59ff\u306f\u3001\u30d5\u30fc\u30a2\u65cf\u3059\u3089\u9707\u3048\u4e0a\u304c\u3089\u305b\u308b\u307b\u3069",
      "desc_de": "Rote Bettas sind ohnehin schon bekannt f\u00fcr ihre hohe Aggressivit\u00e4t, doch dieses besondere Exemplar scheint seine Aggressionen sogar an seinen Artgenossen auszulassen. Der rote Betta ist so gemeingef\u00e4hrlich, dass selbst die Fuath einen weiten Bogen um sein Territorium machen.",
      "desc_fr": "Tout comme son nom l'indique, cette vari\u00e9t\u00e9 de betta est par\u00adti\u00adcu\u00adli\u00e8\u00adrement agressive. Ces poissons sont si f\u00e9roces que m\u00eame les Fuath font tout pour \u00e9viter de croiser leur chemin.",
      "desc_ko": "\ud3ec\uc545\ud55c \uc131\uc9c8\uc740 \uadf8\ub300\ub85c\uc774\uba70, \ubd89\uc740 \ube44\ub298\uc740 \ub9c8\uce58 \ubd84\ub178\uc5d0 \ud0c0\uc624\ub974\ub294 \ub4ef\ud558\ub2e4. \ub3d9\uc871\uc744 \uc774\ub04c\uace0 \ud68c\uc720\ud558\ub294 \ubaa8\uc2b5\uc740 \ud478\uc544\uc871\uc870\ucc28 \ubc8c\ubc8c \ub5a8 \uc815\ub3c4\ub77c\uace0 \ud55c\ub2e4.",
