      "desc_ja": "\u767d\u9ed2\u306e\u4f53\u8868\u3092\u3001\u30ed\u30f3\u30be\u65cf\u304c\u7a00\u306b\u6301\u3064\u7e1e\u6a21\u69d8\u306b\u55a9\u3048\u3066\u547c\u3070\u308c\u308b\u3002\u5a01\u5687\u6642\u306b\u898b\u305b\u308b\u8868\u60c5\u306f\u3001\u30ed\u30f3\u30be\u306e\u3044\u304b\u3081\u3057\u3055\u306b\u4f3c\u305a\u5fae\u7b11\u307e\u3057\u3044",
