      "desc_fr": "Cette esp\u00e8ce tient son nom des ronsos dont le pelage est parfois z\u00e9br\u00e9 de noir et de blanc. Son visage se d\u00e9forme lorsqu'il tente d'intimider un pr\u00e9dateur, mais l'effet est pour le moins ridicule.",
