      "name_fr": "L\u00e9zard chausse-trappe",
      "name_ko": "\ubabb\ub3c4\ub9c8\ubc40",
      "desc_en": "This wavekin's hide becomes sturdier and heavier as it ages, perhaps to protect it from the ocean's myriad predators. Of particular note are records from Nabaath Areng of a peculiar punishment in which criminals were made to wear attire fashioned from this hide, its weight serving as a literal burden of guilt. ",
      "desc_ja": "\u9f62\u3092\u91cd\u306d\u3055\u3089\u306b\u786c\u8cea\u5316\u3057\u305f\u30c8\u30b2\u30c8\u30ab\u30b2\u3002\u30ca\u30d0\u30b9\u30a2\u30ec\u30f3\u738b\u56fd\u3067\u306f\u3001\u305d\u306e\u76ae\u9769\u3092\u5185\u5074\u306b\u53d6\u308a\u4ed8\u3051\u305f\u670d\u3092\u56da\u4eba\u306b\u7740\u305b\u308b\u5211\u7f70\u304c\u5b58\u5728\u3057\u305f",
      "desc_de": "Bei diesem alten Panzerschweif sind die Stacheln besonders spitz und hart. Im K\u00f6nigreich von Nabaath Areng gibt es eine Bestrafungsform, bei der die Kleidung der H\u00e4ftlinge innen mit Nagelschweif-Haut ausgekleidet wird.",
      "desc_fr": "On nomme ainsi les vieux l\u00e9zards \u00e0 \u00e9pines dont les excroissances \u00e9cailleuses se sont durcies au fil des ann\u00e9es. Dans l'ancien royaume de Nabaath Areng, une sentence consistait d'ailleurs \u00e0 porter un v\u00eatement barbel\u00e9 fait de leur peau.",
      "desc_ko": "\ub098\uc774\ub97c \uba39\uc73c\uba70 \ub354\uc6b1 \ub2e8\ub2e8\ud574\uc9c4 \uac00\uc2dc\ub3c4\ub9c8\ubc40. \ub098\ubc14\uc2a4\uc544\ub81d \uc655\uad6d\uc5d0\uc11c\ub294 \uadf8 \uac00\uc8fd\uc744 \uc548\ucabd\uc5d0 \ub367\ub304 \uc637\uc744 \uc8c4\uc778\uc5d0\uac8c \uc785\ud788\ub294 \ud615\ubc8c\uc774 \uc874\uc7ac\ud588\ub2e4.",
