      "name_ko": "\ud53d\uc2dc\ubb34\uc9c0\uac1c",
      "desc_en": "Legend tells of an overcurious pixie who tread too close to Phisor Lran, but escaped their terrible fate by transforming into a fish. However, whether it be with fang and claw or with hook, line, and sinker, fate has a way of catching those who run from it.",
      "desc_ja": "\u4e0d\u7528\u610f\u306b\u30d5\u30a3\u30bd\u30fc\u30fb\u30e9\u30fc\u30f3\u306b\u8fd1\u3065\u304d\u3001\u6b7b\u306c\u307b\u3069\u6050\u308d\u3057\u3044\u76ee\u306b\u906d\u3063\u305f\u30d4\u30af\u30b7\u30fc\u304c\u3001\u73fe\u5b9f\u9003\u907f\u3059\u308b\u305f\u3081\u306b\u9b5a\u306b\u5316\u3051\u305f\u59ff\u3060\u3068\u8a00\u308f\u308c\u3066\u3044\u308b",
      "desc_de": "Man sagt, dieses wundersame Wesen sei entstanden, als eine Pixie in Phisor Lran aus Langeweile einen Fisch verzauberte.",
