      "desc_ko": "\ubd80\uc8fc\uc758\ud558\uac8c \ud53c\uc18c \ub780\uc5d0 \uac00\uae4c\uc774 \uac14\ub2e4\uac00 \uc8fd\uc744 \ub9cc\ud07c \ud5d8\ud55c \uaf34\uc744 \ub2f9\ud55c \ud53d\uc2dc\uac00, \ud604\uc2e4\uc5d0\uc11c \ub3c4\ud53c\ud558\uae30 \uc704\ud574 \ubb3c\uace0\uae30\ub85c \ubcc0\ud55c \ubaa8\uc2b5\uc774\ub77c\uace0 \ud55c\ub2e4.",
