      "desc_de": "Diese besonders gro\u00dfe Seifenblase soll einem Ger\u00fccht zufolge aus dem Seufzer eines Ondo entstanden sein, als dieser sehns\u00fcchtig seinen Kopf ins Wasser tauchte.",
      "desc_fr": "Une vari\u00e9t\u00e9 de poisson-p\u00eacheur bien plus grosse que la moyenne. La l\u00e9gende voudrait que lorsqu'un Ondo devient nostalgique de sa vie sous-marine, il trouve une flaque d'eau et pousse un long soupir qui donne naissance \u00e0 ces poissons.",
