      "desc_ja": "\u5fae\u5f31\u306a\u523a\u80de\u6bd2\u3092\u6301\u3064\u30af\u30e9\u30b2\u3002\u7b2c\u4e03\u970a\u707d\u76f4\u5f8c\u306b\u306f\u74b0\u5883\u30a8\u30fc\u30c6\u30eb\u306e\u4e71\u308c\u306b\u3088\u308a\u5927\u91cf\u767a\u751f\u3057\u3001\u30e9\u30ce\u30b7\u30a2\u306e\u6d77\u5cb8\u3092\u57cb\u3081\u5c3d\u304f\u3057\u305f",
