      "name_fr": "Poisson-tournesol",
      "name_ko": "\ud574\ub2d8\ub098\ube44\uc5b4",
      "desc_en": "Schools of these fish are often referred to as swimming flowerbeds, so named for their vibrant scales and flower petal shape. A decidedly bashful aquatic flower, some might say, for few have ever had the pleasure of beholding their beauty up close.",
      "desc_ja": "\u7fa4\u6cf3\u3059\u308b\u69d8\u5b50\u3092\u3001\u6d77\u4e2d\u306b\u967d\u5149\u5dee\u3059\u82b1\u7551\u304c\u73fe\u308c\u305f\u3088\u3046\u3060\u3068\u55a9\u3048\u3066\u547c\u3070\u308c\u308b\u3002\u5927\u5909\u81c6\u75c5\u306a\u305f\u3081\u3001\u8fd1\u3065\u3044\u3066\u305d\u306e\u3055\u307e\u3092\u773a\u3081\u308b\u306e\u306f\u81f3\u96e3\u306e\u308f\u3056",
      "desc_de": "Diese Schmetterlinge treten oft in Schw\u00e4rmen auf und lieben sonnige, mit Pflanzen bewachsene Fl\u00e4chen. Sie sind sehr schreckhaft, sodass ihr farbenfrohes Schauspiel nur selten beobachtet werden kann.",
      "desc_fr": "Les \u00e9cailles de ce poisson \u00e9mettent une lumi\u00e8re si intense qu'on pourrait croire qu'elles ont absorb\u00e9 celle du soleil \u00e0 travers l'eau. H\u00e9las, il est tellement peureux que l'observer de pr\u00e8s est quasiment un exploit.",
      "desc_ko": "\ubb34\ub9ac\uc9c0\uc5b4 \ud5e4\uc5c4\uce58\ub294 \ubaa8\uc2b5\uc774 \ub9c8\uce58 \ubc14\ub2f7\uc18d\uc5d0 \ud587\ube5b\uc774 \ube44\uce58\ub294 \uaf43\ubc2d\uc774 \ub098\ud0c0\ub09c \uac83 \uac19\ub2e4\uace0 \ud558\uc5ec \uc774\ub7f0 \uc774\ub984\uc774 \ubd99\uc5ec\uc84c\ub2e4. \uad49\uc7a5\ud788 \uac81\uc774 \ub9ce\uae30 \ub54c\ubb38\uc5d0 \uac00\uae4c\uc774\uc5d0\uc11c \uad6c\uacbd\ud558\uae30\uac00 \ubab9\uc2dc \uc5b4\ub835\ub2e4.",
