      "id": 29719,
      "name_en": "Jasperhead",
      "name_ja": "\u30b8\u30e3\u30b9\u30d1\u30fc\u30d8\u30c3\u30c9",
      "name_de": "Jaspis",
      "name_fr": "T\u00eate-de-jaspe",
      "name_ko": "\ubcbd\uc625\uba38\ub9ac",
      "desc_en": "Easily identified by their nuchal hump, jasperheads are highly prized for the unique, calcified stones formed in their bellies, said to match even the most opulent of jewels in color and beauty. The naturalist who named this fish denies all accusations that its nomenclature is at all related to his feud with an ex-colleague.",
      "desc_ja": "\u816b\u308c\u305f\u3088\u3046\u306b\u7a81\u8d77\u3057\u305f\u524d\u984d\u90e8\u3092\u6301\u3064\u3002\u5fae\u751f\u7269\u3092\u6e9c\u3081\u3066\u5185\u90e8\u3067\u77f3\u5316\u3055\u305b\u3066\u304a\u308a\u3001\u72ec\u7279\u306e\u98a8\u5408\u3044\u306e\u77f3\u306f\u597d\u4e8b\u5bb6\u306b\u3088\u308a\u53d6\u5f15\u3055\u308c\u3066\u3044\u308b",
      "desc_de": "Dieser seltsame Fisch ist an seiner wulstigen Stirn zu erkennen. Er verschluckt seine Beute und verwandelt sie in seinem Magen zu Stein. Diese Steine sind sehr selten und von Sammlern hei\u00df begehrt.",
      "desc_fr": "Facilement identifiable gr\u00e2ce \u00e0 sa protub\u00e9rance cr\u00e2nienne, ce poisson est tr\u00e8s recherch\u00e9 en raison des pierres pr\u00e9cieuses qui se forment dans son ventre au cours de la digestion, et qui rivalisent de beaut\u00e9 avec les diamants les plus \u00e9tincelants.",
      "desc_ko": "\ud639\ucc98\ub7fc \ud22d \ud280\uc5b4\ub098\uc628 \uc774\ub9c8\ub294 \uccb4\ub0b4\uc5d0\uc11c \ubbf8\uc0dd\ubb3c\uc744 \ubaa8\uc544 \uc11d\ud654\uc2dc\ud0a8 \uac83\uc73c\ub85c, \uc774 \ub3c5\ud2b9\ud55c \ub3cc\uc740 \ud638\uc0ac\uac00\ub4e4 \uc0ac\uc774\uc5d0\uc11c \uac70\ub798\ub418\uace0 \uc788\ub2e4.",
