      "name_de": "Matthai",
      "name_fr": "Requin terni",
      "name_ko": "\ubcc0\uc0c9\uc0c1\uc5b4",
      "desc_en": "A distant relative of the silver shark, its tarnished, dark grey skin is attributed to the warmer climate of its home near Galadion Bay.",
      "desc_ja": "\u30ac\u30e9\u30c7\u30a3\u30aa\u30f3\u6e7e\u306b\u68f2\u606f\u3059\u308b\u30b7\u30eb\u30d0\u30fc\u30b7\u30e3\u30fc\u30af\u306e\u4e9c\u7a2e\u3002\u6c34\u6e29\u3084\u6d77\u6d41\u306e\u9055\u3046\u6d77\u57df\u306b\u9032\u51fa\u3057\u305f\u305f\u3081\u3001\u751f\u6765\u306e\u9280\u8272\u306e\u4f53\u76ae\u3092\u9ed2\u304f\u5909\u5bb9\u3055\u305b\u3066\u3044\u308b",
      "desc_de": "Der Matthai ist ein Verwandter der Silberhaie, die vorwiegend in S\u00fcdsee-Gew\u00e4ssern heimisch sind. Im Laufe seiner langen Wanderschaften hat er sich an k\u00e4ltere Gefilde angepasst und seine ledrige Schuppenhaut hat ein mattes Grau angenommen, wodurch er von seiner Beute kaum noch vom umgebenden, dunklen Wasser zu unterscheiden ist.",
      "desc_fr": "Il semblerait que la couleur quelque peu fade de cette esp\u00e8ce, qui descend du requin argent\u00e9 de la baie de Galadion, soit due au climat diff\u00e9rent dans lequel elle \u00e9volue maintenant.",
