      "desc_en": "The rosy bream is known to have the shortest spawning season of any species of Bianaq bream, and some say it is for this reason their scales boast the richest colors. Even their eggs are an unusually vivid shade of crimson, leading many to believe theirs are the most nutritious and therefore worthy of a steeper price at market.",
      "desc_ja": "\u30d3\u30a2\u30ca\u30c3\u30af\u30d6\u30ea\u30fc\u30e0\u306e\u3046\u3061\u3001\u7523\u5375\u671f\u3092\u63a7\u3048\u3066\u4f53\u8272\u3092\u6fc3\u304f\u3057\u305f\u3082\u306e\u3002\u7d05\u8272\u304c\u9bae\u3084\u304b\u306a\u9b5a\u5375\u3082\u9ad8\u5024\u3067\u53d6\u5f15\u3055\u308c\u308b",
      "desc_de": "Diese Unterart der Bianaq-Brassen zeichnet sich durch eine besonders dunkle Farbe aus. Auch der Laich ist tiefrot und gilt als ausgesprochene Delikatesse.",
