      "desc_en": "Whether it be because of some long-forgotten affront to their honor or because they collectively forgot their natural shape, no specimen of this blowfish has ever been caught in a deflated state. Although one has never been observed exploding, fishers have given it this moniker in the fear that one day some poor soul might end up with a face full of spines.",
      "desc_ja": "\u81a8\u3089\u3093\u3060\u307e\u307e\u840e\u307e\u305a\u3001\u5e38\u306b\u300c\u30dc\u30e0\u300d\u7136\u3068\u3057\u305f\u59ff\u306e\u30d0\u30eb\u30fc\u30f3\u30d5\u30a3\u30c3\u30b7\u30e5\u306e\u4e9c\u7a2e\u3002\u4e00\u8aac\u306b\u3088\u308b\u3068\u3001\u6012\u308a\u3063\u3071\u306a\u3057\u306e\u72b6\u614b\u3067\u3042\u308b\u3068\u3044\u3046",
