      "desc_fr": "Cette esp\u00e8ce de poisson porc-\u00e9pic ne d\u00e9gonfle pour ainsi dire jamais et semble donc constamment sur le point d'exploser. Son nom est cer\u00adtai\u00adne\u00adment d\u00fb \u00e0 la peur qu'ont \u00e9prouv\u00e9 ses d\u00e9couvreurs en la voyant.",
