      "name_fr": "Poisson-tr\u00e9pied",
      "name_ko": "\uc0bc\uac01\uace0\uae30",
      "desc_en": "The sturdy fins of this fish maintain their firmness even bells after they have been wrested from the seas. In fact, by measuring the distance of each fin from the other, many say you can form a triangle whose proportions are as precise as any an arcanist could devise.",
      "desc_ja": "\u91e3\u308a\u4e0a\u3052\u3066\u3082\u56fa\u304f\u59ff\u52e2\u3092\u4fdd\u3066\u308b\u307b\u3069\u3001\u9811\u5f37\u306a\u80cc\u30d3\u30ec\u80f8\u30d3\u30ec\u3092\u6301\u3064\u3002\u6b63\u9762\u304b\u3089\u306e\u8868\u60c5\u306f\u3001\u7f8e\u3057\u3044\u4e8c\u7b49\u8fba\u4e09\u89d2\u5f62\u3092\u63cf\u304f\u3068\u3044\u3046",
      "desc_de": "Die stachelbewehrten R\u00fccken- und Bauchflossen dieses Fisches stellen gef\u00e4hrliche Waffen dar, selbst dann noch, wenn der Fisch vermeintlich hilflos am Haken aus dem Wasser gezogen wird. Das musste schon so mancher Fischer schmerzlich erfahren.",
      "desc_fr": "Les nageoires de ce poisson sont d'une solidit\u00e9 \u00e0 toute \u00e9preuve, et forment un triangle aux proportions si parfaites qu'il ne cessera jamais d'\u00e9merveiller les g\u00e9om\u00e8tres dot\u00e9s de suf\u00adfi\u00adsam\u00adment de spiritualit\u00e9.",
      "desc_ko": "\ub09a\uc2ef\ubc14\ub298\uc5d0 \uac78\ub824\ub3c4 \uc790\uc138\ub97c \uace7\uac8c \uc720\uc9c0\ud560 \uc218 \uc788\uc744 \uc815\ub3c4\ub85c \ub2e8\ub2e8\ud55c \ub4f1\uc9c0\ub290\ub7ec\ubbf8\uc640 \ubc30\uc9c0\ub290\ub7ec\ubbf8\ub97c \uac00\uc9c4 \ubb3c\uace0\uae30. \uc815\uba74\uc5d0\uc11c \ubcf4\uba74 \uae54\ub054\ud55c \uc774\ub4f1\ubcc0\uc0bc\uac01\ud615 \ubaa8\uc591\uc774\ub77c\uace0 \ud55c\ub2e4.",
