      "id": 29731,
      "name_en": "Crimson Monkfish",
      "name_ja": "\u30af\u30ea\u30e0\u30be\u30f3\u30e2\u30f3\u30af\u30d5\u30a3\u30c3\u30b7\u30e5",
      "name_de": "Karmin-Anglerfisch",
      "name_fr": "Baudroie abyssale pourpre",
      "name_ko": "\uc9c4\ud64d\uc544\uadc0",
      "desc_en": "Inhabiting the turbulent currents of the Rhotano Sea, the dull crimson of this fish's scales is made even more menacing when the proboscis upon its head shines red. Many a treasure-seeking fisher has been drawn in by its ruby glow, but few have returned with anything save open wounds.",
      "desc_ja": "\u30ed\u30fc\u30bf\u30ce\u6d77\u306e\u6d77\u6d41\u306b\u63c9\u307e\u308c\u3001\u4f53\u8868\u3092\u4ec4\u304b\u306b\u7d05\u8272\u306b\u5909\u3048\u305f\u7a2e\u3002\u8a98\u56e0\u7a81\u8d77\u306e\u5149\u3082\u7a00\u306b\u8d64\u8272\u3092\u5e2f\u3073\u308b\u305f\u3081\u3001\u5b9d\u73e0\u3068\u898b\u9055\u3048\u305f\u6f01\u5e2b\u3059\u3089\u8972\u3046",
      "desc_de": "Im Wasser der Rhotano-See hat sich dieser Anglerfisch karmesinrot gef\u00e4rbt. Auch seine Angel strahlt ein rotes Licht aus, sodass sie manchmal von Fischern mit einem Juwel verwechselt wird.",
      "desc_fr": "Ce poisson vivant dans les profondeurs de la mer de Rhotano poss\u00e8de des \u00e9cailles aux reflets rouges. Il se raconte que m\u00eame sa protub\u00e9rance bioluminescente peut briller d'une lueur pourpre, et que plus d'un chasseur de tr\u00e9sors y a laiss\u00e9 des doigts en pensant avoir mis la main sur un rubis !",
      "desc_ko": "\ub85c\ud0c0\ub178 \ud574\uc758 \ud574\ub958\uc5d0 \uc4f8\ub824 \ud45c\uba74\uc774 \uc605\uc740 \ubd84\ud64d\uc0c9\uc73c\ub85c \ubcc0\ud55c \uc885. \uc720\uc778\uc6a9 \ub3cc\uae30\uac00 \uac00\ub054 \ubd89\uac8c \ube5b\ub098\uc11c \ubcf4\ubb3c\ub85c \ucc29\uac01\ud558\ub294 \uc5b4\ubd80\ub3c4 \uc788\uc73c\ub098, \uc7a1\uc73c\ub824 \ub4e4\uba74 \uc5b4\ubd80\uac00 \uacf5\uaca9\ubc1b\uae30 \uc77c\uc464\ub2e4.",
