      "id": 29735,
      "name_en": "Chrome Hammerhead",
      "name_ja": "\u30af\u30ed\u30e0\u30cf\u30f3\u30de\u30fc\u30d8\u30c3\u30c9",
      "name_de": "Chrom-Hammerhai",
      "name_fr": "Requin-marteau de chrome",
      "name_ko": "\ud06c\ub86c \ub9dd\uce58\uc0c1\uc5b4",
      "desc_en": "To many this shark may look much like the one endemic to the Strait of Merlthor, with its protruding eyes and oddly shaped head. Those familiar with the more obscure aspects of these seaborne predators, however, will note that its skin is a darker shade of black, likely due to the unique organisms present in the waters it inhabits.",
      "desc_ja": "\u5927\u304d\u304f\u5f35\u308a\u51fa\u3057\u305f\u982d\u90e8\u304c\u7279\u5fb4\u7684\u306a\u9bab\u3002\u6442\u53d6\u3059\u308b\u5fae\u751f\u7269\u306e\u5f71\u97ff\u306b\u3088\u308a\u4f53\u8868\u306e\u8272\u304c\u9ed2\u304f\u3001\u30e1\u30eb\u30c8\u30fc\u30eb\u6d77\u5ce1\u306b\u68f2\u606f\u3059\u308b\u7a2e\u3068\u306f\u533a\u5225\u3055\u308c\u308b",
      "desc_de": "Wie alle Hammerhaie ist auch dieser Hai an der starken Verbreiterung des Kopfes zu erkennen. Im Vergleich zu anderen Arten ist er auffallend dunkel gef\u00e4rbt.",
      "desc_fr": "Ce requin \u00e0 la t\u00eate si singuli\u00e8re vit dans les eaux du d\u00e9troit de Merlthor. Il doit sa couleur m\u00e9tallique et fonc\u00e9e aux organismes end\u00e9miques du d\u00e9troit dont il se nourrit.",
      "desc_ko": "\ucee4\ub2e4\ub797\uac8c \ud280\uc5b4\ub098\uc628 \uba38\ub9ac \ubd80\ubd84\uc774 \ud2b9\uc9d5\uc778 \uc0c1\uc5b4. \uc12d\ucde8\ud558\ub294 \ubbf8\uc0dd\ubb3c\uc758 \uc601\ud5a5\uc744 \ubc1b\uc544 \ubab8\uc774 \uac80\uc740\uc0c9\uc774\ub2e4. \ub54c\ubb38\uc5d0 \uba5c\ud1a0\ub974 \ud574\ud611\uc5d0 \uc11c\uc2dd\ud558\ub294 \uc885\uacfc \uad6c\ubcc4\ub41c\ub2e4.",
