      "desc_en": "Insatiable in its appetites, this species of eel tends to be fattier than the varieties found in other parts of Eorzea. If they knew what people on land were calling them, perhaps they would save some of the ocean's prey for the other hungry fish.",
      "desc_ja": "\u30ed\u30fc\u30bf\u30ce\u6d77\u306b\u68f2\u606f\u3059\u308b\u30d1\u30a4\u30af\u30a4\u30fc\u30eb\u306f\u3001\u98df\u6b32\u65fa\u76db\u3067\u8eab\u3082\u592a\u3044\u3002\u305d\u308c\u3086\u3048\u3001\u5927\u578b\u5996\u7570\u306e\u30aa\u30fc\u30ac\u306b\u55a9\u3048\u3089\u308c\u308b\u306e\u3060\u3068\u3044\u3046",
