      "desc_ko": "\ub85c\ud0c0\ub178 \ud574\uc5d0 \uc11c\uc2dd\ud558\ub294 \uaf2c\uce58\uc7a5\uc5b4\ub294 \uc2dd\uc6a9\uc774 \uc655\uc131\ud558\uace0 \ubab8\ub3c4 \ub450\ud23c\ud558\ub2e4. \uc774 \ub54c\ubb38\uc5d0 \ub300\ud615 \uc694\ub9c8\uc778 \uc624\uac70\uc5d0 \ube57\ub300\uc5b4 \ubd80\ub978\ub2e4\uace0 \ud55c\ub2e4.",
