      "name_fr": "Dague de Merlthor",
      "name_ko": "\ucd1d\ucd1d\ub2e8\uac80\uc5b4",
      "desc_en": "In contrast to the soaring arcs of its brethren in other parts of the ocean, this fish leaps through the Strait of Merlthor in short, cutting crescents. However, unlike its namesake, two sailors can toss it back and forth for bells and still have all their extremities intact at the end.",
      "desc_ja": "\u4e3b\u306b\u30e1\u30eb\u30c8\u30fc\u30eb\u6d77\u5ce1\u306b\u5206\u5e03\u3059\u308b\u30ea\u30e0\u30ec\u30fc\u30f3\u30ba\u30c0\u30ac\u30fc\u306e\u4e9c\u7a2e\u3002\u3053\u3061\u3089\u306e\u65b9\u304c\u6ed1\u7a7a\u6642\u306e\u98db\u8ddd\u96e2\u304c\u77ed\u304f\u3001\u305d\u306e\u3076\u3093\u5c0f\u523b\u307f\u306b\u8df3\u3076",
      "desc_de": "Diese nahen Verwandten der gemeinen Dolchfische sind in der Stra\u00dfe von Merlthor weit verbreitet. Sie springen nicht ganz so weit, aber daf\u00fcr in k\u00fcrzeren Abst\u00e4nden.",
      "desc_fr": "Cette vari\u00e9t\u00e9 d'exocet, proche de la dague de Llymlaen, vit dans les eaux du d\u00e9troit de Merlthor. Ses nageoires allong\u00e9es lui permettent d'effectuer de petits bonds hors de l'eau, moins hauts que ceux de ses cong\u00e9n\u00e8res, mais bien plus fr\u00e9quents.",
      "desc_ko": "\uc8fc\ub85c \uba5c\ud1a0\ub974 \ud574\ud611\uc5d0 \ubd84\ud3ec\ud558\ub294 \ub9ac\ubbc8\ub80c \ub2e8\uac80\uc5b4\uc758 \uc544\uc885. \ud65c\uacf5\ud560 \ub54c\uc758 \ube44\uac70\ub9ac\uac00 \uc9e7\uc544 \uc885\uc885\uac70\ub9ac\ub4ef \ud384\ub5a1\ub304\ub2e4.",
