      "name_ko": "\uc5b4\ub451\uc575\ubb34\uc870\uac1c",
      "desc_en": "This mollusk is able to absorb and process aether through its gills in such a way that it may forgo eating for days at a time\u2500weeks if necessary. A remarkable trait researchers have been eager to incorporate into submarine propulsion systems.",
      "desc_ja": "\u6df1\u6d77\u306e\u74b0\u5883\u30a8\u30fc\u30c6\u30eb\u3092\u5de7\u307f\u306b\u5438\u53ce\u3057\u3001\u30a8\u30b5\u306e\u306a\u3044\u74b0\u5883\u3067\u3082\u9577\u671f\u9593\u6d3b\u52d5\u3067\u304d\u308b\u3002\u6f5c\u6c34\u8266\u52d5\u529b\u306e\u53c2\u8003\u306b\u3001\u7814\u7a76\u3059\u308b\u6280\u5e2b\u3082\u3044\u308b\u307b\u3069",
      "desc_de": "Dieser Kopff\u00fc\u00dfer kann in den ansonsten leblosen Tiefen des Meeres \u00fcberleben, indem er sich von reinem \u00c4ther ern\u00e4hrt. Forscher wollen sich diese Eigenschaft zur Entwicklung leistungsf\u00e4higer Tauchboote zunutze machen.",
      "desc_fr": "Ce mollusque qui peuple les abysses assure sa survie dans ce milieu hostile en aspirant directement l'\u00e9ther autour de lui. Cette facult\u00e9 incroyable attise la curiosit\u00e9 des chercheurs du monde entier.",
      "desc_ko": "\uc2ec\ud574\uc758 \ud658\uacbd \uc5d0\ud14c\ub974\ub97c \ub2a5\uc219\ud558\uac8c \ud761\uc218\ud558\uc5ec \uba39\uc774\uac00 \uc5c6\ub294 \ud658\uacbd\uc5d0\uc11c\ub3c4 \uc624\ub7ab\ub3d9\uc548 \uc6c0\uc9c1\uc77c \uc218 \uc788\ub294 \uc5f0\uccb4\ub3d9\ubb3c. \uc7a0\uc218\ud568 \ub3d9\ub825\uc5d0 \ucc38\uace0\ud558\uace0\uc790 \uc5f0\uad6c\ud558\ub294 \uae30\uc220\uc790\ub3c4 \uc788\uc744 \uc815\ub3c4\uc774\ub2e4.",
