      "desc_ja": "\u5c0f\u3055\u3044\u9b5a\u4f53\u304b\u3089\u60f3\u50cf\u3067\u304d\u306a\u3044\u307b\u3069\u306e\u3001\u591a\u91cf\u3067\u7c92\u305e\u308d\u3044\u306e\u9b5a\u5375\u3092\u7523\u3080\u3002\u306a\u304b\u306a\u304b\u306e\u7f8e\u5473\u3067\u3042\u308a\u3001\u9ad8\u7d1a\u9b5a\u5375\u306e\u4ee3\u7528\u54c1\u3068\u3057\u3066\u6ce8\u76ee\u3055\u308c\u3066\u3044\u308b",
