      "id": 29756,
      "name_en": "Nimble Dancer",
      "name_ja": "\u30cb\u30f3\u30d6\u30eb\u30c0\u30f3\u30b5\u30fc",
      "name_de": "Wellent\u00e4nzer",
      "name_fr": "Danseuse agile",
      "name_ko": "\ub0a0\ub835\ud55c \ubb34\ud76c",
      "desc_en": "The nimble dancer is known not only for the beautiful hues of its scales, but also its elongated fins that seem to dance effortlessly on the ocean's currents. Some fishers liken the rhythmic motion of its fins to the traditional dances of Radz-at-Han.",
      "desc_ja": "\u9577\u304f\u4f38\u3073\u305f\u30d2\u30ec\u3092\u821e\u308f\u305b\u308b\u3088\u3046\u306b\u6cf3\u3050\u59ff\u306f\u3001\u7f8e\u3057\u304f\u3069\u3053\u304b\u5e7b\u60f3\u7684\u3002\u307e\u308b\u3067\u30e9\u30b6\u30cf\u30f3\u3067\u6280\u3092\u6975\u3081\u305f\u8e0a\u308a\u5b50\u306e\u3088\u3046\u3060",
      "desc_de": "Der Wellent\u00e4nzer gleitet mit einer unglaublichen, beinahe phantomhaften Eleganz durch das Meer. Von den Fischern aus Radz-at-Han wird diese Anmut oft mit den dort tradierten Kriegst\u00e4nzen verglichen.",
      "desc_fr": "Ce poisson se distingue par ses belles nageoires bleues, dont le lent battement a quelque chose d'envo\u00fbtant. D'aucuns le comparent volontiers aux plus grandes danseuses de Radz-at-Han.",
      "desc_ko": "\uae30\ub2e4\ub780 \uc9c0\ub290\ub7ec\ubbf8\ub97c \ucda4\ucd94\ub4ef\uc774 \ub098\ubd80\ub07c\uba70 \ud5e4\uc5c4\uce58\ub294 \ubaa8\uc2b5\uc740 \uc544\ub984\ub2f5\uace0\ub3c4 \ud658\uc0c1\uc801\uc774\ub2e4. \ub9c8\uce58 \ub77c\uc790\ud55c\uc5d0\uc11c \ucda4 \uc19c\uc528\ub97c \uac08\uace0\ub2e6\uc740 \ubb34\ud76c\uc640 \uac19\ub2e4.",
