      "id": 29760,
      "name_en": "Azeyma's Sleeve",
      "name_ja": "\u30a2\u30fc\u30bc\u30de\u306e\u5782\u8863",
      "name_de": "Azeyma-Schleier",
      "name_fr": "\u00c9toffe d'Azeyma",
      "name_ko": "\uc544\uc81c\ub9c8\uc758 \ubca0\uc77c",
      "desc_en": "Its beautiful trailing fins are said to conjure images of the sun goddess's flowing robes. Catching one is believed to bring great fortune, provided that it is immediately returned to the waves. Failure to do so will conversely result in the angler and seven generations of their offspring being horribly cursed.",
      "desc_ja": "\u592a\u967d\u795e\u30a2\u30fc\u30bc\u30de\u304c\u6d77\u306b\u843d\u3068\u3057\u305f\u967d\u5149\u306e\u30d9\u30fc\u30eb\u304c\u3001\u751f\u3092\u5f97\u3066\u9b5a\u306b\u306a\u3063\u305f\u3068\u3044\u3046\u4f1d\u8aac\u304c\u3042\u308b\u3002\u8239\u4e57\u308a\u306f\u3001\u898b\u304b\u3051\u305f\u3060\u3051\u3067\u3082\u5409\u5146\u3068\u3059\u308b\u307b\u3069",
      "desc_de": "Einer Legende nach verlor ein Abk\u00f6mmling der Sonne ihren Schal im Meer und der Schal verwandelte sich in einen wundersch\u00f6nen Fisch. Wird einer der treibenden Tellerfische im Meer von Fischern entdeckt, wird dies als gl\u00fcckverhei\u00dfendes Zeichen verstanden.",
      "desc_fr": "La l\u00e9gende raconte qu'Azeyma, d\u00e9esse du soleil et de la justice, aurait laiss\u00e9 tomber \u00e0 la mer un bout d'\u00e9toffe qui aurait alors pris vie sous la forme de ce magnifique poisson. Chez les marins, le simple fait de l'apercevoir annonce une tr\u00e8s grande chance.",
      "desc_ko": "\ud0dc\uc591\uc2e0 \uc544\uc81c\ub9c8\uac00 \ubc14\ub2e4\uc5d0 \ub5a8\uc5b4\ub728\ub9b0 \ud587\ube5b \ubca0\uc77c\uc774 \uc0dd\uc744 \uc5bb\uc5b4 \ubb3c\uace0\uae30\uac00 \ub418\uc5c8\ub2e4\ub294 \uc804\uc124\uc774 \uc788\ub2e4. \uc120\uc6d0\ub4e4\uc740 \ubcf4\uae30\ub9cc \ud574\ub3c4 \uae38\uc870\ub85c \uc5ec\uae38 \uc815\ub3c4\uc774\ub2e4.",
