      "desc_en": "Though its unusual frond-like fins were originally a means of camouflage, they grew larger over time and are now used to threaten those that intrude on its territory. While this may prove effective against smaller wavekin, larger predators will not hesitate to gobble it up, impressive fins or no.",
      "desc_ja": "\u672c\u6765\u306a\u3089\u3070\u6d77\u85fb\u306b\u64ec\u614b\u3057\u3066\u96a0\u308c\u66ae\u3089\u3057\u3066\u3044\u308b\u304c\u3001\u5e7b\u6d77\u6d41\u306e\u6d41\u308c\u306b\u4e57\u308a\u3001\u7a4d\u6975\u7684\u306b\u72e9\u308a\u3092\u59cb\u3081\u305f\u7d50\u679c\u3001\u5927\u304d\u304f\u6210\u9577\u3092\u9042\u3052\u305f\u3088\u3046\u3060",
      "desc_de": "Eigentlich verbergen sich Seedrachen im Seetang, doch diese Seedrachenart l\u00e4sst sich mit den Phantomstr\u00f6mungen treiben und w\u00e4chst mit der Zeit zu erstaunlicher Gr\u00f6\u00dfe heran.",
      "desc_fr": "Ces hippocampes vivent g\u00e9n\u00e9ralement cach\u00e9s dans les algues gr\u00e2ce \u00e0 leurs nageoires mim\u00e9tiques. Toutefois, il arrive que certains suivent les courants spectraux et se mettent \u00e0 chasser, ce qui leur donne l'opportunit\u00e9 de grossir consid\u00e9rablement.",
      "desc_ko": "\uc6d0\ub798\ub294 \ud574\uc870\uc5d0 \uc758\ud0dc\ud558\uc5ec \uc228\uc5b4\uc0b4\uc9c0\ub9cc \ud658\ud574\ub958\ub97c \ud0c0\uace0 \uc801\uadf9\uc801\uc73c\ub85c \uc0ac\ub0e5\uc744 \ud55c \uacb0\uacfc \ucee4\ub2e4\ub797\uac8c \uc131\uc7a5\ud55c \ub4ef\ud558\ub2e4.",
