      "desc_ja": "\u30b5\u30f3\u30b4\u7901\u304c\u3042\u308b\u5357\u65b9\u306e\u6d77\u57df\u304b\u3089\u6d41\u308c\u7740\u3044\u305f\u3068\u601d\u308f\u308c\u308b\u500b\u4f53\u3002\u5e7b\u6d77\u6d41\u306e\u74b0\u5883\u304c\u3001\u3088\u307b\u3069\u6027\u306b\u5408\u3063\u305f\u306e\u304b\u6545\u90f7\u3092\u96e2\u308c\u3066\u306a\u304a\u80a5\u3048\u592a\u3063\u3066\u3044\u308b",
      "desc_de": "Diese Seedrachen sind f\u00fcr gew\u00f6hnlich in den Korallenriffen der S\u00fcdsee beheimatet, doch man vermutet, dass sie ihr angestammtes Habitat verlassen haben, um sich an den n\u00e4hrstoffreichen Phantomstr\u00f6mungen g\u00fctlich zu tun, wodurch sie sich mit der Zeit stattliche, runde B\u00e4uche anfressen.",
      "desc_fr": "Les individus de cette esp\u00e8ce des r\u00e9cifs des mers du sud sont parfois emport\u00e9s jusque vers nos c\u00f4tes. Les courants spectraux semblent par\u00adti\u00adcu\u00adli\u00e8\u00adrement leur r\u00e9ussir si l'on en juge par leur taille une fois arriv\u00e9e ici.",
      "desc_ko": "\uc0b0\ud638\ucd08\uac00 \uc788\ub294 \ub0a8\ucabd \ud574\uc5ed\uc5d0\uc11c \ud758\ub7ec\uc628 \ub4ef\ud55c \uac1c\uccb4. \ud658\ud574\ub958\uc758 \ud658\uacbd\uc774 \uc5b4\uc9c0\uac04\ud788 \ub9c8\uc74c\uc5d0 \ub4e4\uc5c8\ub294\uc9c0 \uace0\ud5a5\uc744 \ub5a0\ub098\uace0 \uc0b4\uc774 \uca98\ub2e4.",
