      "name_ko": "\ubd88\ub7c9\ubc30 \uc0ac\uc6b0\ub8e8\uc2a4",
      "desc_en": "Taking its name from the Rogue River, fossil remains indicate that it was once a land-dwelling scalekin that returned to the water. The other inhabitants of the Rogue River were, by all accounts, rather unhappy with this arrangement, as it proceeded to steal the top position on the food chain.",
      "desc_ja": "\u305d\u306e\u540d\u306f\u300c\u30ed\u30fc\u30b0\u5ddd\u306e\u30c8\u30ab\u30b2\u300d\u3092\u610f\u5473\u3059\u308b\u3002\u30e9\u30ce\u30b7\u30a2\u3067\u767a\u898b\u3055\u308c\u305f\u5316\u77f3\u304b\u3089\u3001\u9678\u751f\u306e\u722c\u866b\u985e\u304c\u6d77\u4e2d\u306b\u623b\u3063\u305f\u7a2e\u3068\u8003\u3048\u3089\u308c\u3066\u3044\u308b",
      "desc_de": "Der Name Schurkosaurus ist eine kreative Zusammensetzung aus \u201eSchurkenstrom\u201c und \u201eEchse\u201c. Einige fantasievolle Freizeit-Arch\u00e4ologen behaupten, dieses Urzeitwesen habe sich aus alten Fossilien gel\u00f6st, die am Schurkenstrom in La Noscea gefunden wurden.",
      "desc_fr": "Son nom signifie \u201creptile de la Rogue\u201d, Rogue \u00e9tant l'autre nom de la rivi\u00e8re aux requins. Des \u00e9tudes bas\u00e9es sur des fossiles d\u00e9couverts en Noscea sugg\u00e8rent qu'il s'agit d'un ancien reptile terrestre qui serait retourn\u00e9 vivre dans l'oc\u00e9an.",
      "desc_ko": "\uc774 \uc774\ub984\uc740 '\ubd88\ub7c9\ubc30 \uac15\uc758 \ub3c4\ub9c8\ubc40'\uc744 \uc758\ubbf8\ud55c\ub2e4. \ub77c\ub178\uc2dc\uc544\uc5d0\uc11c \ubc1c\uacac\ub41c \ud654\uc11d\uc744 \ubcf4\uba74 \uc721\uc9c0 \ud30c\ucda9\ub958\uac00 \ubc14\ub2e4\ub85c \ub3cc\uc544\uac04 \uc885\ub958\ub77c\uace0 \uc5ec\uaca8\uc9c4\ub2e4.",
