      "name_ko": "\uccad\uc18c\uc0c1\uc5b4",
      "desc_en": "Unlike its close cousin, the ferocious hammerhead, this particular species is content to forgo larger prey in favor of scouring the ocean floor for smaller morsels. Given the methodical manner in which it feeds, many believe it is merely trying to keep its habitat free from detritus.",
      "desc_ja": "\u7370\u731b\u3055\u3067\u77e5\u3089\u308c\u308b\u30cf\u30f3\u30de\u30fc\u30d8\u30c3\u30c9\u985e\u3068\u3057\u3066\u306f\u73cd\u3057\u304f\u3001\u6027\u683c\u306f\u6e29\u539a\u3002\u6d77\u5e95\u3092\u6383\u9664\u3057\u3066\u79fb\u52d5\u3059\u308b\u304b\u306e\u3088\u3046\u306b\u3001\u5c0f\u9b5a\u3084\u85fb\u3092\u5438\u3044\u3053\u3093\u3067\u6442\u53d6\u3059\u308b",
      "desc_de": "Dieser Hammerhai ist im Gegensatz zu seinen aggressiven Artgenossen ungew\u00f6hnlich sanftm\u00fctig. Mit seinem breiten Kopf durchpfl\u00fcgt er den Meeresboden und saugt kleine tote Fische und Muscheln auf, bis der Meeresboden blitzblank ist.",
      "desc_fr": "\u00c0 l'inverse de son f\u00e9roce cousin le requin-marteau, cette esp\u00e8ce se distingue par sa docilit\u00e9. M\u00eame pour chasser, il se contente d'aspirer le fretin qui se cache sous la vase comme s'il faisait le m\u00e9nage.",
      "desc_ko": "\uc0ac\ub0a9\ub2e4\uace0 \uc54c\ub824\uc9c4 \ub9dd\uce58\uc0c1\uc5b4\ub958 \uc911\uc5d0\uc11c\ub294 \ub4dc\ubb3c\uac8c \uc628\uc21c\ud55c \uc131\uaca9\uc774\ub2e4. \ubc14\ub2e4 \ubc11\uc744 \uccad\uc18c\ud558\ub4ef \uc774\ub3d9\ud558\uba70 \uc791\uc740 \ubb3c\uace0\uae30\ub098 \ud574\uc870\ub97c \ube68\uc544\ub4e4\uc5ec\uc11c \uc12d\ucde8\ud55c\ub2e4.",
