      "name_fr": "Suppresseur",
      "name_ko": "\uce68\ubb35\uc5b4",
      "desc_en": "Due to the potent-yet-nonlethal poison that courses through its body, those who dine upon its delectable meat find their throats close up after the meal, rendering them unable to speak for several bells. Even served surreptitiously to those who are due to give testimony, making it a popular purchase among the criminal element of Limsa Lominsa.",
      "desc_ja": "\u5e7b\u6d77\u6d41\u306e\u74b0\u5883\u304c\u305d\u3046\u3055\u305b\u308b\u306e\u304b\u3001\u8eab\u306b\u5bbf\u3059\u6bd2\u306e\u6027\u8cea\u304c\u5909\u5316\u3002\u98df\u3059\u3068\u7f8e\u5473\u3060\u304c\u3001\u5589\u304c\u9ebb\u75fa\u3057\u3066\u58f0\u3092\u5931\u3063\u3066\u3057\u307e\u3046\u3089\u3057\u3044",
      "desc_de": "Durch den Einfluss der Phantomstr\u00f6mung entwickelt sich im Fleisch des Schweigefischs ein leichtes Toxin. Es ist nach wie vor k\u00f6stlich, aber nach dem Verspeisen wird der Hals bet\u00e4ubt und die Stimme versagt einem f\u00fcr eine Weile.",
      "desc_fr": "La chair de ce poisson n'est pas seulement d\u00e9licieuse, elle est aussi imbib\u00e9e d'un poison que les courants spectraux ont modifi\u00e9 et amplifi\u00e9. Gr\u00e2ce \u00e0 cette alt\u00e9ration, le suppresseur rend muets ceux qui le d\u00e9vorent en p\u00e9trifiant leurs cordes vocales.",
      "desc_ko": "\ud658\ud574\ub958 \ud658\uacbd \ub54c\ubb38\uc778\uc9c0 \ubab8\uc5d0 \uc788\ub358 \ub3c5\uc758 \uc131\uc9c8\uc774 \ubcc0\ud654\ud588\ub2e4. \uba39\uc73c\uba74 \ub9db\uc788\uc9c0\ub9cc \ubaa9\uc774 \ub9c8\ube44\ub418\uc5b4 \ubaa9\uc18c\ub9ac\ub97c \uc783\uac8c \ub41c\ub2e4\uace0 \ud55c\ub2e4.",
