      "name_ko": "\uc2ec\ud574 \uc7a5\uc5b4",
      "desc_en": "Some fishers claim that the \u201cdeep\u201d part of its name in fact refers to its profound understanding of the greater workings of the universe, rather than the depth at which it swims.",
      "desc_ja": "\u80cc\u30d3\u30ec\u3084\u92ed\u3044\u722a\u3092\u6301\u305f\u306a\u3044\u3001\u539f\u59cb\u7684\u306a\u5f62\u614b\u306e\u53e4\u4ee3\u9b5a\u3002\u30e9\u30d6\u30ab\u306e\u8fd1\u7e01\u7a2e\u3068\u898b\u308b\u3079\u304d\u304b\u5b66\u4f1a\u3067\u8ad6\u4e89\u306e\u7a2e\u3068\u306a\u3063\u3066\u3044\u308b",
      "desc_de": "Der Tiefenaal ist eine uralte, zahnlose Aalart. Manche Experten sagen ihm eine Verwandtschaft mit dem Kragenhai nach, doch das ist pure Spekulation.",
      "desc_fr": "Ce poisson \u00e0 l'\u00e9trange apparence ne poss\u00e8de pas de nageoire dorsale. Le d\u00e9saccord r\u00e8gne encore aujourd'hui chez les zoologistes, car certains pensent que cette esp\u00e8ce serait plus proche du requin frang\u00e9 que de l'anguille.",
