      "desc_ja": "\u30ea\u30e0\u30b5\u30fb\u30ed\u30df\u30f3\u30b5\u653f\u5e81\u304b\u3089\u624b\u914d\u3055\u308c\u3066\u3044\u305f\u5927\u7269\u6d77\u8cca\u3092\u3001\u6d77\u8cca\u8239\u3054\u3068\u846c\u3063\u305f\u3068\u3044\u3046\u5642\u304c\u3042\u308b\u5de8\u5927\u9b5a\u3002\u5225\u540d\u300c\u6d77\u306e\u51e6\u5211\u4eba\u300d",
