      "desc_en": "The first person to look at one of these bizarre creatures and think, \u201cI'm going to eat that,\u201d must surely not have been of sound mind. Yet their blatant disregard for its multitude of spines was rewarded, and they found that the insides were not only creamy and flavorsome, but edible. One cannot help but wonder how many other unpleasant ocean-dwellers were sampled prior to making this unlikely discovery.",
      "desc_ja": "\u8089\u98df\u3092\u7d9a\u3051\u305f\u7d50\u679c\u3001\u5de8\u4f53\u3092\u7372\u5f97\u3057\u305f\u30a6\u30cb\u3002\u5e7b\u6d77\u6d41\u306b\u4e57\u3063\u3066\u4f53\u5f53\u305f\u308a\u3092\u884c\u3044\u3001\u68d8\u3092\u9b5a\u306b\u7a81\u304d\u523a\u3059\u3068\u3001\u5f35\u308a\u4ed8\u3044\u305f\u307e\u307e\u3086\u3063\u304f\u308a\u3068\u6355\u98df\u3059\u308b",
      "desc_de": "Aufgrund ihres Hei\u00dfhungers auf Fleisch w\u00e4chst diese Seeigel-Spezies zu gigantischen Proportionen heran. Typischerweise lassen sie sich von Meeresstr\u00f6mungen treiben und spie\u00dfen mit den langen Stacheln kleine Fische auf, die sie anschlie\u00dfend langsam verzehren.  ",
