      "desc_ko": "\uacc4\uc18d \uc721\uc2dd\uc744 \ud55c \uacb0\uacfc \uac70\ub300\ud574\uc9c4 \uc131\uac8c. \ud658\ud574\ub958\ub97c \ud0c0\uace0 \ubb3c\uace0\uae30\uc5d0 \ubab8\uc744 \ubd80\ub52a\ud600 \uac00\uc2dc\ub97c \uaf42\uc740 \ub2e4\uc74c, \ub2ec\ub77c\ubd99\uc5b4\uc11c \ub290\uae0b\ud558\uac8c \uc7a1\uc544\uba39\ub294\ub2e4.",
