      "name_ko": "\ubc14\ub77c\ubb38\ub514",
      "desc_en": "This wavekin's natural defense is its size; it is simply too large for most other wavekin to fit into their mouths. Other than that, it relies on its sheer ordinariness to remain unnoticed by those predators with the means to make a meal of this docile drifter. Docile, that is, until it catches sight of Lalafell, which are believed to be its favorite snack.",
      "desc_ja": "\u30e1\u30e9\u30b7\u30c7\u30a3\u30a2\u306e\u53e4\u3044\u8a00\u8449\u3067\u300c\u5927\u304d\u306a\u9c57\u300d\u3092\u610f\u5473\u3059\u308b\u540d\u3092\u6301\u3064\u3002\u540d\u306b\u9055\u308f\u305a\u3001\u8179\u90e8\u306e\u9c57\u306f\u30e9\u30e9\u30d5\u30a7\u30eb\u65cf\u306e\u638c\u307b\u3069\u306e\u5927\u304d\u3055\u304c\u3042\u308b",
      "desc_de": "Barramundi ist ein altes Wort aus Meracydia und bedeutet \u201eGro\u00dfe Schuppe\u201c. Und tats\u00e4chlich: Die Bauchschuppen dieses Fisches sind so gro\u00df wie die Handfl\u00e4che eines Lalafell.",
      "desc_fr": "En vieux m\u00e9racydien, barramundi signifie grosse \u00e9caille. Un nom que ce poisson n'a pas usurp\u00e9, si l'on en juge par ses \u00e9cailles abdominales grosses comme des mains de Lalafell.",
