      "name_fr": "Fils prodigue",
      "name_ko": "\ubc29\ud0d5\uc544",
      "desc_en": "Despite having grown to a far larger size than considered necessary for his kind, he continues to roam the waters of the world in search of what a fish would consider a good time, rather than return to his spawning grounds to produce offspring. ",
      "desc_ja": "\u5341\u5206\u306b\u6210\u9577\u3057\u305f\u306b\u3082\u95a2\u308f\u3089\u305a\u3001\u6cb3\u306b\u9061\u4e0a\u3059\u308b\u3053\u3068\u306a\u304f\u5e7b\u6d77\u6d41\u3092\u5de1\u308a\u7d9a\u3051\u308b\u30d6\u30eb\u30fc\u30b5\u30fc\u30e2\u30f3\u3002\u904a\u3073\u6b69\u304f\u653e\u8569\u606f\u5b50\u306b\u55a9\u3048\u3089\u308c\u308b",
      "desc_de": "Diese Blauglocken-Lachse kehren nicht wie andere Artgenossen an ihre Geburtsst\u00e4tte zur\u00fcck, wenn die Zeit gekommen ist. Stattdessen genie\u00dfen sie lieber die Vorz\u00fcge der Phantomstr\u00f6mungen.",
      "desc_fr": "On appelle ainsi les saumons indigo qui pr\u00e9f\u00e8rent rester vivre dans les courants spectraux plut\u00f4t que de frayer dans les rivi\u00e8res.",
      "desc_ko": "\ucda9\ubd84\ud788 \uc131\uc7a5\ud588\uc74c\uc5d0\ub3c4 \uac15\uc73c\ub85c \uac70\uc2ac\ub7ec \uc62c\ub77c\uac00\uc9c0 \uc54a\uace0 \ud658\ud574\ub958\ub97c \uc21c\ud658\ud558\ub294 \ud478\ub978\uc5f0\uc5b4. \ub180\ub7ec \ub2e4\ub2c8\ub294 \ubc29\ud0d5\ud55c \uc790\uc2dd\uc5d0 \ube44\uc720\ub41c\ub2e4.",
