      "name_fr": "Soucoupe flottante",
      "name_ko": "\ubd80\uc720\uc811\uc2dc",
      "desc_en": "When viewed from a distance, could be mistaken for an upturned porcelain saucer. Even when observed from close proximity, the faint pattern even resembles the remnants of a picture rendered in gold leaf.",
      "desc_ja": "\u4e0d\u904b\u306b\u3082\u6d77\u4e2d\u306b\u6d88\u3048\u305f\u3001\u8077\u4eba\u304c\u4e39\u7cbe\u8fbc\u3081\u3066\u4f5c\u308a\u4e0a\u3052\u305f\u767d\u78c1\u306e\u76bf\u304c\u8ee2\u3058\u305f\u59ff\u3068\u3055\u308c\u308b\u3002\u982d\u90e8\u306b\u6b8b\u308b\u8584\u91d1\u306e\u6a21\u69d8\u306f\u3001\u7d75\u4ed8\u3051\u306e\u67c4\u306e\u540d\u6b8b\u3068\u304b",
      "desc_de": "Ein T\u00f6pfer betrachtete gerade stolz einen Porzellanteller, in den er alle seine Schaffenskraft gesteckt hatte, als eine gro\u00dfe Woge sein Schiff traf, er das Gleichgewicht verlor, und der Teller unwiederbringlich ins Meer fiel. Es hei\u00dft, aus dem Porzellan sei eine sch\u00f6ne Meduse zum Leben erweckt worden.",
      "desc_fr": "La l\u00e9gende raconte qu'un artisan a un jour laiss\u00e9 tomber dans la mer une assiette de porcelaine qu'il consid\u00e9rait comme son chef-d'\u0153uvre. La soucoupe se serait lentement transform\u00e9e en une m\u00e9duse portant de discrets motifs dor\u00e9s sur la t\u00eate, derni\u00e8res traces du travail minutieux de l'artisan.",
      "desc_ko": "\ubd88\uc6b4\ud558\uac8c\ub3c4 \ubc14\ub2f7\uc18d\uc73c\ub85c \uc0ac\ub77c\uc9c4, \uc7a5\uc778\uc774 \uacf5\ub4e4\uc5ec \ub9cc\ub4e0 \ubc31\uc790 \uc811\uc2dc\uac00 \ubcc0\ud55c \ubaa8\uc2b5\uc774\ub77c\uace0 \ud55c\ub2e4. \uba38\ub9ac \ubd80\ubd84\uc5d0 \ub0a8\uc544 \uc788\ub294 \ubb38\uc591\uc740 \ub3c4\uae30\uc5d0 \uadf8\ub824\ub123\uc5c8\ub358 \uadf8\ub9bc\uc758 \uc794\uc7ac\ub77c\uace0 \ud55c\ub2e4.",
