      "name_fr": "Sothis",
      "name_ko": "\uc18c\ud2f0\uc2a4",
      "desc_en": "This ancient species of turtle has, for reasons unknown, come to have brilliantly glowing crystal fused with its shell. Those traversing the seas at night have reported seeing their light shining from beneath the waves, earning them the appellation \u201cStar of the Deep.\u201d",
      "desc_ja": "\u305d\u306e\u80cc\u306b\u504f\u5c5e\u6027\u30af\u30ea\u30b9\u30bf\u30eb\u3092\u4ed8\u7740\u3055\u305b\u305f\u53e4\u4ee3\u7363\u3002\u591c\u306b\u306a\u308b\u3068\u6d77\u9762\u306b\u661f\u304c\u77ac\u304f\u3088\u3046\u306b\u898b\u3048\u308b\u305f\u3081\u300c\u6c34\u306e\u4e0a\u306e\u661f\u300d\u3068\u3082\u547c\u3070\u308c\u308b",
      "desc_de": "Auf dem R\u00fccken dieses gewaltigen, lebenden Fossils ist ein Kristall gewachsen, der mit \u00c4ther durchtr\u00e4nkt ist. Nachts, wenn der Dinosaurier an die Meeresoberfl\u00e4che kommt, funkelt der Kristall wie ein Stern. Daher wird er auch als \u201eStern des Meeres\u201c bezeichnet.",
      "desc_fr": "Des cristaux corrompus \u00e0 l'\u00e9clat aveuglant jonchent la carapace ab\u00eem\u00e9e de cette tortue mill\u00e9naire. La nuit, lorsqu'elle nage en eaux peu profondes, elle \u00e9met une lueur brillante dont le reflet \u00e0 la surface lui a valu le surnom d'\u201c\u00e9toile sous-marine\u201d.",
      "desc_ko": "\ub4f1\uc5d0 \ud3b8\uc18d\uc131 \ud06c\ub9ac\uc2a4\ud0c8\uc774 \ubd99\uc5b4 \uc788\ub294 \uace0\ub300 \uc57c\uc218. \ubc24\uc774 \ub418\uba74 \ud574\uc218\uba74\uc5d0 \ubcc4\uc774 \ube5b\ub098\ub294 \ub4ef\uc774 \ubcf4\uc774\uae30 \ub54c\ubb38\uc5d0 '\ubb3c \uc704\uc758 \ubcc4'\uc774\ub77c\uace0\ub3c4 \ubd88\ub9b0\ub2e4.",
