      "name_fr": "Raie corallienne",
      "name_ko": "\uc0b0\ud638\uac00\uc624\ub9ac",
      "desc_en": "So slow-moving and docile are these wavekin that they often become home to several varieties of coral. These complex miniature ecosystems include creatures that spend their entire lives on the back of one of these gentle giants, many of which are edible. As such, a veritable seafood smorgasbord can result from a single catch, if one has the strength to reel it in.",
      "desc_ja": "\u5e83\u3044\u80cc\u9762\u306b\u5bbf\u3057\u305f\u30b5\u30f3\u30b4\u306e\u68ee\u306b\u306f\u3001\u767e\u6570\u7a2e\u306e\u751f\u7269\u304c\u898b\u3064\u304b\u308b\u3068\u3044\u3046\u3002\u5c0f\u9b5a\u306e\u7fa4\u308c\u3082\u68f2\u307f\u7740\u304d\u3001\u3055\u306a\u304c\u3089\u3072\u3068\u3064\u306e\u79fb\u52d5\u30b3\u30ed\u30cb\u30fc\u306e\u3088\u3046",
      "desc_de": "Auf dem R\u00fccken dieses gewaltigen Mantas hat sich ein Korallenriff gebildet, das unz\u00e4hlige kleine Fische beheimatet. Ein Paradies f\u00fcr Taucher.",
      "desc_fr": "Ce sp\u00e9cimen fascinant de raie manta peut se vanter d'\u00eatre l'un des rares \u00eatres vivants \u00e0 avoir un \u00e9cosyst\u00e8me entier sur le corps. Dans son cas, il s'agit d'une myriade de poissons minuscules qui habitent la for\u00eat de coraux qui a pouss\u00e9 sur son dos.",
      "desc_ko": "\ub113\uc740 \ub4f1\uc5d0 \uc0dd\uaca8\ub09c \uc0b0\ud638\uc232\uc5d0\uc11c\ub294 \ubc31\uc5ec \uc885\uc758 \uc0dd\ubb3c\uc774 \ubc1c\uacac\ub41c\ub2e4\uace0 \ud55c\ub2e4. \uc791\uc740 \ubb3c\uace0\uae30 \ub5bc\ub3c4 \ubd99\uc5b4 \uc0b4\uba70, \ub9c8\uce58 \ud558\ub098\uc758 \uc774\ub3d9 \uac70\uc8fc\uc9c0\uc640\ub3c4 \uac19\ub2e4.",
