      "name_de": "Felsenschuppe",
      "name_fr": "Pierr\u00e9cailles",
      "name_ko": "\ubc14\uc704\ube44\ub298",
      "desc_en": "Despite being at the very top of the food chain, this formidable species has nigh-impenetrable natural defenses. They are said to be rockfins that have lived for so long that the stony covering has spread to envelop their entire body. Should the adage, \u201cThere is always a bigger fish,\u201d actually prove true, said bigger fish would no doubt struggle to feast on such an obviously inedible creature.",
      "desc_ja": "\u9577\u304f\u751f\u304d\u904e\u304e\u305f\u8001\u9f62\u306e\u30ed\u30c3\u30af\u30d5\u30a3\u30f3\u3002\u304b\u3064\u3066\u306f\u30ac\u30b9\u3092\u84c4\u3048\u6d6e\u884c\u3057\u3066\u3044\u305f\u304c\u3001\u786c\u8cea\u5316\u304c\u5168\u8eab\u306b\u53ca\u3073\u3001\u91cd\u3055\u3067\u98db\u3079\u306a\u304f\u306a\u3063\u305f\u3089\u3057\u3044",
      "desc_de": "Diese uralte Felsenflosse lebt schon so lange, dass ihr K\u00f6rper sich nach und nach versteinert. Es ist nur eine Frage der Zeit, bis die Physik dieses riesige Wesen wie einen wahrhaftigen Felsen an den Meeresgrund zieht.",
      "desc_fr": "Ce rocquin est si vieux que les plus \u00e9minents savants sont incapables d'estimer quelle \u00e8re l'a vu na\u00eetre. On suppose qu'il \u00e9tait jadis capable d'emmagasiner du gaz pour flotter dans les airs, mais son \u00e9piderme fossilis\u00e9 l'en emp\u00eachant aujourd'hui, il ne s'approche que rarement de la surface.",
      "desc_ko": "\ubb34\ucc99 \uc624\ub798 \uc0b0 \ub178\ub839\uc758 \ubc14\uc704\uc9c0\ub290\ub7ec\ubbf8. \uc608\uc804\uc5d0\ub294 \uac00\uc2a4\ub97c \uba38\uae08\uc5b4 \ub5a0\ub2e4\ub154\uc73c\ub098, \uc628\ubab8\uc774 \ub531\ub531\ud574\uc9c0\uace0 \ubb34\uac70\uc6cc\uc838\uc11c \ub0a0 \uc218 \uc5c6\uac8c \ub41c \ub4ef\ud558\ub2e4.",
