      "desc_ja": "\u6cb3\u795e\u30b5\u30ea\u30e3\u30af\u304c\u77e5\u306e\u6cb3\u3092\u5275\u3063\u305f\u969b\u306b\u751f\u3058\u305f\u3068\u3044\u3046\u73ca\u745a\u3002\u98df\u3059\u3068\u5b66\u529b\u304c\u5411\u4e0a\u3059\u308b\u3068\u306e\u5642\u3092\u4fe1\u3058\u3001\u98df\u4e2d\u6bd2\u306b\u306a\u3063\u305f\u5b66\u5f92\u306f\u6570\u77e5\u308c\u305a",
      "desc_de": "Ein Ger\u00fccht besagt, diese Korallen seien bei ihrer Erschaffung mit Thaliaks Weisheit gesegnet worden und steigerten das Denkverm\u00f6gen, wenn man sie verspeist. Bislang konnte eine erh\u00f6hte Intelligenz jedoch nicht nachgewiesen werden. Heftigste Magenverstimmungen bei leichtgl\u00e4ubigen Studenten hingegen schon.",
      "desc_fr": "La l\u00e9gende raconte que Thaliak cr\u00e9a une rivi\u00e8re de la con\u00adnais\u00adsan\u00adce et chargea ce corail d'en \u00eatre le gardien. Le consommer octroierait la sagesse infinie des Douze, mais aussi et surtout de p\u00e9nibles intoxications alimentaires, si l'on en croit les intr\u00e9pides qui y ont go\u00fbt\u00e9.",
