      "desc_en": "This fish is said to have come into being when a pixie, having grown tired of playing princess, dropped a wreath of flower petals into a nearby pond. Any who have seen a school of these wavekin up close will attest that the legend must be true, for the vibrancy of their coloring rivals that of any flowerbed.",
      "desc_ja": "\u5996\u7cbe\u304c\u8033\u98fe\u308a\u306b\u3057\u3066\u904a\u3093\u3067\u3044\u305f\u82b1\u857e\u304c\u3001\u6e56\u306b\u843d\u3061\u3066\u6cf3\u304e\u3060\u3057\u305f\u3068\u3055\u308c\u308b\u7a2e\u3002\u6c34\u4e2d\u3067\u7fa4\u6cf3\u3059\u308b\u59ff\u306f\u3001\u82b1\u306e\u8302\u307f\u304c\u3046\u3054\u3081\u304f\u3088\u3046",
      "desc_de": "Vor langer, langer Zeit war eine wundersch\u00f6ne Fee auf der Suche nach einem ebenso wundersch\u00f6nen Ohrring. Ihr gefiel weder Gold noch Edelstein; nur die nat\u00fcrliche Zartheit einer kleinen, pinken Knospe vermochte ihr Herz zu ber\u00fchren. Doch dann fiel ihr Ohrring in wildem Spiel in einen Teich, bekam winzige Flossen und schwamm davon.",
      "desc_fr": "On raconte qu'une Pixie en train de jouer avec un bourgeon l'aurait laiss\u00e9 tomber dans le lac et qu'il se serait alors mis \u00e0 nager. Lorsqu'ils se d\u00e9placent en banc, il est facile de les confondre avec des buissons fleuris s'agitant sous l'eau.",
