      "desc_en": "During spawning season, this wavekin becomes enveloped in milky eggs. A small panic was caused when a citizen of the Crystarium mistook a pregnant fish for a waterborne sin eater, and although the mistake was soon realized, the incident earned the creature this ominous moniker forevermore.",
      "desc_ja": "\u7523\u5375\u671f\u306b\u306f\u3001\u4e73\u767d\u8272\u306e\u5375\u3092\u5e83\u304f\u7523\u307f\u4ed8\u3051\u308b\u3002\u307e\u308b\u3067\u7f6a\u55b0\u3044\u306e\u7a2e\u304c\u6492\u304b\u308c\u305f\u3088\u3046\u3060\u3068\u3001\u8b66\u6212\u3057\u305f\u30af\u30ea\u30b9\u30bf\u30ea\u30a6\u30e0\u5e02\u6c11\u306b\u3088\u308a\u540d\u4ed8\u3051\u3089\u308c\u305f",
      "desc_de": "Die milchig-wei\u00dfen Eier dieses riesigen S\u00fcndentr\u00f6sters glitzern w\u00e4hrend der Laichsaison wie kleine, reine Perlen in den Wassern des Quadriviums. Viele Bewohner Crystariums werden von diesem bezaubernd-gespenstischen Anblick in ihren Bann gezogen, starren stundenlang in die sanften Wogen und w\u00fcnschen sich nichts sehnlicher als die Absolution ...",
