      "name_fr": "Mangeur d'hommes",
      "name_ko": "Sweetheart",
      "desc_en": "The encroachment of man-eating wavekin tends to cause a frenzy that does more harm than good. In an effort to stem the panic, the soldiers who first discovered these beasts gave them a nickname that belied their cruel nature. Irony is often lost on the general populace, however, and it is unclear how many naive souls have made the mistake of taking the name literally.",
      "desc_ja": "\u4eba\u98df\u3044\u30ef\u30cb\u306e\u51fa\u6ca1\u60c5\u5831\u3092\u3001\u3044\u304b\u306b\u5e83\u3081\u308b\u3079\u304d\u304b\u3002\u885b\u5175\u56e3\u306f\u60a9\u3093\u3060\u672b\u3001\u3053\u308c\u4ee5\u4e0a\u306a\u3044\u307b\u3069\u308f\u304b\u308a\u6613\u3044\u4ec7\u540d\u3092\u3064\u3051\u308b\u3053\u3068\u306b\u3057\u305f\u3068\u3044\u3046",
