      "name_ko": "Recordkiller",
      "desc_en": "The Viis tell stories of ravenous catfish that lurk just below the surface of shallow lakes, lying in wait until a creature is foolish enough to slake its thirst. For all their wisdom, many a Qitari would fall prey to this trick, and get dragged into the depths along with their accumulated knowledge. That the Viis named this wavekin thusly may indicate which of those losses they viewed to be more egregious. ",
      "desc_ja": "\u6c34\u3092\u98f2\u307f\u306b\u6765\u305f\u9f67\u6b6f\u985e\u306b\u3001\u6c34\u4e2d\u304b\u3089\u98db\u3073\u304b\u304b\u3063\u3066\u6355\u98df\u3059\u308b\u7370\u731b\u306a\u30ca\u30de\u30ba\u3002\u306a\u305c\u304b\u73fe\u5730\u306e\u30f4\u30a3\u30fc\u30b9\u65cf\u304b\u3089\u306f\u300c\u66f8\u8a18\u5b98\u6bba\u3057\u300d\u3068\u547c\u3070\u308c\u308b",
      "desc_de": "Man h\u00f6rt ihn nicht, man sieht ihn nicht. Erst wenn der Silberne Tod seine scharfen Z\u00e4hne in seinem Opfer vergr\u00e4bt, erh\u00e4lt es einen d\u00fcsteren Blick auf sein nahendes Ende. Besonders gerne vergeht sich dieser kapitale Raubfisch an den Grabenden Pfoten, weshalb er im Volksmund auch gerne als Schreiberschreck bekannt ist.",
      "desc_fr": "Ce silure f\u00e9roce se nourrit de rongeurs qui ont le malheur de venir s'abreuver un peu trop pr\u00e8s de lui. Personne ne sait pourquoi les Viis l'appellent le \u201ctueur de scribes\u201d.",
